(13, 'Privacy Policy', '<h2>PRIVACY</h2>\r\n<p>Availing yourself to our products will always be safe and secure. Our privacy policy is stringently enforced so your information is always kept completely confidential. We use different safeguards techniques to assist us in preventing unauthorized access and maintaining data accuracy; including your personal information. Except that, we use some of the contact information such as; name, physical address, telephone number, email address, and information volunteered by the consumer, such as survey information and/or site registrations for the business need. In fact, the information we collect is used to improve the service of our Web page, to notify consumers about updates to our Web site, and for keeping a record for the promotions and the company&rsquo;s announcements. If you do not want to receive e-mail from us in the future, please let us know by sending us e-mail at the Contact Us section.</p>\r\n<h2>SECURITY</h2>\r\n<p>The security of your personal information is very important to&nbsp;Protein District. We have in place physical, administrative and technical safeguards designed to protect your personal information from unauthorized access. In addition, Protein District&nbsp;<strong>uses the highest security protocols and mechanisms to exchange the transmission of sensitive data such as credit card details.</strong></p>', 1, 5, 'سياسة خاصة'),
(16, 'Terms & Services', '<p><strong>User Conduct</strong></p>\r\n<p>In consideration of the availability and your use of Protein District.ae, you agree to comply with all applicable laws and these Terms and Conditions when using such site. You acknowledge that Protein District.ae may investigate any violations of law and may cooperate with law enforcement authorities in prosecuting users in this regard. Additionally, you agree not to:</p>\r\n<p>&ndash; post, transmit, link to, or otherwise distribute any materials, information or content constituting, advocating or encouraging conduct that would constitute a criminal offense or give rise to civil liability, or otherwise use Protein District.ae in a manner which is contrary to law or would serve to restrict or inhibit any other user or customer from using or enjoying Protein District.ae or the Internet;</p>\r\n<p>&ndash; defame, abuse, stalk, harass, threaten or otherwise violate the legal rights of others, including without limitation, rights relating to privacy and publicity;</p>\r\n<p>&ndash; post, transmit, link to, or otherwise distribute any inappropriate, profane, defamatory, infringing, obscene, indecent or unlawful material or information; or</p>\r\n<p>&ndash; post, transmit, link to, or otherwise distribute any information, materials or content (including for greater certainty, software) which contains a virus, cancelbot, Trojan horse, worm or other harmful or disruptive component.</p>\r\n<p><strong>Dealing with Third Parties</strong></p>\r\n<p>You acknowledge and agree that your correspondence or business dealings with any third parties, including without limitation any merchants or advertisers, found on or through Protein District.ae, including without limitation payment for and delivery of related goods and services, and all other terms, conditions, representations and warranties related to such dealings, are solely as between you and such third parties. Protein District.ae assumes no responsibility wha