d are subject to and protected by United States and international copyright and other intellectual property laws and rights. The trademarks, service marks, trade names, and logos (collectively, &ldquo;Marks&rdquo;) contained on the Site, including without limitation Proteindistrict.ae are the sole property of Proteindistrict.ae and may not be copied or otherwise used, in whole or in part without the prior written authorization of Proteindistrict.ae. In addition all page headers, custom graphics and custom icons are Marks of Proteindistrict.ae and may not be copied or otherwise used, in whole or in part without the prior written authorization Proteindistrict.ae. Other copyrights, trademarks, product names, company names, logos or intellectual property are the property of the respective owners with all rights reserved. Any use of any Materials or Marks owned Proteindistrict.ae is considered an infringement or our intellectual property rights (including patent rights) and will be legally pursued as such.</p>\r\n<p>By agreeing to the terms of use contained in this Agreement, you agree that you will not use any text, photos, likenesses or other copyrighted or protected material of Proteindistrict.ae or of other third parties without the prior express written consent of Proteindistrict.ae.</p>\r\n<p></p>\r\n<p><strong>No Statements Regarding Product Claims:</strong></p>\r\n<p>You represent and warrant that you will not make any statements and/or product claims not approved by the United States Food and Drug Administration. If you are unsure about the answer about a product or service, refer others to the manufacturer directly. On each product page we have direct links to the manufacturer&rsquo;s website.</p>\r\n<p><strong>Reselling Products:</strong></p>\r\n<p>Any product purchased Proteindistrict.ae for reselling purposes must be resold at the same or higher price than Proteindistrict.ae referenced as &ldquo;our price.&rdquo; This is necessary to adhere to policies of Minimum Advertised Price. Failure to do so will result in immediate termination of your Proteindistrict.ae account and forfeiture of any and all Rewards Credit in the account</p>\r\n<p></p>\r\n<p><strong>Cancellation and Refund</strong></p>\r\n<p>Our Protein District Online Store guarantees that all sold products are original, authentic, in an excellent condition, and have a minimum of 3 months till expiry date for supplements and 1 month for snacks. If one or more of these conditions are not met in your order, we will be glad to fully refund, return, or exchange it upon your request. Otherwise; we will be sorry not to refund or return it.</p>\r\n<p>Moreover; if the order is not picked up from our warehouses, we can modify or cancel it upon your request.</p>\r\n<p></p>', 1, 6, 'الشروط والخدمات'),
