(66, 33, 1, 'Grenade High Protein Shake', '<h1>ABOUT THIS ITEM</h1>\r\n\r\n<ul>\r\n	<li>High protein shake, featuring over 24 g of protein</li>\r\n	<li>Only 200 calories per 330 ml bottle</li>\r\n	<li>Informed sport approved and accredited</li>\r\n	<li>Lactose-free</li>\r\n	<li>Low sugar</li>\r\n	<li>Approved by the Vegetarian Society</li>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(67, 33, 2, 'Grenade High Protein Shake', '<p>&nbsp;</p>\r\n\r\n<h1>ABOUT THIS ITEM</h1>\r\n\r\n<ul>\r\n	<li>High protein shake, featuring over 24 g of protein</li>\r\n	<li>Only 200 calories per 330 ml bottle</li>\r\n	<li>Informed sport approved and accredited</li>\r\n	<li>Lactose-free</li>\r\n	<li>Low sugar</li>\r\n	<li>Approved by the Vegetarian Society</li>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(90, 1, 1, 'Keto Wise Fat Bombs', '<p>&nbsp;</p>\r\n\r\n<h1>Keto Wise Fat Bombs</h1>\r\n\r\n<ul>\r\n	<li>About this item.</li>\r\n	<li>With zero added sugar and an MCT Oil blend, Keto Wise Fat Bombs are the best-tasting, easiest snack to fuel your day..</li>\r\n	<li>Keto Wise Fat Bombs help you stay in fat burning ketosis with 10g fat per serving..</li>\r\n	<li>Peanut Butter interior and a delicious chocolate coating help you stay on track between meals..</li>\r\n	<li>Convenient for on-the-go snacking while maintaining your lifestyle..</li>\r\n	<li>Contains 16 two-piece, 34g packages. Keto Wise low-carb ketogenic fat Bombs are 1g Net Carb per 34g serving..</li>\r\n	<li>Specialty: Kosher.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Imported from USA.</li>\r\n</ul>\r\n\r\n<p>Size:19.2 Ounce (Pack of 1)</p>\r\n\r\n<p>Specially designed, delicious candies targeting 75% calories from<br />\r\nfat. Made with our own formula of chocolate containing MCT oil<br />\r\nfor optimal Keto results. 10g fat and 1g Net Carbs per 34g<br />\r\npackage! Promotes fat burning ketosis.</p>\r\n\r\n<p>NUTRITION FACTS</p>\r\n\r\n<p><img alt=\\\"Keto Wise Fat Bombs Peanut Butter Cup Patties, 16Count, 19.2 Ounce , Peanut Butter Cup Patties, 19.2 Ounce\\\" src=\\\"https://m.media-amazon.com/images/I/41u6VdYhZqL.jpg\\\" /></p>', '<p>Details For&nbsp;Keto Wise Fat Bombs</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(91, 1, 2, 'قنابل كيتو وايز الدهنية', '<pre>\r\nقنابل كيتو وايز الدهنية</pre>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(94, 3, 1, 'Eatpro Briosnack', '<h1>EATPRO BRIOSNACK</h1>\r\n\r\n<p>&nbsp;</p>', '<p>Details for&nbsp;Eatpro Briosnack</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
