(96, 4, 1, 'Barenaked Konjac Noodles', '<h1>Barenaked Konjac Noodles</h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>BARENAKED FOODS IS FOR EVERYONE WHETHER YOU HAVE A SPECIFIC DIETARY NEED, INTOLERANCE, WANT TO LOSE WEIGHT OR SIMPLY WANT TO HAVE A BALANCED DIET.</p>\r\n\r\n<p>EVERYTHING WE SELL IS LOW CARBOHYDRATE, LOW FAT, LOW CALORIES, GLUTEN FREE AND SUGAR FREE. BASICALLY ALL THE FOOD YOU LIKE AND LOVE STRIPPED BARENAKED OF THE BAD BITS.</p>\r\n\r\n<p><strong>OUR PRODUCTS ARE:</strong></p>\r\n\r\n<ul>\r\n	<li>HIGH FIBER</li>\r\n	<li>NO SUGAR</li>\r\n	<li>LOW CALORIE</li>\r\n	<li>GLUTEN FREE (WE HAVE HAD IT TESTED TO PROVE IT)</li>\r\n	<li>WHEAT FREE</li>\r\n	<li>SUITABLE FOR VEGETARIANS</li>\r\n	<li>DAIRY FREE</li>\r\n	<li>HALAL APPROVED</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>NUTRITIONAL FACTS:</strong></h2>\r\n\r\n<p><strong>NET WEIGHT:</strong>&nbsp;380g</p>\r\n\r\n<p>PER ONE SERVING (100g)</p>\r\n\r\n<p><strong>CALORIES:</strong>&nbsp;8 KCAL FOR RICE, 18 KCAL FOR NOODLES</p>\r\n\r\n<p><strong>PROTEIN:</strong>&nbsp;0.3g (EXCEPT FOR PROTEIN NOODLES WHICH HAS 3g OF PROTEIN)</p>\r\n\r\n<p><strong>CARBOHYDRATES:</strong>&nbsp;0.1g</p>\r\n\r\n<p><strong>FIBER:</strong>&nbsp;3. 4g</p>\r\n\r\n<p><strong>FAT:</strong>&nbsp;0.1g</p>\r\n\r\n<p><strong>INGREDIENTS :</strong></p>\r\n\r\n<p>WATER, KONJAC FLOUR (3.4%), FIRMING AGENT: CALCIUM HYDROXIDE, SOYBEAN FLOUR (SOYA), OATMEAL FLOUR, WHILST THIS PRODUCT DOES NOT CONTAIN NUTS WE CANNOT GUARANTEE THAT THERE ARE NO TRACES</p>', '<p>Details for&nbsp;Barenaked Konjac Noodles</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(97, 4, 2, 'BARENAKED KONJAC NOODLES', '<h1>BARENAKED KONJAC NOODLES</h1>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(98, 5, 1, 'Max Protein Good Morning Breakfast Cereals', '<h1>Max&nbsp;Protein Good Morning Breakfast Cereals</h1>\r\n\r\n<p><strong>Good Morning from Max Protein is a unique and exclusive combination of 100% organic cereals for breakfast and start the day as you deserve, that is, with more vitality and a number of nutrients perfect for your body as this rich breakfast supplement is composed of flakes of oats, spelt, quinoa and teff. Best of all, it has added POPS topping, which are whey protein isolate and chocolate coated chips that bring a wonderful taste to your mornings.</strong></p>\r\n\r\n<p>As we might know, breakfast is the most important meal of the day, so Max Protein brings to our table the perfect breakfast developed in a delicious presentation of 100% organic cereals to eat with vegetable milk or yogurt and start the day off. One of the main advantages of Good Morning is that it adds to its composition all the benefits of oats, spelt, quinoa and teff, which are grains rich in fiber, natural energy, vitamins, minerals and proteins, perfect to supplement a balanced and healthy diet.</p>\r\n\r\n<p><strong>Good Morning from Max Protein</strong>&nbsp;is a healthy product for your mornings and, if that were not enough, you will not have to worry about proper consumption since it does not contain added sugars and has a protein value of up to 51%, that is, it really is about a perfect alternative for all those sportsmen who care for their figure and, at the same time, require a powerful, healthy and nutritious breakfast to maintain a well-built musculature. In addition, Good Morning from Max Protein is not a boring breakfast like other supplements that have a monotonous and unpalatable flavor, on the contrary, this rich organic cereal adds the delicious topping POPS, which are crunchy rounded chips based on whey protein isolate and coated with chocolate that provide a delicious taste. If you are comfortable, you will not have to get up and cook a breakfast, as Good Morning from Max Protein is ready to eat and enjoy a nutrient boost, ideal to give everything in the day.</p>\r\n\r\n<p>Facts of Good Morning from Max Protein</p>\r\n\r\n<ul>\r\n	<li>Delicious and crunchy cereal based oat flakes, quinoa, spelt and teff</li>\r\n	<li>100% ecological</li>\r\n	<li>No added sugars</li>\r\n	<li>Contains up to 51% protein</li>\r\n	<li>With delicious protein and chocolate coated POPS topping</li>\r\n</ul>\r\n\r\n<p>Incorporating cereals to your breakfasts is an excellent habit to nourish your body, for this reason, do not hesitate to acquire Good Morning from Max Protein, because it is exactly what you need to enjoy nutrients and taste first hour of your mornings.</p>\r\n\r\n<p><strong>Recommended Use:</strong>&nbsp;eat cereal with vegetable milk or yogurt at breakfast. You can also add fruits or eat with any other food.</p>', '<p>Details for&nbsp;Max&nbsp;Protein Good Morning Breakfast Cereals</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(99, 5, 2, 'MAX PROTEIN GOODMORNING BREAKFAST CEREALS', '<h1>MAX PROTEIN GOODMORNING BREAKFAST CEREALS</h1>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(104, 8, 1, 'Chikalab Protein  Dragee Crispy Corn', '<h2>&nbsp;PROTEIN DRAGEE&nbsp;CRISPY CORN</h2>\r\n\r\n<p>Protein Crispy CornDragee from Chikalab are sweets that will definitely please everyone, combining a pleasant pastime with benefits for the body.&nbsp;Each Crispy Corndragee&nbsp;is coated with a layer of protein&nbsp;milk chocolate and in white chocolate as well.&nbsp;Moreover, the chocolate used in the production is a unique joint development of the Chikalab company and Italian chocolatiers.&nbsp;It is made from the purest cocoa without sugar.</p>\r\n\r\n<p>CHIKALAB PROTEIN CHOCOLATE DRAGEES</p>\r\n\r\n<p><strong>CHIKALAB PROTEIN DRAGEE&nbsp;CRISPY CORN</strong></p>\r\n\r\n<ul>\r\n	<li>Protein dragee in chocolate;</li>\r\n	<li>No added simple sugars or gluten;</li>\r\n	<li>Three layers: chocolate-protein-nut&nbsp;</li>\r\n	<li>Using 100% cocoa;</li>\r\n	<li>Whey concentrate in the composition;</li>\r\n	<li>25 grams of protein per 100g of pills;</li>\r\n	<li>With water-soluble corn fiber.</li>\r\n</ul>\r\n\r\n<p><strong>FEATURES&nbsp;</strong></p>\r\n\r\n<p>These pills are just a breakthrough in the world of healthy snacks.&nbsp;I just want to try them.&nbsp;Judge for yourself.&nbsp;A whole nut covered with a layer of protein and milk chocolate and white chocolate as well.&nbsp;How do such pills deserve the fame of a &ldquo;healthy&rdquo; snack?&nbsp;After all, it is essentially a sweetness, but an unusual sweetness.&nbsp;Let&rsquo;s sort it out in order.</p>\r\n\r\n<p>In the middle, there is a&nbsp;<strong>nut</strong>&nbsp;&ndash;&nbsp;<strong>Crispy Corn.</strong>&nbsp;Take your pick.&nbsp;Any nut is a source of valuable nutrients, primarily useful polyunsaturated fats, as well as vitamins and minerals.&nbsp;You can choose such pills with a&nbsp;<strong>cornball</strong>&nbsp;inside.&nbsp;Also a good option.&nbsp;In this case, you are providing yourself with a serving of nutritious water-soluble corn fiber.&nbsp;Again, it&rsquo;s worth mentioning that nuts and corn fiber are both long-lasting satiety.</p>\r\n\r\n<p>Move on.&nbsp;<strong>Protein layer</strong>, and whey concentrate.&nbsp;Any protein is always useful and necessary for the body.</p>\r\n\r\n<p>Finally, a&nbsp;<strong>layer of milk chocolate</strong>.&nbsp;What is its peculiarity?&nbsp;The chocolate used is a joint development of Chikalab technologists and Italian chocolatiers.&nbsp;This chocolate filling contains no sugar and is made with 100 percent cocoa and corn fiber.</p>\r\n\r\n<p><strong>CHIKALAB PROTEIN&nbsp; DRAGEE&nbsp;CRISPY CORN</strong></p>\r\n\r\n<p>Protein dragee in chocolate</p>\r\n\r\n<ul>\r\n	<li>25 grams of protein per 100g of pills</li>\r\n	<li>Whey concentrate in the base</li>\r\n	<li>Sugar-free chocolate</li>\r\n	<li>Inside &ndash; &nbsp;Crispy Corn&nbsp;</li>\r\n	<li>Three layers &ndash; nut / protein / chocolate</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '<p>Details For&nbsp;Chikalab Protein Chocolate Dragees</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(105, 8, 2, 'CHIKALAB PROTEIN CHOCOLATE DRAGEES', '<h1>CHIKALAB PROTEIN CHOCOLATE DRAGEES</h1>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(106, 9, 1, 'X50 Mushroom Chips', '<h1>X50 Mushroom Chips</h1>\r\n\r\n<p>Love the sound of sea salt coated mushrooms? Then you&rsquo;ll love X50&rsquo;s gluten-free, vegan and vegetarian-friendly, vacuum-fried Mushroom Chips!</p>\r\n\r\n<p>Features</p>\r\n\r\n<ul>\r\n	<li>Gluten-free</li>\r\n	<li>Source of fibre</li>\r\n	<li>May support your immune system</li>\r\n	<li>Healthy snacking option</li>\r\n	<li>Vegan and vegetarian-friendly</li>\r\n	<li>Contains real mushrooms</li>\r\n	<li>No trans fat or preservatives</li>\r\n</ul>\r\n\r\n<p>Benefits</p>', '<p>Details For&nbsp;X50 Mushroom Chips</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(107, 9, 2, 'X50 MUSHROOM CHIPS', '<h1>X50 MUSHROOM CHIPS</h1>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(108, 10, 1, 'X50 Broccoli Chips', '<h1>X50 Broccoli Chips</h1>\r\n\r\n<p>X50 Broccoli Chips &ndash; Guilt free snack- Made with ONLY 3 INGREDIENTS!</p>\r\n\r\n<p>If your looking at increasing your vegetable intake or just simply want a healthy snack, look no further!</p>\r\n\r\n<p>Made from real Broccoli with alkalising rock ralt, X50&rsquo;s brocolli chips will not let you down!</p>\r\n\r\n<ul>\r\n	<li>Gluten Free</li>\r\n	<li>Vacuum Fried</li>\r\n	<li>Alkalising Vegetables</li>\r\n	<li>Pesticide Free</li>\r\n	<li>No Preservative</li>\r\n	<li>No Trans Fat</li>\r\n</ul>\r\n\r\n<p>One 40g serve of Broccoli chips is made up of around 400g of raw nutritious broccoli</p>\r\n\r\n<p><a href=\\\"http://proteindistrict.ae/wp-content/uploads/2017/09/x50-broccoli-chips-seasalt-nutrition.jpg\\\"><img alt=\\\"x50-broccoli-chips-seasalt-nutrition\\\" src=\\\"https://proteindistrict.ae/wp-content/uploads/2017/09/x50-broccoli-chips-seasalt-nutrition-211x300.jpg\\\" style=\\\"height:300px; width:211px\\\" /></a></p>\r\n\r\n<p><a href=\\\"http://proteindistrict.ae/wp-content/uploads/2017/09/x50-broccoli-chips-bbq-nutrition.jpg\\\"><img alt=\\\"x50-broccoli-chips-bbq-nutrition\\\" src=\\\"https://proteindistrict.ae/wp-content/uploads/2017/09/x50-broccoli-chips-bbq-nutrition-211x300.jpg\\\" style=\\\"height:300px; width:211px\\\" /></a></p>\r\n\r\n<p><a href=\\\"http://proteindistrict.ae/wp-content/uploads/2017/09/x50-broccoli-chips-spicy-nutrition.jpg\\\"><img alt=\\\"x50-broccoli-chips-spicy-nutrition\\\" src=\\\"https://proteindistrict.ae/wp-content/uploads/2017/09/x50-broccoli-chips-spicy-nutrition-211x300.jpg\\\" style=\\\"height:300px; width:211px\\\" /></a></p>', '<p>Details For&nbsp;X50 Broccoli Chips</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(109, 10, 2, 'X50 BROCCOLI CHIPS', '<h1>X50 BROCCOLI CHIPS</h1>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(110, 11, 1, 'Barebells Protein Bar', '<h1>Barebells Protein Bar</h1>\r\n\r\n<h3><strong>KEY BENEFITS</strong></h3>\r\n\r\n<ul>\r\n	<li>20g Protein</li>\r\n	<li>Low Carbs</li>\r\n	<li>&lt;2g Sugar</li>\r\n	<li>199 Calories</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>CARAMEL &amp; CASHEW</strong></p>\r\n\r\n<p>Tired of eating bars that feel and taste like cardboard? In a blind taste test, the&nbsp;team at Barebells chose this caramel-cashew protein bar over the leading candy bars! Okay&hellip; so maybe we had some idea which was which, but you get the point. This bar is far too gooey and chocolaty to compare to anything but the most decadent of desserts, and yet it has 20g of protein! Staying fit has never been this delicious.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3>NUTRITION FACTS PER 55 G</h3>\r\n	</li>\r\n	<li>\r\n	<ul>\r\n		<li>ENERGY 835 kJ/199 kcal</li>\r\n		<li>FAT 8,3 g, saturated fat 4,2 g</li>\r\n		<li>CARBOHYDRATE 14&nbsp;g, sugars 1,7 g</li>\r\n		<li>FIBER 4,3 g</li>\r\n		<li>PROTEIN 20&nbsp;g</li>\r\n		<li>SALT 0,11 g</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>COCONUT-CHOCO</strong></p>\r\n\r\n<p>Well, you told us you wanted more coconut, and we heard you. This bar is absolutely exploding with coconut flavour, wrapped in creamy milk chocolate and smothered in real coconut flakes. Because you shouldn&rsquo;t have to fight an endless battle between eating what you love and having abs.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3>NUTRITION FACTS PER 55 G</h3>\r\n	</li>\r\n	<li>\r\n	<ul>\r\n		<li>ENERGY 832&nbsp;kJ/199 kcal</li>\r\n		<li>FAT 7,7&nbsp;g, saturated fat 5,1 g</li>\r\n		<li>CARBOHYDRATE 15&nbsp;g, sugars 1,6 g</li>\r\n		<li>FIBER 4,7 g</li>\r\n		<li>PROTEIN 20&nbsp;g</li>\r\n		<li>SALT 0,15 g</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>COOKIES &amp; CREAM</strong></p>\r\n\r\n<p>This bar is sure to satisfy any crazy, creamy craving. Nothing is more classic than cookies and cream, adapted from the most loved cookie in American history. Because for some reason, carrots just aren&rsquo;t as satisfying as chocolate.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3>NUTRITION FACTS PER 55 G</h3>\r\n	</li>\r\n	<li>\r\n	<ul>\r\n		<li>ENERGY 825 kJ/197 kcal</li>\r\n		<li>FAT 7&nbsp;g, saturated fat 4,1&nbsp;g</li>\r\n		<li>CARBOHYDRATE 16&nbsp;g, sugars 1,7 g</li>\r\n		<li>FIBER 3,3 g</li>\r\n		<li>PROTEIN 20&nbsp;g</li>\r\n		<li>SALT 0,17 g</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>SALTY PEANUT</strong></p>\r\n\r\n<p>The latest flavour from&nbsp;Barebells is here!</p>\r\n\r\n<p>Creamy and soft and complete with real salted peanut chunks&hellip; All enrobed in sweet milk chocolate. All this&nbsp;for just 200 calories,&nbsp;20g of protein and only 1.5g of sugar!</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3>NUTRITION FACTS PER 55 G</h3>\r\n	</li>\r\n	<li>\r\n	<ul>\r\n		<li>ENERGY 835 kJ/200 kcal</li>\r\n		<li>FAT 8.5 g, saturated fat 4,4 g</li>\r\n		<li>CARBOHYDRATE 15&nbsp;g, sugars 1,5 g</li>\r\n		<li>FIBER 3,9 g</li>\r\n		<li>PROTEIN 20&nbsp;g</li>\r\n		<li>SALT 0,26 g</li>\r\n	</ul>\r\n	</li>\r\n</ul>', '<p>Details for&nbsp;Barebells Protein Bar</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(111, 11, 2, 'BAREBELLS PROTEIN BAR', '<h1>BAREBELLS PROTEIN BAR</h1>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(112, 12, 1, 'Celsius  Energy Drink', '<h1>Celsius&nbsp; Energy Drink</h1>\r\n\r\n<p>Open up the refreshing flavors of summer and energize your day.&nbsp;CELSIUS has the perfect balance of flavor and energy that serves as an awesome pick-me-up for active lifestyles. Made with clinically proven ingredients.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Essential Energy</li>\r\n	<li>No Sugar, No Preservatives</li>\r\n	<li>No Artificial Flavors or Colors</li>\r\n	<li>7 Essential Vitamins</li>\r\n	<li>200 mg Caffeine</li>\r\n	<li>Gluten-Free, Non-GMO, &amp; Certified Vegan</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>DIRECTIONS FOR USE</p>\r\n\r\n<p>Drink 30 minutes prior to any sporting event to improve energy levels, or alternatively to give your mind body an energy boost when required.</p>', '<h2><em>INGREDIENTS</em></h2>\r\n\r\n<p><strong>GREEN TEA EXTRACT</strong></p>\r\n\r\n<p>The extract used contains a specific ratio of EGCG (epigallocatechin gallate) &mdash;the compound that scientists have found boosts your metabolism and helps your body burn more calories.</p>\r\n\r\n<p><strong>GUARANA SEED EXTRACT</strong></p>\r\n\r\n<p>Unlike most guarana drinks, CELSIUS uses the seeds (instead of the roots), which contain over twice the amount of caffeine than the average coffee bean.</p>\r\n\r\n<p><strong>GINGER ROOT</strong></p>\r\n\r\n<p>Ginger root has a wonderful spicy flavor, and it&#39;s known to help support the process of thermogenesis as well as create a positive effect on digestive systems.</p>\r\n\r\n<p><strong>VITAMIN B</strong></p>\r\n\r\n<p>B-Vitamins are essential for energy production and they help regulate cell health as well as metabolism. They also help support your adrenal glands to help you recover from fatigue.</p>\r\n\r\n<p><strong>VITAMIN C</strong></p>\r\n\r\n<p>Also known as an ascorbic acid, vitamin C is an essential nutrient that aids the immune system and helps with tissue repair and the enzymatic production of certain neurotransmitters.</p>\r\n\r\n<p><strong>CHROMIUM</strong></p>\r\n\r\n<p>Known to help control hunger, chromium is an essential trace mineral that normalizes blood sugar levels and helps enhance the metabolism of proteins, carbohydrates, and lipids.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(113, 12, 2, 'Celsius  Energy Drink', '<h1>Celsius&nbsp; Energy Drink</h1>\r\n\r\n<p>Open up the refreshing flavors of summer and energize your day.&nbsp;CELSIUS has the perfect balance of flavor and energy that serves as an awesome pick-me-up for active lifestyles. Made with clinically proven ingredients.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Essential Energy</li>\r\n	<li>No Sugar, No Preservatives</li>\r\n	<li>No Artificial Flavors or Colors</li>\r\n	<li>7 Essential Vitamins</li>\r\n	<li>200 mg Caffeine</li>\r\n	<li>Gluten-Free, Non-GMO, &amp; Certified Vegan</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>DIRECTIONS FOR USE</p>\r\n\r\n<p>Drink 30 minutes prior to any sporting event to improve energy levels, or alternatively to give your mind body an energy boost when required.</p>', '<h2><em>INGREDIENTS</em></h2>\r\n\r\n<p><strong>GREEN TEA EXTRACT</strong></p>\r\n\r\n<p>The extract used contains a specific ratio of EGCG (epigallocatechin gallate) &mdash;the compound that scientists have found boosts your metabolism and helps your body burn more calories.</p>\r\n\r\n<p><strong>GUARANA SEED EXTRACT</strong></p>\r\n\r\n<p>Unlike most guarana drinks, CELSIUS uses the seeds (instead of the roots), which contain over twice the amount of caffeine than the average coffee bean.</p>\r\n\r\n<p><strong>GINGER ROOT</strong></p>\r\n\r\n<p>Ginger root has a wonderful spicy flavor, and it&#39;s known to help support the process of thermogenesis as well as create a positive effect on digestive systems.</p>\r\n\r\n<p><strong>VITAMIN B</strong></p>\r\n\r\n<p>B-Vitamins are essential for energy production and they help regulate cell health as well as metabolism. They also help support your adrenal glands to help you recover from fatigue.</p>\r\n\r\n<p><strong>VITAMIN C</strong></p>\r\n\r\n<p>Also known as an ascorbic acid, vitamin C is an essential nutrient that aids the immune system and helps with tissue repair and the enzymatic production of certain neurotransmitters.</p>\r\n\r\n<p><strong>CHROMIUM</strong></p>\r\n\r\n<p>Known to help control hunger, chromium is an essential trace mineral that normalizes blood sugar levels and helps enhance the metabolism of proteins, carbohydrates, and lipids.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(114, 13, 1, 'Usn Bcaa Drinks', '<h1>Usn Bcaa Drinks</h1>\r\n\r\n<h3>PRODUCT DESCRIPTION</h3>\r\n\r\n<p>Usn&rsquo;s&nbsp;BCAA is a vegan friendly and Keto friendly ready to drink can of BCAA&rsquo;s with added caffeine.</p>\r\n\r\n<h3>INGREDIENTS</h3>\r\n\r\n<p>Water, L-Leucine, Carbon Dioxide, Acidifier (Citric acid), L-Valine, L-Isoleucine, Natural flavour, L-Carnitine, Colouring plant concentrates (Carrot, Hibiscus), Caffeine, Guarana extract (0.03%), Sweetener (Sucralose), Vitamin blend [Ascorbic acid, Niacin, Vitamin B12, Vitamin B6, Pantothenic acid), Taurine, Green tea extract (0,02%), Ginseng extract (0,03%), Tyrosine.ALLERGENS: No common allergens have been added. WARNING: Contains caffeine (106mg/330ml portion). Not recommended for children, pregnant or breastfeeding women. Do not exceed 400mg caffeine per day from all sources (200mg/day for pregnant or breastfeeding women). Do not exceed 2 x 330ml serving per day. Enjoy as part of a balanced diet and healthy lifestyle. SUGAR FREE FUNCTIONAL DRINK WITH CAFFEINE, AMINO ACIDS, VITAMINS, PLANT EXTRACTS AND WITH SWEETEN- ERS | STORE IN A COOL DRY PLACE OUT OF REACH OF CHILDREN | BEST SERVED CHILLED. ONCE OPENED KEEP REFRIGER- ATED AND CONSUME WITHIN 24 HOURS</p>\r\n\r\n<p>BCAA Power Punch is packed with 5000 mg of BCAAs. It not only contains a powerhouse of BCAAs, the formulation also contains B Vitamins, Ginseng and Guarana to accelerate energy, endurance, focus and recovery while enhancing lean muscle development. 1000 mg of L-carnitine and Green Coffee Bean Extract is included to enhance thermogenesis.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1>NUTRITION INFORMATION</h1>\r\n\r\n<p>Serving Size 330.0 ml</p>\r\n\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<th>PER 100G</th>\r\n			<th>PER 330.0 ML</th>\r\n			<th>RI%</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th><strong>ENERGY</strong></th>\r\n			<th>31 KJ<br />\r\n			7 KCAL</th>\r\n			<th>102 KJ<br />\r\n			23 KCAL</th>\r\n			<th>1.2</t