(116, 14, 1, 'USN Spike Energy Drink', '<h1>USN Spike Energy Drink</h1>\r\n\r\n<p><strong>USN Spike Sugar Free</strong>, formulated to support mental and physical performance by combining effective ingredients to give you the boost you need to perform.</p>\r\n\r\n<p><strong>PERFORM AT YOUR BEST</strong></p>\r\n\r\n<p>A refreshing sugar free energy drink to support you whenever you need a boost.</p>\r\n\r\n<h3>NUTRITION INFORMATION</h3>\r\n\r\n<p>&nbsp;<strong>Ingredients:</strong>&nbsp;water, citric acid, carbon dioxide, acidity regulator (sodium citrate), guarana extract, anhydrous caffeine, colour (sulphite ammonia caramel), inositol, flavouring, sweeteners (acesulfame-K, aspartame*), nicotinamide, calcium d-pantothenate, pyridoxine HCl, cyanocobalamin.</p>\r\n\r\n<p>* Contains phenylalanine.</p>\r\n\r\n<h3>NUTRITION INFORMATION OF SPIKE SUGAR FREE ENERGY DRINK</h3>\r\n\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>INGREDIENTS</th>\r\n			<th>PER 100ML</th>\r\n			<th>PER 250ML</th>\r\n			<th>*%RI</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th>ENERGY</th>\r\n			<td>6kj /1kcal</td>\r\n			<td>15kj /3kcal</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>SALT</th>\r\n			<td>0,16g</td>\r\n			<td>0,41g</td>\r\n			<td>7%</td>\r\n		</tr>\r\n		<tr>\r\n			<th>VITAMINS</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th>\r\n			<p>VITAMIN B3 (NIACIN)</p>\r\n			</th>\r\n			<td>8mg</td>\r\n			<td>20mg</td>\r\n			<td>125%</td>\r\n		</tr>\r\n		<tr>\r\n			<th>\r\n			<p>VITAMIN B5 (PANTHOTENIC ACID)</p>\r\n			</th>\r\n			<td>2mg</td>\r\n			<td>5mg</td>\r\n			<td>83%</td>\r\n		</tr>\r\n		<tr>\r\n			<th>\r\n			<p>VITAMIN B6</p>\r\n			</th>\r\n			<td>2mg</td>\r\n			<td>5mg</td>\r\n			<td>357%</td>\r\n		</tr>\r\n		<tr>\r\n			<th>\r\n			<p>VITAMIN B12</p>\r\n			</th>\r\n			<td>2&mu;g</td>\r\n			<td>5&mu;g</td>\r\n			<td>200%</td>\r\n		</tr>\r\n		<tr>\r\n			<th>CAFFEINE</th>\r\n			<td>32mg</td>\r\n			<td>80mg</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"4\\\">*%RI &ndash; REFERENCE INTAKE OF AVERAGE ADULT (8400 KJ/ 2000KCAL).<br />\r\n			CONTAINS NEGLIGIBLE QUANTITIES OF PROTEIN, CARBOHYDRATE, SUGARS AND FAT.</th>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<h3>DIRECTIONS FOR USE</h3>\r\n\r\n<p>Consume moderately. Drink 30 minutes prior to any sporting event to improve enrgy levels, or alternatively to give your mind body an energy boost when required.</p>', '<p>Details for&nbsp;USN Spike Energy Drink</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(117, 14, 2, 'USN SPIKE ENERGY DRINK', '<h1>USN SPIKE ENERGY DRINK</h1>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(118, 15, 1, 'Usn Qhush Energy Drink', '<h1>Usn Qhush Energy Drink</h1>\r\n\r\n<p>One of the products that has come under the most fire in recent years is the energy drink. Consumers have been asking questions with regards to the content of these drinks as well as the questionable ingredients with little research that constitute some of the drinks out there. It is important to be educated on what is in your favorite energy drink and it is important to find a brand that is willing to disclose its formulation so that you can make informed decisions when buying products.</p>\r\n\r\n<p>Energy drinks are not necessarily meant to be consumed daily but can be used during times of fatigue or when an energy boost is required.</p>\r\n\r\n<p>Energy drinks like most things in life &ndash; need to be used in moderation and responsibly. It is impossible to expect a positive outcome from anything when over-indulging or over-consuming. Below we will discuss what is inside USN&reg;&rsquo;s new &ldquo;It&rsquo;s the Qhush&rdquo; energy drink. This is a collaboration product with the Orlando Pirates soccer team and features a branded look with the tried and proven USN SPIKE X300 formulation.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ingredients:</strong></p>\r\n\r\n<p><strong>&bull; B-vitamins:</strong>&nbsp;Found naturally in food and plays a role in energy metabolism, therefor the most widely used energy supplement ingredient. Assists the body in converting food to energy.</p>\r\n\r\n<p><strong>&bull; Taurine:</strong>&nbsp;An amino acid important in several of the body&rsquo;s metabolic processes, may improve cardiovascular health, insulin resistance and electrolyte balance.</p>\r\n\r\n<p><strong>&bull; L-carnitine tartrate:</strong>&nbsp;Helps transport fatty acids to the mitochondria of cells where it can be used for energy .</p>\r\n\r\n<p><strong>&bull; Panax ginseng:</strong>&nbsp;May fight tiredness and increase energy levels .</p>\r\n\r\n<p><strong>&bull; Caffeine</strong>: Increases energy, mood and relieves fatigue. Acts as a stimulant on the central nervous system to improve alertness and motivation.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>FAQ&rsquo;s about energy drinks:</strong></p>\r\n\r\n<p><strong>Q: Does &ldquo;It&rsquo;s the Qhush&rdquo; contain excessive amounts of caffeine?</strong></p>\r\n\r\n<p>A: No &ndash; &ldquo;It&rsquo;s the Qhush&rdquo; contains 300 mg of caffeine which is equal to 3-4 cups of regular coffee. When consuming an energy drink high in caffeine, it is important to note how much caffeine you consume from other sources as well. The recommended daily allowance for caffeine varies from country to country but is usually between the 300 mg to 400 mg mark.</p>\r\n\r\n<p><strong>Q: Where can I find out what is in my USN &ldquo;It&rsquo;s the Qhush&rdquo;?</strong></p>\r\n\r\n<p>A: USN voluntarily provides the complete formulation of our energy drink on the product label. This is a complete profile of the content as well as the dosages of each ingredient. It is also important to note the warnings and directions of usage on the label.</p>\r\n\r\n<p><strong>Q: How much sugar is in a USN &ldquo;It&rsquo;s the Qhush&rdquo; energy drink?</strong></p>\r\n\r\n<p>A: The product contains zero sugar.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>The matter of fact&hellip;</strong></p>\r\n\r\n<p>Well formulated energy drinks can offer various benefits. It is important that the warnings on the product is noted and that individuals stick to the recommended daily allowances. Individuals who are sensitive to stimulants such as caffeine should always consult with their health care professional before consuming products high in these specific ingredients.</p>\r\n\r\n<p>There are a few products out there that are formulated to be cheap and drastically spike energy levels. These products may not necessarily be the best option when choosing an energy drink. Always read on the can to get some more insight of where the energy is coming from.</p>\r\n\r\n<p>It is also important that energy drinks with stimulants not be taken after 4 p.m. to ensure that sleep is not disrupted.</p>\r\n\r\n<p>You can find our USN &ldquo;It&rsquo;s the Qhush!&rdquo; energy drink in Spar, Dis-Chem, independent pharmacies and and Game stores.</p>\r\n\r\n<p>&nbsp;</p>', '<p>Details for&nbsp;Usn Qhush Energy Drink</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(119, 15, 2, 'USN QHUSH ENERGY DRINK', '<h1>USN QHUSH ENERGY DRINK</h1>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(120, 16, 1, 'Flavorgod Seasonings', '<h1>Flavorgod Seasonings</h1>\r\n\r\n<p><strong>WHO IS FLAVOR GOD?</strong></p>\r\n\r\n<p>WHEN I FIRST BEGAN MAKING THESE SEASONINGS IN 2012, I RELENTLESSLY EXPERIMENTED TO FIND THE IMPECCABLE ELEMENTS THAT WOULD SEPARATE MY SEASONINGS FROM EVERYTHING ELSE CURRENTLY AVAILABLE IN THE MARKET. AFTER ENDLESS HOURS IN THE STATE-OF-THE-ART FLAVORGOD FACILITIES, I WAS ABLE TO PERFECT THE BLEND FOR MULTIPLE SEASONINGS THAT MET EVERY SPECIFICATION I HAD SET OUT TO MEET WITHOUT COMPROMISING FLAVOR OR QUALITY! MY GOAL IS TO KEEP SEASONINGS CHEMICAL AND FILLER FREE, KEEPING LOW SALT LEVELS, AND ALWAYS STAYING TRUE TO THE HERBS AND SPICES THAT I USE. SACRIFICING NUTRITIONAL VALUE HAS NEVER BEEN AN OPTION. THE HEALTH OF PEOPLE AND THE FOODS WE EAT ON A DAILY BASIS IS WHAT TRULY MATTERS TO ME.</p>\r\n\r\n<p>SHORTLY AFTER I CREATED THESE SEASONINGS, I BEGAN SELLING THEM AT LOCAL FARMERS MARKETS. MY SEASONINGS ARE CRAFTED WITH CARE AND SHIPPED TO COUNTRIES ALL OVER THE WORLD. I&rsquo;M NOT A HUGE CORPORATION. I&rsquo;M ONE MAN WITH A DREAM AND THE SUPPORT OF THE BEST TEAM I COULD EVER ASK FOR. OUR DREAM IS TO PROVIDE CREATIVE RECIPES AND HEALTHY SEASONINGS EVERYONE WILL ALWAYS ENJOY.</p>\r\n\r\n<p><strong>WHY FLAVOR GOD?</strong></p>\r\n\r\n<p>MEAL PREPS HAVE A TENDENCY TO BECOME REPETITIVE AND FLAVORLESS DUE TO EATING LARGE QUANTITIES OF FOODS IN THEIR MOST NATURAL STATE FOR OPTIMAL NUTRIENT CONSUMPTION. UP UNTIL RECENTLY, ATHLETES WERE EATING FOR SUSTENANCE AND TO ENSURE THAT THEY WERE CONSUMING ENOUGH CALORIES PER DAY ACCORDING TO THEIR MEAL PLANS. NOW THEY CAN SIMPLY COOK WITH THEIR FLAVOR GOD SEASONINGS OR EVEN SHAKE THE SEASONINGS OVER THEIR MEALS FOR AN ENJOYABLE EXPERIENCE EVERY TIME THEY&rsquo;RE READY TO EAT.</p>\r\n\r\n<p>SEASONINGS IN THIS INDUSTRY CAN CONTAIN HUNDREDS OF MILLIGRAMS OF SODIUM PER SERVING. THIS CAN POSE AS A RISK FOR MANY PEOPLE. FLAVOR GOD SEASONINGS CONTAIN ONLY 100% UNPROCESSED SEA SALT AT ONLY 25-40 MILLIGRAMS PER &frac14; TEASPOON WHICH IS A FRACTION OF WHAT YOU FIND COMMERCIALLY (THE ONLY SEASONING WITH A HIGHER AMOUNT THAN THIS IS MY HIMALAYAN SALT AND PEPPER SEASONING WHICH IS AN ACTUAL SALT SEASONING).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>NUTRITIONAL FACTS:</strong></h2>\r\n\r\n<p>&frac14; TABLE SPOON (0.75g)</p>\r\n\r\n<p><strong>CALORIES:&nbsp;</strong>ZERO KCAL</p>\r\n\r\n<p><strong>PROTEIN:&nbsp;</strong>ZERO</p>\r\n\r\n<p><strong>CARBOHYDRATES:</strong>&nbsp;ZERO</p>\r\n\r\n<p><strong>FAT:&nbsp;</strong>ZERO</p>\r\n\r\n<p><strong>SODIUM:</strong>&nbsp;20- 40mg (DEPENDS ON FLAVOR)</p>\r\n\r\n<p><strong>NET WEIGHT:</strong>&nbsp;141</p>', '<p>Details for&nbsp;Flavorgod Seasonings</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(121, 16, 2, 'FLAVORGOD SEASONINGS', '<h1>FLAVORGOD SEASONINGS</h1>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(122, 17, 1, 'Chikalab Protein  Dragee Almond', '<h2>PROTEIN DRAGEE&nbsp;ALMOND&nbsp;</h2>\r\n\r\n<p>Protein Almond Dragee from Chikalab are sweets that will definitely please everyone, combining a pleasant pastime with benefits for the body.&nbsp;Each almond dragee&nbsp;is coated with a layer of protein&nbsp;milk chocolate and in white chocolate as well.&nbsp;Moreover, the chocolate used in the production is a unique joint development of the Chikalab company and Italian chocolatiers.&nbsp;It is made from the purest cocoa without sugar.</p>\r\n\r\n<p>CHIKALAB PROTEIN CHOCOLATE DRAGEES</p>\r\n\r\n<h2>CHIKALAB PROTEIN DRAGEE&nbsp;ALMOND&nbsp;</h2>\r\n\r\n<ul>\r\n	<li>Protein dragee in chocolate;</li>\r\n	<li>No added simple sugars or gluten;</li>\r\n	<li>Three layers: chocolate-protein-nut&nbsp;</li>\r\n	<li>Using 100% cocoa;</li>\r\n	<li>Whey concentrate in the composition;</li>\r\n	<li>25 grams of protein per 100g of pills;</li>\r\n	<li>With water-soluble corn fiber.</li>\r\n</ul>\r\n\r\n<h2>FEATURES&nbsp;</h2>\r\n\r\n<p>These pills are just a breakthrough in the world of healthy snacks.&nbsp;I just want to try them.&nbsp;Judge for yourself.&nbsp;A whole nut covered with a layer of protein and milk chocolate and white chocolate as well.&nbsp;How do such pills deserve the fame of a &ldquo;healthy&rdquo; snack?&nbsp;After all, it is essentially a sweetness, but an unusual sweetness.&nbsp;Let&rsquo;s sort it out in order.</p>\r\n\r\n<p>In the middle, there is a&nbsp;<strong>nut</strong>&nbsp;&ndash;&nbsp;<strong>almonds.</strong>&nbsp;Take your pick.&nbsp;Any nut is a source of valuable nutrients, primarily useful polyunsaturated fats, as well as vitamins and minerals.&nbsp;You can choose such pills with a&nbsp;<strong>corn ball</strong>&nbsp;inside.&nbsp;Also a good option.&nbsp;In this case, you are providing yourself with a serving of nutritious water-soluble corn fiber.&nbsp;Again, it&rsquo;s worth mentioning that nuts and corn fiber are both long lasting satiety.</p>\r\n\r\n<p>Move on.&nbsp;<strong>Protein layer</strong>, and whey concentrate.&nbsp;Any protein is always useful and necessary for the body.</p>\r\n\r\n<p>Finally, a&nbsp;<strong>layer of milk chocolate</strong>.&nbsp;What is its peculiarity?&nbsp;The chocolate used is a joint development of Chikalab technologists and Italian chocolatiers.&nbsp;This chocolate filling contains no sugar and is made with 100 percent cocoa and corn fiber.</p>\r\n\r\n<h2>CHIKALAB PROTEIN&nbsp; DRAGEE&nbsp;ALMOND&nbsp;</h2>\r\n\r\n<p>Protein dragee in chocolate</p>\r\n\r\n<ul>\r\n	<li>25 grams of protein per 100g of pills</li>\r\n	<li>Whey concentrate in the base</li>\r\n	<li>Sugar-free chocolate</li>\r\n	<li>Inside &ndash; &nbsp;almonds&nbsp;</li>\r\n	<li>Three layers &ndash; nut / protein / chocolate</li>\r\n</ul>', '<p>DETAILS FOR CHIKALAB PROTEIN CHOCOLATE DRAGEES</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(123, 17, 2, 'Chikalab Protein  Dragee Almond', '<h2>PROTEIN DRAGEE&nbsp;ALMOND&nbsp;</h2>\r\n\r\n<p>Protein Almond Dragee from Chikalab are sweets that will definitely please everyone, combining a pleasant pastime with benefits for the body.&nbsp;Each almond dragee&nbsp;is coated with a layer of protein&nbsp;milk chocolate and in white chocolate as well.&nbsp;Moreover, the chocolate used in the production is a unique joint development of the Chikalab company and Italian chocolatiers.&nbsp;It is made from the purest cocoa without sugar.</p>\r\n\r\n<p>CHIKALAB PROTEIN CHOCOLATE DRAGEES</p>\r\n\r\n<h2>CHIKALAB PROTEIN DRAGEE&nbsp;ALMOND&nbsp;</h2>\r\n\r\n<ul>\r\n	<li>Protein dragee in chocolate;</li>\r\n	<li>No added simple sugars or gluten;</li>\r\n	<li>Three layers: chocolate-protein-nut&nbsp;</li>\r\n	<li>Using 100% cocoa;</li>\r\n	<li>Whey concentrate in the composition;</li>\r\n	<li>25 grams of protein per 100g of pills;</li>\r\n	<li>With water-soluble corn fiber.</li>\r\n</ul>\r\n\r\n<h2>FEATURES&nbsp;</h2>\r\n\r\n<p>These pills are just a breakthrough in the world of healthy snacks.&nbsp;I just want to try them.&nbsp;Judge for yourself.&nbsp;A whole nut covered with a layer of protein and milk chocolate and white chocolate as well.&nbsp;How do such pills deserve the fame of a &ldquo;healthy&rdquo; snack?&nbsp;After all, it is essentially a sweetness, but an unusual sweetness.&nbsp;Let&rsquo;s sort it out in order.</p>\r\n\r\n<p>In the middle, there is a&nbsp;<strong>nut</strong>&nbsp;&ndash;&nbsp;<strong>almonds.</strong>&nbsp;Take your pick.&nbsp;Any nut is a source of valuable nutrients, primarily useful polyunsaturated fats, as well as vitamins and minerals.&nbsp;You can choose such pills with a&nbsp;<strong>corn ball</strong>&nbsp;inside.&nbsp;Also a good option.&nbsp;In this case, you are providing yourself with a serving of nutritious water-soluble corn fiber.&nbsp;Again, it&rsquo;s worth mentioning that nuts and corn fiber are both long lasting satiety.</p>\r\n\r\n<p>Move on.&nbsp;<strong>Protein layer</strong>, and whey concentrate.&nbsp;Any protein is always useful and necessary for the body.</p>\r\n\r\n<p>Finally, a&nbsp;<strong>layer of milk chocolate</strong>.&nbsp;What is its peculiarity?&nbsp;The chocolate used is a joint development of Chikalab technologists and Italian chocolatiers.&nbsp;This chocolate filling contains no sugar and is made with 100 percent cocoa and corn fiber.</p>\r\n\r\n<h2>CHIKALAB PROTEIN&nbsp; DRAGEE&nbsp;ALMOND&nbsp;</h2>\r\n\r\n<p>Protein dragee in chocolate</p>\r\n\r\n<ul>\r\n	<li>25 grams of protein per 100g of pills</li>\r\n	<li>Whey concentrate in the base</li>\r\n	<li>Sugar-free chocolate</li>\r\n	<li>Inside &ndash; &nbsp;almonds&nbsp;</li>\r\n	<li>Three layers &ndash; nut / protein / chocolate</li>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(128, 20, 1, 'Power Crunch Protein Energy Bar', '<h3>Power Crunch Protein Energy Bar</h3>\r\n\r\n<h3><strong>DESCRIPTION</strong></h3>\r\n\r\n<ul>\r\n	<li>13 g Protein</li>\r\n	<li>5 g Sugar</li>\r\n	<li>Elevate the Everyday</li>\r\n	<li>Hi-dh Hydrolyzed Whey Protein in a Creme Filled Wafer Bar</li>\r\n</ul>\r\n\r\n<h3><strong>OTHER INGREDIENTS</strong></h3>\r\n\r\n<p>Proto Whey&reg;&nbsp;protein blend (Micro Peptides&trade;&nbsp;from high-DH hydrolyzed whey protein [40% di and tripeptides]. whey protein isolate, milk protein isolate), palm oil, enriched flour (wheat flour, malted barley flour, niacin, reduced iron, thiamine mononitrate, riboflavin, folic acid), palm kernel oil, sugar, cocoa processed with alkali, canola oil, fructose, soy lecithin, natural flavors, maltodextrin, salt, stevia leaf extract, baking soda, ammonium bicarbonate, monk fruit.</p>\r\n\r\n<p><strong>Contains:&nbsp;</strong>milk, wheat, soy (from lecithin). This product is manufactured on equipment that also processes peanuts.</p>', '<p>Power Crunch Protein Energy Bar</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(129, 20, 2, 'Power Crunch Protein Energy Bar', '', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(130, 21, 1, 'Applied Nutrition Clear Whey Protein', '<h1>CLEAR WHEY PROTEIN</h1>\r\n\r\n<h2>HYDROLYSED WHEY PROTEIN ISOLATE</h2>\r\n\r\n<p>Applied Nutrition&rsquo;s Clear Whey Protein is not your average protein shake. Using ultra-hydrolysed whey protein isolate, we have created a delicious, light, and refreshing protein drink that is more like a fruit juice than a milkshake.</p>\r\n\r\n<p>With all of the key benefits of a normal protein shake, Clear Whey is absorbed rapidly and contains just 90 calories per 25g serving. It is packed with over 21g protein, has only 1g of carbs, and has less than 0.25g of sugar &amp; fat.</p>\r\n\r\n<p>Clear Whey is the perfect macro-friendly product to help grow &amp; maintain muscle, whatever your fitness goal.</p>\r\n\r\n<h3>KEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>21g of protein with 5g BCAAs</li>\r\n	<li>Only 1g of carbs per serving</li>\r\n	<li>Only 90 calories &amp; low in sugar</li>\r\n	<li>Delicious fruit juice style flavours</li>\r\n	<li>Tested for athletes</li>\r\n	<li>Halal certified product</li>\r\n</ul>\r\n\r\n<h3>SUGGESTED USE</h3>\r\n\r\n<p>Mix 1 scoop (25g) with 400ml of ice-cold water and shake well. Leave to stand for 1 minute.<br />\r\n<em>*Scoops are estimated only, weighing scales are recommended.</em></p>\r\n\r\n<p>&nbsp;</p>', '<h3>NUTRITIONAL INFORMATION</h3>\r\n\r\n<p><img src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/Clear-Whey-Protein---Nutritionals---1000x1000_600x600.jpg?v=1637833297\\\" style=\\\"height:399px; width:399px\\\" /></p>\r\n\r\n<h3>TESTED FOR ATHLETES</h3>\r\n\r\n<p>Every ingredient within this batch undergoes rigorous scrutiny and testing for banned substances prior to production under a monitored programme. Final products are then produced and packaged at an ISO 22000, BRC, GMP &amp; Halal accredited lab to provide the highest level of assurance for athletes to use.</p>\r\n\r\n<h3>CAUTION</h3>\r\n\r\n<p>Food supplements should not be used as a substitute for a varied diet. Store in a cool dry place. Store out of reach of children. This product is suitable for lacto-ovo vegetarians.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(131, 21, 2, 'Applied Nutrition Clear Whey Protein', '<h1>CLEAR WHEY PROTEIN</h1>\r\n\r\n<h2>HYDROLYSED WHEY PROTEIN ISOLATE</h2>\r\n\r\n<p>Applied Nutrition&rsquo;s Clear Whey Protein is not your average protein shake. Using ultra-hydrolysed whey protein isolate, we have created a delicious, light, and refreshing protein drink that is more like a fruit juice than a milkshake.</p>\r\n\r\n<p>With all of the key benefits of a normal protein shake, Clear Whey is absorbed rapidly and contains just 90 calories per 25g serving. It is packed with over 21g protein, has only 1g of carbs, and has less than 0.25g of sugar &amp; fat.</p>\r\n\r\n<p>Clear Whey is the perfect macro-friendly product to help grow &amp; maintain muscle, whatever your fitness goal.</p>\r\n\r\n<h3>KEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>21g of protein with 5g BCAAs</li>\r\n	<li>Only 1g of carbs per serving</li>\r\n	<li>Only 90 calories &amp; low in sugar</li>\r\n	<li>Delicious fruit juice style flavours</li>\r\n	<li>Tested for athletes</li>\r\n	<li>Halal certified product</li>\r\n</ul>\r\n\r\n<h3>SUGGESTED USE</h3>\r\n\r\n<p>Mix 1 scoop (25g) with 400ml of ice-cold water and shake well. Leave to stand for 1 minute.<br />\r\n<em>*Scoops are estimated only, weighing scales are recommended.</em></p>\r\n\r\n<p>&nbsp;</p>', '<h3>NUTRITIONAL INFORMATION</h3>\r\n\r\n<p><img src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/Clear-Whey-Protein---Nutritionals---1000x1000_600x600.jpg?v=1637833297\\\" style=\\\"height:399px; width:399px\\\" /></p>\r\n\r\n<h3>TESTED FOR ATHLETES</h3>\r\n\r\n<p>Every ingredient within this batch undergoes rigorous scrutiny and testing for banned substances prior to production under a monitored programme. Final products are then produced and packaged at an ISO 22000, BRC, GMP &amp; Halal accredited lab to provide the highest level of assurance for athletes to use.</p>\r\n\r\n<h3>CAUTION</h3>\r\n\r\n<p>Food supplements should not be used as a substitute for a varied diet. Store in a cool dry place. Store out of reach of children. This product is suitable for lacto-ovo vegetarians.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0);
INSERT INTO `products_description` (`id`, `products_id`, `language_id`, `products_name`, `products_description`, `products_details`, `products_url`, `products_viewed`, `products_left_banner`, `products_left_banner_start_date`, `products_left_banner_expire_date`, `products_right_banner`, `products_right_banner_start_date`, `products_right_banner_expire_date`) VALUES
(132, 22, 1, 'Women’s Best Shape Body Shake', '<p><strong>Women&rsquo;s Best Shape Body Shake</strong></p>\r\n\r\n<ul>\r\n	<li>Slimming &amp; body-shaping</li>\r\n	<li>Supports muscle growth and maintenance</li>\r\n	<li>Sensational taste and solubility</li>\r\n	<li>Contains the premium fiber Nutriose&reg;</li>\r\n	<li>300 mg L-Carnitine &amp; 300 mg green tea extract per shake</li>\r\n	<li>Contains important vitamins and valuable minerals</li>\r\n</ul>\r\n\r\n<p><strong>Our All-In-One Meal Replacement Shake.<br />\r\nReaching a new level.</strong><br />\r\nEnough with strict diets, constant feeling of hunger and the annoying yo-yo effect! You can achieve your weight loss and shaping goals with our unbelievably delicious Shape Body Shake and a low-calorie diet.<br />\r\nDeveloped by our experts, the Shape Body Shake formula meets the strict requirements of the EFSA. The used protein in our shakes supports muscles, contains essential vitamins, valuable minerals and filling carbohydrates.This mixture, combined with the L-Carnitine Carnipure&reg;, green tea extract and the premium fiber Nutriose&reg;, is what makes our Shape Body Shake unique.<strong>Why we are using Nutriose&reg;?</strong><br />\r\nNUTRIOSE&reg; is a particularly well-tolerated soluble fiber made from corn dextrin. It has been clinically tested and developed in short- and long-term clinical trials. The excellent digestibility of NUTRIOSE&reg; depends on how it is metabolized. About 15% are hydrolyzed in the small intestine, 75% are fermented in the large intestine and only about 10% are excreted. Compared to similar products, because there is no sudden and excessive fermentation in the colon, bloating, bowel problems or diarrhea are avoided.<strong>What is L-Carnitine?</strong><br />\r\nL-Carnitine is an amino acid essential for the transport of long-chain fatty acids through the mitochondrial membrane. These fats are broken down, transported to the muscle cells and used for energy. L-Carintine is enjoying increasing popularity among athletes and people who want to combine body shaping with an active lifestyle.<strong>Why do we rely on L-Carnitine from Carnipure&reg;?</strong><br />\r\nCarnipure&reg; is a L-Carnitine nutrient, produced by Swiss company Lonza, a brand that stands for highest quality. Lonza has conducted several human studies on the benefits of Carnipure&reg; (L-Carnitine) in human nutrition in collaboration with universities and research centers around the world. Since L-Carnitine plays a central role for the metabolism, it has been shown that the nutrient Carnipure&reg; has beneficial properties in terms of health</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ingredients:</strong><br />\r\n<strong>Protein Blend</strong>&nbsp;[(<strong>Whey</strong>&nbsp;Protein Concentrate, Calcium&nbsp;<strong>Caseinate</strong>,&nbsp;<strong>Milk</strong>&nbsp;Protein), Nutriose&reg;, Maltodextrin,&nbsp;<strong>Soy</strong>&nbsp;Oil, Natural and Artificial Flavor, Green Tea Extract Powder, L-Carnitine-Tartrate (Carnipure&reg;), Glucose Syrup, Emulsifier (Soy Lecithin), Table Salt, Thickener (Xanthan), Sweetener (Sucralose), Antioxidant (DL-alpha-Tocopherol)],<br />\r\n<strong>Mineral Blend</strong>&nbsp;[Magnesium (Magnesium Hydroxide), Calcium (Calcium-D-Pantothenate), Iron (Iron Diphosphate), Niacin (Nicotinamide), Zinc (Zinc Oxide), Manganese (Manganese Sulfate), Copper (Copper Carbonate), Folic Acid (Pteroylmonoglutamic Acid), Selenium (Sodium Selenite)],<br />\r\n<strong>Vitamin Blend&nbsp;</strong>[Vitamin C (L-Ascorbic Acid), Vitamin E (D-Alpha Tocopherylacetate), Vitamin B6 (Pyridoxine Hydrochloride), Vitamin B2 (Riboflavin), Vitamin B1 (Thiamine Mononitrate), Vitamin A (Retinyl Acetate), Vitamin K (Phylloquinone), Vitamin D3 (Cholecalciferol), Vitamin B12 (Cyanocobalamin), D-Biotin].</p>\r\n\r\n<p><strong>Nutritional value per shake:&nbsp; &nbsp; &nbsp; &nbsp;</strong></p>\r\n\r\n<table style=\\\"width:517px\\\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Energy: 208 kcal<br />\r\n			Fat: 6.3 g<br />\r\n			&ndash; Saturated Fats: 3.3 g<br />\r\n			&ndash; Mono-unsaturated Fats: 1.8 g<br />\r\n			&ndash; Poly-unsaturated Fats: 1.3 g<br />\r\n			Carbohydrates: 14.9 g<br />\r\n			&ndash; Sugars: 9.7 g<br />\r\n			Dietary Fiber: 4.8 g<br />\r\n			Protein: 20.0 g<br />\r\n			Salt: 0.5 g<br />\r\n			Linoleic Acid: 1.0 g<br />\r\n			Green Tea Extract: 300 mg<br />\r\n			L-Carnitine-Tartrate: 300 mg</td>\r\n			<td><strong>vitamins:</strong><br />\r\n			Vitamin A: 304 &mu;g<br />\r\n			Vitamin D: 2.7 &mu;g<br />\r\n			Vitamin E: 4.7 mg<br />\r\n			Vitamin C: 33.2 mg<br />\r\n			Vitamin B1: 0.52 mg<br />\r\n			Vitamin B2: 1.1 mg<br />\r\n			Vitamin B3: 5.6 mg<br />\r\n			Vitamin B6: 0.59 mg<br />\r\n			Folic Acid: 118 &mu;g<br />\r\n			Vitamin B12: 3.3 &mu;g<br />\r\n			Biotin: 44.1 &mu;g<br />\r\n			Vitamin B5: 1.9 mg<br />\r\n			Vitamin K: 30.0 &mu;g</td>\r\n			<td><strong>Minerals:</strong><br />\r\n			Calcium: 373 mg<br />\r\n			Phosphorus: 287 mg<br />\r\n			Potassium: 504 mg<br />\r\n			Iron: 4.9 mg<br />\r\n			Zinc: 3.7 mg<br />\r\n			Copper: 0.36 mg<br />\r\n			Iodine: 47.4 &mu;g<br />\r\n			Selenium: 31.9 &mu;g<br />\r\n			Magnesium: 113 mg<br />\r\n			Manganese: 0.91 mg<br />\r\n			Sodium: 201 mg</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>*Nutritional value and ingredients can vary depending on flavor.</p>\r\n\r\n<p>Made in Germany</p>', '<p>Details for&nbsp;Women&rsquo;s Best Shape Body Shake</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
