(134, 23, 1, 'Quest Peanut Butter Cups', '<p><strong>Quest Peanut Butter Cups</strong></p>\r\n\r\n<p>Quest Peanut Butter Cups satisfy your sweet tooth with less than 1g of sugar, 11g of protein and 1g of net carbs per serving. Can you believe it? Take a bite and find out for yourself.</p>\r\n\r\n<table border=\\\"0\\\" cellpadding=\\\"0\\\" cellspacing=\\\"0\\\">\r\n	<tbody>\r\n		<tr>\r\n			<td>11g</td>\r\n			<td>&nbsp; &nbsp; &nbsp; &nbsp;1g</td>\r\n			<td>&nbsp;&lt;1g</td>\r\n			<td>&nbsp; 4g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protein</td>\r\n			<td>Net Carbs*</td>\r\n			<td>Sugar</td>\r\n			<td>Fiber</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>*13g Total Carbs- 4g Fiber &ndash; 8g Erythritol = 1g Net Carbs Per Serving.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><img alt=\\\"Gluten Free\\\" src=\\\"https://cdn.shopify.com/s/files/1/1463/8084/t/88/assets/gluten-free-icon.png?v=1054198918660804190\\\" style=\\\"height:50px; width:49px\\\" /></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table style=\\\"width:298px\\\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Nutrition Facts</td>\r\n		</tr>\r\n		<tr>\r\n			<td>12 serving per container</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Serving size2 cups (42g)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Amount per serving</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Calories190</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; % Daily Value*</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Total Fat&nbsp;15g&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 19%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Saturated Fat 9g&nbsp;&nbsp;&nbsp;&nbsp