(136, 24, 1, 'Proper Corn Popcorn', '<ul>\r\n	<li>Proper. Small word, big ambition.</li>\r\n	<li>My father was a hopeless cook but made the best popcorn. We&rsquo;d spend hours obsessing over new flavours, delicious ingredients and the magic of popping corn. Years later, inspired by the popcorn maker my dad gave me, Proper was born.</li>\r\n	<li>We started from humble beginnings, improvising by tossing kernels in a refashioned cement mixer! Now, we&rsquo;re a proudly independent company making what we think is the best popcorn in the world.</li>\r\n	<li>For us, taste is everything. Take this pack of Sweet &amp; Salty. We use a perfect balance of sea salt and raw cane sugar to give our hand-popped, butterfly corn its distinctive, caramelised glaze.</li>\r\n	<li>It&rsquo;s popcorn, done properly. I hope you love it</li>\r\n	<li>Cassandra</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>All natural seasoning</li>\r\n	<li>Gluten free</li>\r\n	<li>Suitable for vegans</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Pack size: 30G</li>\r\n</ul>\r\n\r\n<h2>INFORMATION</h2>\r\n\r\n<h3>INGREDIENTS</h3>\r\n\r\n<p>Wholegrain Corn (53%), Raw Cane Sugar, Rapeseed Oil, Sea Salt</p>\r\n\r\n<h3>ALLERGY INFORMATION</h3>\r\n\r\n<ul>\r\n	<li>Made in a factory that handles Milk</li>\r\n</ul>\r\n\r\n<h3>ADDITIVES</h3>\r\n\r\n<ul>\r\n	<li>Free From Genetically Modified Ingredients</li>\r\n</ul>\r\n\r\n<h3>WARNINGS</h3>\r\n\r\n<ul>\r\n	<li>Warning: May contain the occasional un-popped kernel</li>\r\n</ul>\r\n\r\n<h3>NUTRITION</h3>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><strong>Per 100g</strong></td>\r\n			<td><strong>Per serving</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Energy (kJ)</td>\r\n			<td>1889</td>\r\n			<td>529</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Energy (Kcal)</td>\r\n			<td>451</td>\r\n			<td>126</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fat (g)</td>\r\n			<td>18.0</td>\r\n			<td>5.0</td>\r\n		</tr>\r\n		<tr>\r\n			<td>of which saturates (g)</td>\r\n			<td>1.4</td>\r\n			<td>0.4</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Carbohydrates (g)</td>\r\n			<td>63.2</td>\r\n			<td>17.7</td>\r\n		</tr>\r\n		<tr>\r\n			<td>of which sugars (g)</td>\r\n			<td>27.0</td>\r\n			<td>7.6</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fibre (g)</td>\r\n			<td>10.8</td>\r\n			<td>3.0</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protein (g)</td>\r\n			<td>5.4</td>\r\n			<td>1.5</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Salt (g)</td>\r\n			<td>1.47</td>\r\n			<td>0.41</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '<p>Details for&nbsp;Proper Corn Popcorn</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
