(139, 25, 2, 'Kellogg’s Special Protein Cereals', '<p>DESCRIPTION</p>\r\n\r\n<p><strong>Kellogg&rsquo;s Special Protein Cereals</strong></p>\r\n\r\n<p>Nutrients that Matter to Power You<br />\r\nSpecial K Protein has been purposefully designed with high fibre bran flakes along with ingredients that are natural sources of protein like linseeds and sunflower seeds to help give you strength.High Fibre<br />\r\nFeeding your daily fibre needs</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Vitamin B12<br />\r\nFeeding energy by supporting your nutrient metabolism</p>\r\n\r\n<p>Iron<br />\r\nFeeding endurance by helping to reduce tiredness</p>\r\n\r\n<p>Vitamin D<br />\r\nFeeding defences by supporting your immune system<br />\r\nProtein<br />\r\nFeeding strength by helping to build and repair muscles and maintain bones</p>\r\n\r\n<p>A serving of Special K Protein contains &ge;15% RI of iron which contributes to the reduction of tiredness and fatigue, vitamin D which contributes to the normal function of the immune system, vitamin B12 which contributes to normal energy-yielding metabolism and is a source of protein which contributes to the growth and maintenance of muscle mass and the maintenance of normal bones.</p>\r\n\r\n<p>Multigrain flakes with toasted nuts and crunchy cluster, Protein / high fibre / 8 vitamins and minerals, No artificial colours, flavours or preservatives, Suitable for vegetarians, Halal &ndash; HFA Approved</p>\r\n\r\n<p><img alt=\\\"Organic\\\" src=\\\"https://www.ocado.com/static/organic-91c8d.svg\\\" />Organic<img alt=\\\"Suitable for vegetarians\\\" src=\\\"https://www.ocado.com/static/vegetarian-b4dac.svg\\\" />Suitable for vegetarians</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<th>TYPICAL VALUES</th>\r\n			<th>/100G</th>\r\n			<th>%RI*</th>\r\n			<th>/40G</th>\r\n		</tr>\r\n		<tr>\r\n			<td>Energy</td>\r\n			<td>1651kJ</td>\r\n			<td>&nbsp;</td>\r\n			<td>660kJ</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>392kcal</td>\r\n			<td>&nbsp;</td>\r\n			<td>157kcal</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>8%</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fat</td>\r\n			<td>7g</td>\r\n			<td>4%</td>\r\n			<td>2.8g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>of which saturates</td>\r\n			<td>0.6g</td>\r\n			<td>1%</td>\r\n			<td>0.2g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Carbohydrate</td>\r\n			<td>65g</td>\r\n			<td>&nbsp;</td>\r\n			<td>26g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>of which sugars</td>\r\n			<td>12g</td>\r\n			<td>5%</td>\r\n			<td>4.8g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fibre</td>\r\n			<td>8.3g</td>\r\n			<td>&nbsp;</td>\r\n			<td>3.3g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protein</td>\r\n			<td>13g</td>\r\n			<td>&nbsp;</td>\r\n			<td>5.2g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Salt</td>\r\n			<td>0.73g</td>\r\n			<td>5%</td>\r\n			<td>0.29g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Vitamins:</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Vitamin D</td>\r\n			<td>4.8&micro;g</td>\r\n			<td>38%</td>\r\n			<td>1.9&micro;g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Thiamin (B1)</td>\r\n			<td>1.0mg</td>\r\n			<td>38%</td>\r\n			<td>0.42mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Riboflavin (B2)</td>\r\n			<td>1.3mg</td>\r\n			<td>38%</td>\r\n			<td>0.53mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Niacin (B3)</td>\r\n			<td>9.6mg</td>\r\n			<td>24%</td>\r\n			<td>3.8mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Vitamin B6</td>\r\n			<td>0.84mg</td>\r\n			<td>24%</td>\r\n			<td>0.34mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Folic Acid (B9)</td>\r\n			<td>242&micro;g</td>\r\n			<td>48%</td>\r\n			<td>96.0&micro;g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Vitamin B12</td>\r\n			<td>1.5&micro;g</td>\r\n			<td>24%</td>\r\n			<td>0.60&micro;g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Minerals:</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Iron</td>\r\n			<td>8.4mg</td>\r\n			<td>24%</td>\r\n			<td>3.4mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>*Reference intake of an average adult (8400kJ/2000kcal)</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>INGREDIENTS</p>\r\n\r\n<p>Ingredients</p>\r\n\r\n<p>Cereals (<strong>Wholewheat</strong>&nbsp;{33%}, Rice {20%},&nbsp;<strong>Wheat</strong>&nbsp;Bran {5.5%},&nbsp;<strong>Wholemeal</strong>&nbsp;Flour {4.5%},&nbsp;<strong>Barley</strong>&nbsp;{3.5%}, Malted&nbsp;<strong>Barley</strong>&nbsp;Flour {1.5%}), Linseed and Sunflower Seed Cluster (17.5%) (Cereals {Whole&nbsp;<strong>Oats</strong>&nbsp;[7%],&nbsp;<strong>Rye</strong>&nbsp;[1.5%],&nbsp;<strong>Wheat</strong>&nbsp;Flour [1.5%]}, Sugar, Protein Crisp (<strong>Soy</strong>&nbsp;Protein Isolate, Tapioca Starch, Calcium Carbonate, Salt), Rice Piece {Rice Flour, Corn Flour, Sugar}, Sunflower Seeds, Linseed, Modified Starch,&nbsp;<strong>Barley</strong>&nbsp;Malt Extract, Sunflower Oil, Emulsifier {<strong>Soy</strong>&nbsp;Lecithin}, Natural Flavourings, Sodium Hydrogen Carbonate, Ammonium Hydrogen Carbonate, Antioxidant {Tocopherol Rice Extract}, Skimmed&nbsp;<strong>Milk</strong>&nbsp;Powder), Sugar, Pumpkin Seeds (3.5%),&nbsp;<strong>Nuts</strong>&nbsp;(3.5%) (<strong>Hazelnuts</strong>,&nbsp;<strong>Almonds</strong>), Glucose Syrup,&nbsp;<strong>Barley</strong>&nbsp;Malt Extract, Salt, Natural Flavouring, Vitamins &amp; Minerals: Niacin, Iron, Zinc, Vitamin B2 (Riboflavin), Vitamin B1 (Thiamin), Vitamin B6, Folic Acid, Vitamin D, Vitamin B12</p>\r\n\r\n<p>Allergen Information</p>\r\n\r\n<p>Contains Almonds, Contains Barley, Contains Hazelnuts, Contains Milk, Contains Nuts, Contains Oats, Contains Rye, Contains Soya, Contains Wheat</p>\r\n\r\n<p>Allergy Information</p>\r\n\r\n<p>May contain other Nuts</p>\r\n\r\n<p>Dietary Information</p>\r\n\r\n<p>Suitable for Vegetarians; Halal</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(140, 26, 1, 'Chikalab Chika Biscuit', '<h2>CHIKA BISCUIT</h2>\r\n\r\n<p>Can biscuits be good for you?&nbsp;Of course, if it is made on the basis of quality protein.&nbsp;The Chikalab brand invites its consumers to appreciate the taste of Chika Biscuit protein biscuit biscuits.</p>\r\n\r\n<p>Such cookies are simply created for the moments when you want something so sweet that a breakdown of a long diet is brewing.&nbsp;Such a development of events may not inspire optimism, so you should arm yourself with a set of protein biscuit cookies.&nbsp;Each 50g treat contains 15 grams of protein from a combination of whey and milk concentrate sources.&nbsp;The high fiber content (15.5 grams per serving) will help digestion and better satiety, dulling hunger for long periods of time.&nbsp;In situations where the next meal is far away, very good quality.&nbsp;There are no simple sugars or preservatives in these cookies.&nbsp;Moreover, it is not glazed.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>CHIKALAB CHIKA BISCUIT:</h2>\r\n\r\n<ul>\r\n	<li>Protein biscuits;</li>\r\n	<li>Unglazed;</li>\r\n	<li>15 grams of protein in one cookie;</li>\r\n	<li>Whey and milk concentrates in the base;</li>\r\n	<li>15.5 grams of fiber in each cookie</li>\r\n	<li>No sugar or preservatives;</li>\r\n	<li>Provides long-lasting saturation.</li>\r\n</ul>\r\n\r\n<p><strong>Recommendations for use and how to take Chikalab Chika Biscuit:</strong></p>\r\n\r\n<p>Consume as a healthy snack any time of the day.</p>\r\n\r\n<p><strong>Servings Per Container:</strong><br />\r\n50 grams &ndash; 1 serving.</p>\r\n\r\n<h2>CHIKALAB CHIKA BISCUIT</h2>\r\n\r\n<p>Protein biscuits</p>\r\n\r\n<ul>\r\n	<li>15 grams of protein in one cookie</li>\r\n	<li>Whey and milk concentrates in the base</li>\r\n	<li>High amount of fiber</li>\r\n	<li>Sugar and preservatives free</li>\r\n</ul>', '<p>Details for&nbsp;Chikalab Chika Biscuit</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(141, 26, 2, 'Chikalab Chika Biscuit', '', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(142, 27, 1, 'Popp’d Flavoured Foxnuts', '<h2>PRODUCT DESCRIPTION</h2>\r\n\r\n<p>Popp&rsquo;d is a puffed lotus seeds snack, that has been roasted and seasoned with natural flavours to create a healthy everyday snack. Fox nuts have been a superfood for centuries and are known for its nutritional content that makes them superior to dry fruits and crisps</p>\r\n\r\n<p><strong>Fox Nuts</strong>&nbsp;are low in sodium content, high in potassium and magnesium. Are an antioxidant with various health benefits and very light and easy to digest.&nbsp;<strong>Popp&rsquo;d</strong>&nbsp;is the perfect snacking partner, that can also be added to salads and soups. Enjoy guilt-free snacking with one of Uncle Pop&rsquo;s many flavoured&nbsp;<strong>fox nuts</strong>!</p>\r\n\r\n<ul>\r\n	<li>Popp&rsquo;d is a great alternative to crisps, quick and easy on-the-go snack. Fox Nuts are low in sodium content, high in potassium and magnesium.</li>\r\n	<li>The high calcium content makes them great for bone and teeth health</li>\r\n	<li>Are an antioxidant with various health benefits and very light and easy to digest. Popp&rsquo;d is the perfect snacking partner, that can also be added to salads and soups.</li>\r\n	<li>Enjoy guilt-free snacking with one of Uncle Pop&rsquo;s many flavoured fox nuts!</li>\r\n</ul>\r\n\r\n<p><strong>Features:</strong></p>\r\n\r\n<ul>\r\n	<li>Popp&rsquo;d is a great alternative to crisps, quick and easy on-the-go snack. Fox Nuts are low in sodium content, high in potassium and magnesium.</li>\r\n	<li>The high calcium content makes them great for bone and teeth health</li>\r\n	<li>Are an antioxidant with various health benefits and very light and easy to digest. Popp&rsquo;d is the perfect snacking partner, that can also be added to salads and soups.</li>\r\n	<li>Enjoy guilt-free snacking with one of Uncle Pop&rsquo;s Himalayan Pink Salt flavored fox nuts!</li>\r\n</ul>\r\n\r\n<p><strong>Directions</strong></p>\r\n\r\n<p>Tear the packet from the tearing notch on the top and enjoy snacking on our mouth watering flavors.</p>\r\n\r\n<p><strong>Ingredients</strong></p>\r\n\r\n<p>fox nuts, sunflower oil, salt, maltodextrin, Himalayan black salt, corn starch, black pepper, taste enhancers: yeast extract, acidity regulator E 262ii, antioxidant E330, spice, anticaking agent E551, spice extract, dry glucose syrup.</p>', '<p>Details for&nbsp;Popp&rsquo;d Flavoured Foxnuts</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(143, 27, 2, 'Popp’d Flavoured Foxnuts', '', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(144, 28, 1, 'Chikalab Bombbar Keto Bar', '<h2>CHIKALAB BOMBBAR KETO BAR</h2>\r\n\r\n<p>BombBar&rsquo;s Keto Bars not only provide the body with protein, but also increased fiber.&nbsp;They more than satisfy hunger and help withstand breaks between meals.&nbsp;These bars are produced only from natural ingredients.&nbsp;They have no added simple sugars, and the proportion of carbohydrates per bar is extremely low &ndash; only 4.1 grams.</p>\r\n\r\n<h2>BOMBBAR KETO BAR:</h2>\r\n\r\n<ul>\r\n	<li>Protein bars made exclusively from natural ingredients;</li>\r\n	<li>No preservatives or stabilizers;</li>\r\n	<li>Contains no added simple sugars;</li>\r\n	<li>6 grams of protein in each bar</li>\r\n	<li>4.1 g carbohydrates and 9.5 g fiber;</li>\r\n	<li>Satisfy hunger and saturate with valuable nutrients.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendations for use and how to take BombBar Keto Bar:</strong></p>\r\n\r\n<p>Consume as a healthy snack.</p>\r\n\r\n<p><strong>Servings Per Container:</strong><br />\r\n40 grams &ndash; 1 serving.</p>', '<p>Details for&nbsp;Chikalab Bombbar Keto Bar</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(145, 28, 2, 'Chikalab Bombbar Keto Bar', '', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(146, 29, 1, 'Chikalab Bombbar Keto Cookie', '<p><strong>DESCRIPTION OF BOMBBAR KETO COOKIE</strong></p>\r\n\r\n<h3><strong>&nbsp;</strong><strong>NEW FROM BOMBAR!&nbsp;KETO COOKIES FOR A HEALTHY SNACK!</strong></h3>\r\n\r\n<h3>BENEFIT</h3>\r\n\r\n<p>A snack is not only good for filling, but also helps to take care of your health.&nbsp;We add dietary fiber to the composition.&nbsp;This ingredient regulates the stomach or improves peristalsis.</p>\r\n\r\n<p>Almond plant antioxidants, keto cookie basics, improve sleep.&nbsp;But the main benefit of a nut, of course, is in nutrients.&nbsp;Almonds are rich in iron, potassium, magnesium, phosphorus and B vitamins.&nbsp;When consumed enough, these components improve skin condition, accelerate hair growth, and support the nervous system and brain.</p>\r\n\r\n<h3>WHO CAN EAT THE BOMBAR KETO COOKIE?</h3>\r\n\r\n<p>Pregnant and lactating women, children, athletes, diabetics, those who are on a diet.</p>\r\n\r\n<h3>HOW TO USE?</h3>\r\n\r\n<p><strong>BOMBAR</strong>&nbsp;cookies&nbsp;&nbsp;<strong>are</strong>&nbsp;suitable for use as a dessert for tea, coffee and other drinks, incl.&nbsp;Protein shakes.&nbsp;Can be consumed before, after or during workouts, take with you on the road or to the office.</p>\r\n\r\n<table border=\\\"1\\\" cellpadding=\\\"1\\\" cellspacing=\\\"1\\\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>&nbsp;Composition&nbsp;</strong></td>\r\n			<td><strong>&nbsp;for 40 g&nbsp;</strong></td>\r\n			<td><strong>&nbsp;per 100 gr&nbsp;</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;Protein</td>\r\n			<td>&nbsp;8 g</td>\r\n			<td>&nbsp;20 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;Fats</td>\r\n			<td>&nbsp;13 g</td>\r\n			<td>&nbsp;32.5 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;Carbohydrates</td>\r\n			<td>&nbsp;2 g</td>\r\n			<td>&nbsp;5.1 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;Alimentary fiber</td>\r\n			<td>&nbsp;7.6 g</td>\r\n			<td>&nbsp;19.2 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;Energy value</td>\r\n			<td>&nbsp;172 kcal</td>\r\n			<td>&nbsp;431 kcal</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\\\"3\\\"><strong>&nbsp;Ingredients:</strong>&nbsp;&nbsp;almonds, whey protein concentrate, coconut oil, water-soluble corn fiber, oligofructose (dietary fiber from chicory), water, erythritol, coconut, egg products (egg melange), salt, natural flavors, sodium bicarbonate (baking soda), regulator acidity &ndash; citric acid, emulsifier (soy lecithin), antioxidant (ascorbic acid), sweetener &ndash; sucralose, preservative (potassium sorbate).</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '<p>Details For&nbsp;Chikalab Bombbar Keto Cookie</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
