(148, 30, 1, 'Chikalab Chikapie Chocolate Covered Cookie', '<p>Glazed Chikalab ChikaPie biscuits from the well-known manufacturer of dietary food brand Bombbar.&nbsp;Delicious protein biscuits for a healthy snack throughout the day.</p>\r\n\r\n<p><strong>Why buy Chikalab&nbsp;</strong><strong>&nbsp;ChikaPie&nbsp;</strong><strong>cookies&nbsp;</strong><strong>:</strong></p>\r\n\r\n<p>It contains 25% of high quality whey protein.&nbsp;The product is specially designed for active and exercising people.&nbsp;The best option for those with a sweet tooth without the risk of spoiling the figure.&nbsp;Does not contain sugar, GMOs and preservatives.&nbsp;Helps to quickly satisfy hunger before training, when traveling, or at work between meals.&nbsp;The cookies are covered with delicious glazed chocolate.&nbsp;Various flavors are on sale.</p>\r\n\r\n<p><strong>The advantages are as follows:</strong></p>\r\n\r\n<ol>\r\n	<li>High protein content.</li>\r\n	<li>Balanced composition.</li>\r\n	<li>Sugar and GMO free.</li>\r\n	<li>Quickly satisfies hunger.</li>\r\n	<li>A wide variety of flavors.</li>\r\n</ol>\r\n\r\n<p><strong>Recommendations for use:</strong></p>\r\n\r\n<p>Ready-to-eat product.&nbsp;You can use the product at any time.&nbsp;Enjoy your meal!.</p>', '<p><strong>Nutrient content per serving:</strong></p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Taste</strong></td>\r\n			<td><strong>Peanut</strong></td>\r\n			<td><strong>Coconut</strong></td>\r\n			<td><strong>Chocolate</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protein</td>\r\n			<td>15 g</td>\r\n			<td>15 g</td>\r\n			<td>15 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Carbohydrates</td>\r\n			<td>3.9 g</td>\r\n			<td>3.5 g</td>\r\n			<td>4.2 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fat</td>\r\n			<td>13.2 g</td>\r\n			<td>13,1 g</td>\r\n			<td>12.8 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Alimentary fiber</td>\r\n			<td>12 g</td>\r\n			<td>12 g</td>\r\n			<td>12 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Energy value<