 white paste (water-soluble corn fibers, coconut oil, whey protein isolate, skimmed milk powder, emulsifier &ndash; soy lecithin, natural flavors, antioxidant (ascorbic acid), sweetener &ndash; sucralose), milk chocolate (water-soluble corn fibers, cocoa butter, cocoa mass, skimmed milk powder, emulsifier &ndash; soy lecithin, natural flavors, sweetener &ndash; sucralose), vegetable oil, water, oat bran, erythritol, natural cocoa powder, egg products ( egg melange), salt, natural flavors, sodium bicarbonate (baking soda), acidity regulator &ndash; citric acid, emulsifier (soy lecithin), antioxidant (ascorbic acid), sweetener &ndash; sucralose,preservative (potassium sorbate)</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(150, 31, 1, 'Raw Bites Protein Puffs', '<p><strong>Raw Bites Protein Puffs</strong></p>\r\n\r\n<p>Raw Bites protein puff is ideal for eliminating hunger and satisfying your cravings in a healthy way. Air popped puffs, never baked or fried.</p>\r\n\r\n<p><strong>Ingredients:&nbsp;</strong>Corn, milk protein, peanut, sunflower oil (cold sprayed), pinch of sea salt.</p>\r\n\r\n<p><strong>Origin:</strong>&nbsp;Lebanon</p>\r\n\r\n<p><strong>Values:</strong>&nbsp;natural, gluten free, wheat free, no coloring, no added sugars, high fiber, good fats, protein</p>\r\n\r\n<p><strong>Storage:</strong>&nbsp;keep in a dry and cool place</p>\r\n\r\n<p><strong>About Raw Bites:</strong></p>\r\n\r\n<p>Raw Bites snacks are made with 100% natural ingredients. Basically, only pure fruits, legume, grains, dairy and nuts are used to create our nutritious munchies. Free from all kinds of preservatives, artificial sweeteners, processed sugars, colorings, food preservatives and additives. Our products are tested by an official approved laboratory (IRI) Industrial Research Institute and our milk protein are approved by &ldquo;United States Department of Agriculture&rdquo; (USDA).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/2433/4947/files/NutritionLabel_1dec7295-1405-4737-ae80-6fdb91fdc458_480x480.png?v=1573030840\\\" /></p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(151, 31, 2, 'Raw Bites Protein Puffs', '', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(152, 32, 1, 'X50 Cauliflower Chips', '<p><a href=\\\"https://www.australiansportsnutrition.com.au/x50-cauliflower-chips.html#product.info.description\\\">Description</a></p>\r\n\r\n<p>X50 Cauliflower Chips</p>\r\n\r\n<p>Remember the days when eating cauliflower seemed like a chore? Thanks to X50&rsquo;s gluten-free, fibre-rich and preservative-free Cauliflower Chips, those days are well and truly gone!</p>\r\n\r\n<p>Features</p>\r\n\r\n<ul>\r\n	<li>Gluten-free</li>\r\n	<li>Contains zero cholesterol</li>\r\n	<li>Contains no preservatives or trans fat</li>\r\n	<li>Vegan and vegetarian-friendly</li>\r\n	<li>Contains non-GMO cauliflower</li>\r\n	<li>A healthy and tasty snack</li>\r\n	<li>Pesticide-free</li>\r\n</ul>\r\n\r\n<p>Benefits</p>\r\n\r\n<p>Whether you&rsquo;re looking for the perfect snack to satisfy your savoury cravings or are simply looking for a tasty way to increase your daily nutrient intake, X50 Cauliflower Chips are a healthy treat that offers the perfect amount of crunch and flavour!</p>\r\n\r\n<p>Containing vegan and vegetarian-friendly, non-GMO cauliflower freshly picked at their prime, X50 Cauliflower Chips contain no preservatives, no trans fat and no pesticides, meaning you can enjoy a treat that doesn&rsquo;t contain anything nasty. Cauliflower is naturally packed full of goodness and fibrous carbs, which break down easily to support your metabolism and to help your body glow from the inside out. X50 Cauliflower Chips have also been vacuum fried to seal in the goodness using wholesome rice bran oil to capitalise on its ideal fatty acid balance.</p>\r\n\r\n<p>Summary</p>\r\n\r\n<p>Cauliflower just got a whole lot more interesting and tasty thanks to X50&rsquo;s seriously crunchy, delicious, and healthy Cauliflower Chips!</p>\r\n\r\n<p><img alt=\\\"X50 Cauliflower Chips NEW!!! – M&amp;M Fitness Australia\\\" src=\\\"https://cdn.shopify.com/s/files/1/0076/2259/0511/products/x50_cauliflower_nutritional_info_411x.jpg?v=1578549278\\\" /></p>', '<p>Details for&nbsp;X50 Cauliflower Chips</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(153, 32, 2, 'X50 Cauliflower Chips', '', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
