(156, 34, 1, 'Olimp L-Carnitine 3000 Extreme Shot', '<p><strong>Olimp L-Carnitine 3000 Extreme Shot</strong>&nbsp;created by the&nbsp;<strong>Olimp Laboratories&nbsp;</strong>pharmaceutical company specialists, is a small, convenient to use shot, containing a solid portion of L-carnitine &ndash; as much as 3000mg in one ampule &ndash; additionally supplemented with vitamin B6. Both active ingredients as safe to use what has been proven with i.a. tests for heavy metals absence performed in the Olimp Labs Research and Development Center.</p>\r\n\r\n<p>When considering the&nbsp;<strong>Olimp Sport Nutrition</strong>&nbsp;brand dietary supplement, its liquid form cannot be unnoticed. The used&nbsp;<strong>Liquid Technology</strong>&nbsp;formula allows the almost immediate absorption of the L-carnitine and vitamin B6. In addition, a small ampoule can be put in your pocket without any problems and used whenever you need it.</p>\r\n\r\n<p>Choose one of the two extremely refreshing flavors (orange or cherry) and supplement your diet with L-carnitine and vitamin B6. When chosing&nbsp;<strong>Olimp</strong>&nbsp;<strong>L-Carnitine 3000 Extreme Shot</strong>&nbsp;you can expect:</p>\r\n\r\n<ul>\r\n	<li>A simple and quick way to supplement your diet with high-quality L-carnitine and vitamin B6</li>\r\n	<li>Support in proper functioning of the nervous system (vitamin B6)</li>\r\n	<li>Support in maintaining adequate energy-yielding metabolism (vitamin B6)</li>\r\n	<li>Support in reducing the feeling of tiredness and fatigue (vitamin B6)</li>\r\n	<li>Support in maintaining proper protein and glycogen metabolism (vitamin B6)</li>\r\n</ul>\r\n\r\n<p><strong>Olimp L-Carnitine 3000 Extreme Shot</strong>&nbsp;is a dietary supplement and therefore it cannot be considered a substitute for a balanced diet, but only an addition to it.&nbsp; Healthy lifestyle and a balanced diet are highly recommended.</p>\r\n\r\n<p><strong>Nutritional Facts</strong></p>\r\n\r\n<table style=\\\"width:527px\\\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Nutrition value</strong></td>\r\n			<td><strong>per 1/2&nbsp;of the ampoule&nbsp;(12,5ml)</strong></td>\r\n			<td><strong>per 1&nbsp;ampoule&nbsp;(25ml)</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>L-carnitine</td>\r\n			<td>1500 mg</td>\r\n			<td>3000 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Vit. B6</td>\r\n			<td>1,4 mg (100%*)</td>\r\n			<td>2,8 mg (200%*)</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Ingredients:</strong>&nbsp;water, 12% L-carnitine, acidity regulator &ndash; citric acid; vit. B6 (pyridoxine hydrochloride), sweeteners &ndash; sucralose, acesulfame K, preservative &ndash; E 202, aromas, colour: beta-carotene.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recommendation</strong></p>\r\n\r\n<p>Drink 1/2 of the ampoule (12,5 ml) two times a day approx. 30 minutes before meal or physical exercise. Once opened, keep refrigerated and consume within 24 hours. Shake before use.</p>\r\n\r\n<p>Do not exceed the recommended daily dose. Food supplements should not be used as a substitute for a varied and balanced diet. A varied and balanced diet and a healthy lifestyle are recommended. Keep out of reach of children.</p>', '<p>Details for&nbsp;Olimp L-Carnitine 3000 Extreme Shot</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(157, 34, 2, 'Olimp L-Carnitine 3000 Extreme Shot', '', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(160, 36, 1, 'Up Beat Protein Water', '<p><strong>Up Beat Protein Water</strong></p>\r\n\r\n<ul>\r\n	<li>ZERO SUGAR</li>\r\n	<li>REAL FRUIT</li>\r\n	<li>12G PROTEIN</li>\r\n	<li>7 ESSENTIAL B VITAMINS</li>\r\n	<li>NO ARTIFICIAL COLOURS, FLAVOURS OR PRESERVATIVES</li>\r\n	<li>PLANT-BASED SWEETENER</li>\r\n</ul>\r\n\r\n<p>NUTRITION INFORMATION</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Typical Values</strong></td>\r\n			<td><strong>100ml</strong></td>\r\n			<td><strong>500ml</strong></td>\r\n			<td><strong>%RI</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Energy, kJ/Kcal</td>\r\n			<td>48/11</td>\r\n			<td>240/56</td>\r\n			<td>3%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protein, g</td>\r\n			<td>2.42</td>\r\n			<td>12.1</td>\r\n			<td>25%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Thiamine, mg</td>\r\n			<td>0.10</td>\r\n			<td>0.50</td>\r\n			<td>30%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Niacin, mg</td>\r\n			<td>1.46</td>\r\n			<td>7.29</td>\r\n			<td>30%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Pantothenic Acid, mg</td>\r\n			<td>0.55</td>\r\n			<td>2.73</td>\r\n			<td>30%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Vitamin B6, mg</td>\r\n			<td>0.13</td>\r\n			<td>0.64</td>\r\n			<td>30%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Biotin (B7),&nbsp;&mu;g</td>\r\n			<td>4.55</td>\r\n			<td>22.8</td>\r\n			<td>30%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Folic Acid,&nbsp;&mu;g</td>\r\n			<td>18.0</td>\r\n			<td>91.7</td>\r\n			<td>30%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Vitamin B12,&nbsp;&mu;g</td>\r\n			<td>0.23</td>\r\n			<td>1.14</td>\r\n			<td>30%</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>INGREDIENT</p>\r\n\r\n<p>Water 94%, Whey Protein Isolate (From&nbsp;<strong>MILK</strong>&nbsp;2.8%), Fruit Juices from Concentrate (Raspberry 1.8%, Blueberry 1.3%), Phosphoric Acid, Natural Flavoring&rsquo;s, Sweetener (Steviol Glycolsides), Vitamins (B1, B3, B5, B6, B7, B9, B12)</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
