(162, 37, 1, 'Popchips Ridges', '<h2>ABOUT THIS&nbsp;ITEM</h2>\r\n\r\n<p>We aim to show you accurate product information.&nbsp;Manufacturers, suppliers, and others provide what you see here, and we have not verified it.&nbsp;SEE OUR DISCLAIMER</p>\r\n\r\n<p>&ldquo;We believe in the freedom to snack. That&rsquo;s why we created a new chip. One that&rsquo;s deeply satisfying but never deep-fried. So you can feel free to eat one, two, three handfuls, or even a whole bag. and why not? it&rsquo;s okay, they&rsquo;re popchips! Bold &amp; Crunchy popchips Ridges pack a big crunch and bold flavor. They&rsquo;re everything you love about pop chips, taken to the next level! popchips ridges are simply potatoes, popped to perfection. We take potatoes, add heat &amp; pressure then pop! You get chips that give you more for your taste buds, with fewer calories &amp; more chips per serving than other fried or baked chips. popchips are gluten-free, kosher, contain no trans fat, no added preservatives, no fake flavors, and no synthetic colors. Select flavors non-GMO and vegan.&rdquo;</p>\r\n\r\n<ul>\r\n	<li>&nbsp;No added preservatives*</li>\r\n	<li>&nbsp;No artificial flavors</li>\r\n	<li>&nbsp;No synthetic colors</li>\r\n	<li>&nbsp;Kosher dairy</li>\r\n	<li>&nbsp;0 grams trans fat</li>\r\n	<li>&nbsp;Gluten-free</li>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(163, 37, 2, 'Popchips Ridges', '<h2>ABOUT THIS&nbsp;ITEM</h2>\r\n\r\n<p>We aim to show you accurate product information.&nbsp;Manufacturers, suppliers and others provide what you see here, and we have not verified it.&nbsp;SEE OUR DISCLAIMER</p>\r\n\r\n<p>&ldquo;We believe in the freedom to snack. That&rsquo;s why we created a new chip. One that&rsquo;s deeply satisfying but never deep fried. So you can feel free to eat one, two, three handfuls, or even a whole bag. and why not? it&rsquo;s okay, they&rsquo;re popchips! Bold &amp; Crunchy popchips Ridges pack big crunch and bold flavor. They&rsquo;re everything you love about popchips, taken to the next level! popchips ridges are simply potatoes, popped to perfection. We take potatoes, add heat &amp; pressure then pop! You get chips that give you more for your taste buds, with fewer calories &amp; more chips per serving than other fried or baked chips. popchips are gluten free, kosher, contain no trans fat, no added preservatives, no fake flavors and no synthetic colors. Select flavors non-GMO and vegan.&rdquo;</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(164, 38, 1, 'Ieat Fitmix Hi-Protein Powdered Peanut Butter', '<p><strong>What is it?</strong></p>\r\n\r\n<p>FIT MIX is an Evolution of Peanut Butter with Double the Taste and Double the Protein than any other&nbsp;powdered&nbsp;peanut butter.</p>\r\n\r\n<p><strong>How Fit Mix is made</strong></p>\r\n\r\n<p>100% USA-grown freshly roasted peanuts are pressed and 90% of fat and oil are removed and 100%&nbsp;Hydrolyzed Whey Protein is added. With only 1.5 grams of fat, NO Sugar and 10 grams of protein&nbsp;it truly doesn&rsquo;t get any better than this for peanut butter lovers.</p>\r\n\r\n<p><strong>Natural. Non-GMO. Gluten-Free.</strong></p>\r\n\r\n<p>FIT MIX&nbsp;&nbsp;Powdered Peanut Butter is proudly made with 100% USA-grown peanuts and contains no hydrogenated oils or&nbsp;preservatives.</p>\r\n\r\n<p><strong>Mixing Directions</strong></p>\r\n\r\n<p>Add 3 tablespoons of FIX MIX Powdered Peanut Butter to 2&nbsp;tablespoons of water&nbsp;and mix until creamy smooth. (Tip: For a thicker consistency, add less water)</p>\r\n\r\n<p><img alt=\\\"Nutrition Facts\\\" src=\\\"https://cdn.shopify.com/s/files/1/1024/8673/files/nutrition_fact_chocolate_large.png?3301818821546542292\\\" /></p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(165, 38, 2, 'Ieat Fitmix Hi-Protein Powdered Peanut Butter', '', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(166, 39, 1, 'Muscle Cheff High Protein Spread', '<p><strong>Muscle Cheff High Protein Spread</strong></p>\r\n\r\n<p>MOST NATURAL BUTTERS CAN BE CHUNKY AND HARD BUT OUR ALL NATURAL, HIGH PROTEIN SPREADS WERE CREATED IN &nbsp;A UNIQUE WAY GIVING YOU DOUBLE THE AMOUNT OF PROTEIN WITH A SMOOTH CONSISTENCY AND TEXTURE. SIMPLE &nbsp;&lsquo;N NATURAL WITH LESS THAN 5 INGREDIENTS THAT YOU CAN ACTUALLY READ! IT&rsquo;S THE MOST NATURAL SPREAD YOU WILL EVER COME ACROSS.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>NUTRITIONAL FACTS:</strong></h2>\r\n\r\n<p>PER ONE SERVING (2 SPOON -33g)</p>\r\n\r\n<p><strong>CALORIES:&nbsp;160</strong>&nbsp;KCAL</p>\r\n\r\n<p><strong>PROTEIN:&nbsp;10</strong>g</p>\r\n\r\n<p><strong>CARBOHYDRATES:</strong>&nbsp;5g</p>\r\n\r\n<p><strong>OF WHICH SUGAR:</strong>&nbsp;1g SUGAR &ndash; NON ADDED</p>\r\n\r\n<p><strong>FIBER:</strong>&nbsp;3g</p>\r\n\r\n<p><strong>FAT:&nbsp;11</strong>g OF HEALTHY FAT (ZERO TRANS FAT)</p>\r\n\r\n<p><strong>INGREDIENTS :</strong></p>\r\n\r\n<p>&nbsp;HERBAL OIL, COCONUT FLOUR, POPPY, WHEY PROTEIN, PEANUT, MILK &ndash; POWDER, SWEETENED WITH STEVIA.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(167, 39, 2, 'Muscle Cheff High Protein Spread', '<p><strong>Muscle Cheff High Protein Spread</strong></p>\r\n\r\n<p>MOST NATURAL BUTTERS CAN BE CHUNKY AND HARD BUT OUR ALL NATURAL, HIGH PROTEIN SPREADS WERE CREATED IN &nbsp;A UNIQUE WAY GIVING YOU DOUBLE THE AMOUNT OF PROTEIN WITH A SMOOTH CONSISTENCY AND TEXTURE. SIMPLE &nbsp;&lsquo;N NATURAL WITH LESS THAN 5 INGREDIENTS THAT YOU CAN ACTUALLY READ! IT&rsquo;S THE MOST NATURAL SPREAD YOU WILL EVER COME ACROSS.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>NUTRITIONAL FACTS:</strong></h2>\r\n\r\n<p>PER ONE SERVING (2 SPOON -33g)</p>\r\n\r\n<p><strong>CALORIES:&nbsp;160</strong>&nbsp;KCAL</p>\r\n\r\n<p><strong>PROTEIN:&nbsp;10</strong>g</p>\r\n\r\n<p><strong>CARBOHYDRATES:</strong>&nbsp;5g</p>\r\n\r\n<p><strong>OF WHICH SUGAR:</strong>&nbsp;1g SUGAR &ndash; NON ADDED</p>\r\n\r\n<p><strong>FIBER:</strong>&nbsp;3g</p>\r\n\r\n<p><strong>FAT:&nbsp;11</strong>g OF HEALTHY FAT (ZERO TRANS FAT)</p>\r\n\r\n<p><strong>INGREDIENTS :</strong></p>\r\n\r\n<p>&nbsp;HERBAL OIL, COCONUT FLOUR, POPPY, WHEY PROTEIN, PEANUT, MILK &ndash; POWDER, SWEETENED WITH STEVIA</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(168, 40, 1, 'Barebells Protein Milkshake', '<h3>About This Product</h3>\r\n\r\n<ul>\r\n	<li>Delicious tasting milkshake - silky smooth, sweet and creamy</li>\r\n	<li>24g protein in every bottle</li>\r\n	<li>No added sugar, Lactose-Free, GMO-Free</li>\r\n	<li>High protein, yet delicious and creamy milkshake.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Barebells mouth-watering milkshakes with 24 grams of protein per serving come in four irresistibly creamy flavors. All are&nbsp;free from lactose and no added sugars.&nbsp;100% Barebellicious!</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
