(178, 45, 1, 'Ieat Quinoa Puffs Hi-Protein Cereals', '<h1>QUINOA PUFFS HI-PROTEIN CEREAL</h1>\r\n\r\n<p>100% Organic &amp; Gluten Free Royal Quinoa Cereal</p>\r\n\r\n<p>Quinoa &ldquo;Superfood&rdquo;&nbsp;was an important crop for the inca empire back in the day. they referred to it as the &ldquo;mother of all grains&rdquo;</p>\r\n\r\n<p>This is very light tasting cereal only flavored with whey protein. Amazing source of Complex Carbohydrates and Protein.</p>\r\n\r\n<p>Great to eat with milk and you can add nuts, fruits or our Fit Mix for additional flavor.</p>\r\n\r\n<p><img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/1024/8673/files/Quinoa_Puffs_-_Nutritional_Facts_2_large.jpg?5789259297278328872\\\" /></p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(179, 45, 2, 'Ieat Quinoa Puffs Hi-Protein Cereals', '', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(180, 46, 1, 'Bio Synergy Skinny Water', '<p><strong>WHAT IS BIO-SYNERGY SKINNY WATER ?</strong><br />\r\nBIO-SYNERGY SKINNY WATER&reg; FITS PERFECTLY INTO A HECTIC LIFESTYLE AND CAN CONTRIBUTE TO PROVIDING YOU WITH THE RECOMMENDED DAILY AMOUNT OF WATER, WHILST ALSO ASSISTING TO CURB CRAVINGS AND BURN CALORIES. EACH BOTTLE IS LOVINGLY PRODUCED AT OUR UK FACTORY FROM SPRING WATER AND CONTAINS LESS THAN 2K/CAL. EACH SERVING CONTAINS CHROMIUM WHICH ACCORDING THE FOOD STANDARDS AGENCY PLAYS A ROLE IN REDUCING SUGAR CRAVINGS AND MAY PLAY A ROLE IN TACKLING TYPE 2 DIABETES. EACH SERVING CONTAINS L-CARNITINE (AN AMINO ACID) WHICH HAS BEEN THE SUBJECT OF NUMEROUS STUDIES REGARDING FAT METABOLISM. EACH DELICIOUS DRINK IS A PERFECT COMPLIMENT TO ANY MEAL AS WELL AS BEFORE, DURING AND AFTER A WORKOUT.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>WHO IS BIO-SYNERGY SKINNY WATER FOR?</strong><br />\r\nBIO-SYNERGY SKINNY WATER&reg; IS IDEAL FOR ANYONE WHO WANTS A HEALTHY, LOW CALORIE, SUGAR FREE ALTERNATIVE TO UNHEALTHY DRINKS. WHETHER YOU ARE TRYING TO HYDRATE YOURSELF AFTER THE GYM OR JUST PROVIDE YOURSELF WITH A TASTY, REFRESHING BEVERAGE, LOOK NO FURTHER THAN BIO-SYNERGY SKINNY WATER&reg;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>HOW TO USE BIO-SYNERGY SKINNY WATER?</strong><br />\r\nSIMPLY UNSCREW THE LID AND ENJOY THE DELICIOUS, REFRESHING TASTE OF SKINNY WATER&reg;</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;VOTED NO.1 NO DIET, DIET PRODUCT<br />\r\n&bull;&nbsp;&nbsp; &nbsp;ZERO SUGAR &amp; CALORIES<br />\r\n&bull;&nbsp;&nbsp; &nbsp;AWARD WINNING, 8/10 FABULOUS MAGAZINE<br />\r\n&bull;&nbsp;&nbsp; &nbsp;9/10 BY DAILY MIRROR<br />\r\n&bull;&nbsp;&nbsp; &nbsp;DELICIOUS DRINK WITH A HINT OF RASPBERRY<br />\r\n&bull;&nbsp;&nbsp; &nbsp;CONTAINS&nbsp; RASPBERRY KETONES, GREEN TEA &amp; VITAMIN B6<br />\r\n&bull;&nbsp;&nbsp; &nbsp;12 X 500ML BOTTLES<br />\r\n&bull;&nbsp;&nbsp; &nbsp;NOTICEABLE RESULTS WITHIN 2 WEEKS</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>NUTRITIONAL FACTS:</strong></h2>\r\n\r\n<p>PER ONE CAN</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>CALORIES:</strong>&nbsp;0 Kcal</p>\r\n\r\n<p><strong>PROTEIN:</strong>&nbsp;ZERO</p>\r\n\r\n<p><strong>CARBOHYDRATES:</strong>&nbsp;ZERO</p>\r\n\r\n<p><strong>FIBER:</strong>&nbsp;ZERO</p>\r\n\r\n<p><strong>FAT:</strong>&nbsp;ZERO</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
