(182, 47, 1, 'Pam Cooking Sprays', '<p>PAM&reg; HAS EIGHT SPECIALLY FORMULATED, NON-STICK COOKING SPRAYS TO HELP MAKE TIME IN THE KITCHEN A ROUSING SUCCESS. AND NOW, THREE OF YOUR FAVORITES &ndash; ORIGINAL, BUTTER, AND BAKING &ndash; LEAVE 99% LESS RESIDUE* THAN MARGARINE OR BARGAIN-BRAND COOKING SPRAYS</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>NUTRITIONAL FACTS:</strong></h2>\r\n\r\n<p>(PER PACK) SERVING SIZE ABOUT 1/4 SECOND SPRAY (.2g)AMOUNTS PER SERVING :</p>\r\n\r\n<table align=\\\"left\\\" border=\\\"1\\\" cellpadding=\\\"1\\\" cellspacing=\\\"1\\\">\r\n	<tbody>\r\n		<tr>\r\n			<td>CALORIES 0</td>\r\n			<td>CALORIES FROM FAT 0</td>\r\n		</tr>\r\n		<tr>\r\n			<td>TOTAL FAT 0g</td>\r\n			<td>0%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>SATURATED FAT 0g</td>\r\n			<td>0%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>TRANS FAT 0g</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>CHOLESTEROL 0g</td>\r\n			<td>0%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>SODIUM 0g</td>\r\n			<td>0%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>TOTAL CARBOHYDRATE 0g</td>\r\n			<td>0%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>PROTEIN 0g</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>NOT A SIGNIFICANT SOURCE OF DIETARY FIBER, SUGARS, VITAMIN A, VITAMIN C, CALCIUM AND IRON.</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>PRODUCT FORMULATIONS AND PACKAGING MAY CHANGE. FOR THE MOST CURRENT INFORMATION REGARDING A PARTICULAR PRODUCT, PLEASE REFER TO THE PRODUCT PACKAGE.</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>* PERCENT DAILY VALUES (DV) ARE BASED ON A 2,000 CALORIE DIET.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
