(192, 52, 1, 'Justine\'s Protein Cookies', '<h3><strong>Keto-Friendly Choc Chip Protein Cookie</strong></h3>\r\n\r\n<p>Size: 60 g</p>\r\n\r\n<p>Freshly baked, keto-friendly and delivering a guilt free, yet smart snacking solution. A healthier version of your traditional choc chip cookie with soft notes of vanilla and chocolate chunks that melt in your mouth. This delicious soft-baked cookie is extremely low in carbs, just 1.1 g per serve and is high in protein, delivering 16.1 g of protein per 60 g cookie. That&#39;s 32%DI of your protein needs. It is made with no wheat and gluten, just pure almond meal as its base for added nutrition. It is high in fibre too, delivering 20% DI of your fibre needs.</p>\r\n\r\n<p>Plus another benefit is it is high in calcium &amp; each 60g serve will deliver you 27% RDI of your calcium needs. Made with no added sugar, this cookie will keep you fuller for longer, satisfy your sweet snacking requirements &amp; is your perfect on-the-go guilt free smart keto snack. Long shelf life for the essential pantry item.&nbsp;</p>\r\n\r\n<p>● Ultra Low-Carb<br />\r\n● High Protein<br />\r\n● Made With Pure Almond Meal &amp; No Wheat Flour Used<br />\r\n● No Added Sugar<br />\r\n● Made In New Zealand</p>\r\n\r\n<p><br />\r\nMacros<br />\r\n● Protein: 16.1 g<br />\r\n● Fat: 13.1 g<br />\r\n● Carbohydrate: 1.1 g<br />\r\n● Sugars 0.8g<br />\r\n● Fibre 20% DI<br />\r\n● Calcium 27% RDI</p>', '<p><strong>Nutritional Information</strong></p>\r\n\r\n<p>Servings per package: 12</p>\r\n\r\n<table border=\\\"1\\\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Servings per package: 1</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Serving Size : 60g</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>Quantity per serving</td>\r\n			<td>% Daily Intake* (Per serving)</td>\r\n			<td>Quantity<br />\r\n			Per 100 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>