(194, 53, 1, 'Nano Protein Pancake', '<p>Highlights</p>\r\n\r\n<ul>\r\n	<li>The new unique creation from Nano Supps, appropriately titled Protein Pancake, is an individually packaged, pre-made pancake.</li>\r\n	<li>It is packed full of protein, hence the name, but the excitement doesn&rsquo;t end there.</li>\r\n	<li>The real, freshly-baked pancake snack is also filled with a sweet-looking creamy centre, full of delicious flavour.</li>\r\n	<li>The nano Protein Pancake comes in eight different flavors, all providing the same nutrition numbers.</li>\r\n	<li>From Cookies and Cream to Double Chocolate, even a Seasonal Christmas Special.</li>\r\n	<li>The nutrition profile is surprisingly lean featuring a protein to calorie ratio lower than most of the protein bars we know of. It also uses a simple combination of ingredients with egg yolk, no added sugar, whole wheat flour, and whey protein to give it that 16g of protein per pancake.</li>\r\n</ul>\r\n\r\n<p><strong>Ingredients&nbsp;pancake:</strong>&nbsp;water,&nbsp;<strong>whey</strong>&nbsp;protein concentrate,&nbsp;<strong>egg yolk</strong>, wetting agent (glycerin), whole&nbsp;<strong>wheat</strong>&nbsp;flour, sunflower oil, bulking agent (disodium diphosphate, sodium carbonate, calcium carbonate), maize starch, sweetener (sucralose), salt, preservatives (potassium sorbate, sodium acetate).</p>\r\n\r\n<p><br />\r\n<strong>Filling:</strong>&nbsp;Fructo-oligosaccharides (from chicory), wetting agents: glycerol, blueberry concentrate (10%), water, stabilizers: maize starch, microcrystalline cellulose, carboxymethylcellulose, acidity control: sodium citrate, tartaric acid, aroma, salt, color: hibiscus, carminic acid, preservative: potassium sorbate, antioxidant: ascorbic acid.</p>\r\n\r\n<p><br />\r\n<strong>Allergen information:</strong>&nbsp;It contains traces of&nbsp;<strong>milk, egg</strong>, and&nbsp;<strong>wheat</strong>. May contain traces of&nbsp;<strong>soy</strong>&nbsp;and&nbsp;<strong>nuts</strong>. If kept unopened in a cool, dry place, best before end of/Lot No.: see imprint. Once opened, use up quickly. Keep away from direct heat and light.</p>\r\n\r\n<p>Flavours: Vanilla, Chocolate, Caramel, Double Chocolate, Cookies &amp; Cream, Peach Jam, Blueberry, X mass Special.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
