(197, 54, 2, 'Quest Protein Cookies', '<p>Each soft &amp; chewy cookie is loaded with decadent chocolate flavored chunks and the protein you deserve to feed your cookie cravings.</p>\r\n\r\n<table border=\\\"0\\\" cellpadding=\\\"0\\\" cellspacing=\\\"0\\\" style=\\\"width:256px\\\">\r\n	<tbody>\r\n		<tr>\r\n			<td>15g</td>\r\n			<td>4g</td>\r\n			<td>&lt;1g</td>\r\n			<td>9g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protein</td>\r\n			<td>Net Carbs*</td>\r\n			<td>Sugar</td>\r\n			<td>Fiber</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>*19g Total Carbs- 9g Fiber - 6g Erythritol = 4g Net Carbs Per Serving</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(198, 55, 1, 'Grenade Carb Killa Protein Bar', '<p>Grenade Bars are key to a satisfying snack is protein. With these portable, protein bars, you&#39;ll never have an excuse to have a bar of chocolate again.&nbsp;just because you&rsquo;re living a healthy lifestyle, doesn&rsquo;t mean you can&rsquo;t enjoy the taste you deserve.</p>\r\n\r\n<p><strong>Carb Killa Protein Bar</strong>&nbsp;is made using a specially selected baking process for exceptional taste resulting in a softer, crunchier texture. Carb Killa&reg; is high in complete proteins, low in impact carbs, and loaded with tons of fiber.</p>\r\n\r\n<p><strong>Carb Killa Protein Bar</strong>&nbsp;is available in a range of flavors, each made up from delicious triple layers, filled with crunchy &#39;crispies&#39; all coated in chocolate. With low sugar and low calories, this bar really is the perfect high-protein snack.&nbsp;</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(199, 55, 2, 'Grenade Carb Killa Protein Bar', '<p>Grenade Bars are key to a satisfying snack is protein. With these portable, protein bars, you&#39;ll never have an excuse to have a bar of chocolate again.&nbsp;just because you&rsquo;re living a healthy lifestyle, doesn&rsquo;t mean you can&rsquo;t enjoy the taste you deserve.</p>\r\n\r\n<p><strong>Carb Killa Protein Bar</strong>&nbsp;is made using a specially selected baking process for exceptional taste resulting in a softer, crunchier texture. Carb Killa&reg; is high in complete proteins, low in impact carbs, and loaded with tons of fiber.</p>\r\n\r\n<p><strong>Carb Killa Protein Bar</strong>&nbsp;is available in a range of flavors, each made up from delicious triple layers, filled with crunchy &#39;crispies&#39; all coated in chocolate. With low sugar and low calories, this bar really is the perfect high-protein snack.&nbsp;</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(200, 56, 1, 'Lenny & Larry\'s The Complete Cookie', '<ul>\r\n	<li>Satisfyingly firm and chewy, our delectable vegan protein cookie is packed with plant-based protein, plenty of fiber, and zero guilt.</li>\r\n	<li>With up to 16g of plant-based proteins and 10g of fiber, The Complete Cookie will not only satisfy your tummy and sweet tooth but also your peace of mind.</li>\r\n	<li>Lenny &amp; Larry&rsquo;s cookies are Non-GMO Project Verified, Vegan, and Kosher-friendly. We don&rsquo;t use dairy, soy, eggs, high fructose corn syrup, or artificial sweeteners in any of our Complete Cookies.</li>\r\n</ul>', '<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><img src=\\\"https://cdn.accentuate.cloud/images/47213248670/table-image.jpg?v=1602252431356\\\" /></td>\r\n			<td>\r\n			<p>INGREDIENTS.</p>\r\n\r\n			<p>Enriched Wheat Flour (wheat flour, niacin, reduced iron, thiamine mononitrate, riboflavin, folic acid), Protein Blend (vital wheat gluten, pea protein, rice protein), Chicory Root Fiber, Semi-Sweet Chocolate Chips (unsweetened chocolate, sugar, cocoa butter, dextrose, natural vanilla extract), Cane Sugar, Invert Sugar, Vegetable Glycerine, Palm Fruit Oil, Sunflower Lecithin, Natural Flavor, Baking Soda, Salt, Xanthan Gum, Guar Gum.</p>\r\n\r\n			<p>ALLERGENS</p>\r\n\r\n			<p>Contains Wheat.</p>\r\n\r\n			<p>*Manufactured in a facility that also processes Peanut, Tree Nut, Soy, Milk and Egg.</p>\r\n			</td>\r\n			<td>\r\n			<p>FACTS</p>\r\n\r\n			<ul>\r\n				<li>16g Plant-Based Proteins (per cookie)</li>\r\n				<li>10g Fiber (per cookie)</li>\r\n				<li>Non-GMO Project Verified</li>\r\n				<li>No Soy Ingredients</li>\r\n				<li>No Dairy Ingredients</li>\r\n				<li>No Egg</li>\r\n				<li>Vegan</li>\r\n				<li>Kosher</li>\r\n				<li>No High Fructose Corn Syrup</li>\r\n				<li>No Artificial Sweeteners</li>\r\n				<li>0g Sugar Alcohols</li>\r\n				<li>Sustainable Palm Oil</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(201, 56, 2, 'Lenny & Larry\'s The Complete Cookie', '<ul>\r\n	<li>Satisfyingly firm and chewy, our delectable vegan protein cookie is packed with plant-based protein, plenty of fiber, and zero guilt.</li>\r\n	<li>With up to 16g of plant-based proteins and 10g of fiber, The Complete Cookie will not only satisfy your tummy and sweet tooth but also your peace of mind.</li>\r\n	<li>Lenny &amp; Larry&rsquo;s cookies are Non-GMO Project Verified, Vegan, and Kosher-friendly. We don&rsquo;t use dairy, soy, eggs, high fructose corn syrup, or artificial sweeteners in any of our Complete Cookies.</li>\r\n</ul>', '<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><img src=\\\"https://cdn.accentuate.cloud/images/47213248670/table-image.jpg?v=1602252431356\\\" /></td>\r\n			<td>\r\n			<p>INGREDIENTS.</p>\r\n\r\n			<p>Enriched Wheat Flour (wheat flour, niacin, reduced iron, thiamine mononitrate, riboflavin, folic acid), Protein Blend (vital wheat gluten, pea protein, rice protein), Chicory Root Fiber, Semi-Sweet Chocolate Chips (unsweetened chocolate, sugar, cocoa butter, dextrose, natural vanilla extract), Cane Sugar, Invert Sugar, Vegetable Glycerine, Palm Fruit Oil, Sunflower Lecithin, Natural Flavor, Baking Soda, Salt, Xanthan Gum, Guar Gum.</p>\r\n\r\n			<p>ALLERGENS</p>\r\n\r\n			<p>Contains Wheat.</p>\r\n\r\n			<p>*Manufactured in a facility that also processes Peanut, Tree Nut, Soy, Milk and Egg.</p>\r\n			</td>\r\n			<td>\r\n			<p>FACTS</p>\r\n\r\n			<ul>\r\n				<li>16g Plant-Based Proteins (per cookie)</li>\r\n				<li>10g Fiber (per cookie)</li>\r\n				<li>Non-GMO Project Verified</li>\r\n				<li>No Soy Ingredients</li>\r\n				<li>No Dairy Ingredients</li>\r\n				<li>No Egg</li>\r\n				<li>Vegan</li>\r\n				<li>Kosher</li>\r\n				<li>No High Fructose Corn Syrup</li>\r\n				<li>No Artificial Sweeteners</li>\r\n				<li>0g Sugar Alcohols</li>\r\n				<li>Sustainable Palm Oil</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(202, 57, 1, 'Lenny & Larry\'s The Boss Cookie', '<ul>\r\n	<li>The BOSS! A cookie is a convenient source of dairy and plant-based proteins. Loaded with 18g of protein, but with 1g of sugar, this cookie will show your hunger who&#39;s The BOSS!</li>\r\n	<li>Chocolate Chunk includes a unique blend of creamy chocolate chips and chunks to give this soft, chewy cookie a rich flavor that is sure to satisfy your sweet tooth.</li>\r\n	<li>The BOSS! cookie is made with non-GMO ingredients and includes 6g of prebiotic fiber to help support gut health.</li>\r\n</ul>\r\n\r\n<table border=\\\"5\\\" cellpadding=\\\"1\\\" cellspacing=\\\"1\\\" style=\\\"width:500px\\\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p><strong>FACTS</strong></p>\r\n\r\n			<ul>\r\n				<li>18g of Dairy and Plant-Based proteins per 2oz cookie</li>\r\n				<li>1g of sugar with no artificial sweeteners</li>\r\n				<li>6g of Prebiotic Fiber</li>\r\n				<li>1g of Net Carbs</li>\r\n				<li>Non-GMO Ingredients</li>\r\n				<li>No Soy Ingredients</li>\r\n				<li>Kosher Certified</li>\r\n				<li>No eggs</li>\r\n				<li>No High Fructose Corn Syrup</li>\r\n				<li>No artificial colors or flavors</li>\r\n				<li>RSPO Palm Oil</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>', '<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><img src=\\\"https://cdn.accentuate.cloud/images/47213248670/pdp-nutrition-cc-290x493.jpg?v=1613032838561\\\" /></td>\r\n			<td>\r\n			<p>INGREDIENTS.</p>\r\n\r\n			<p><strong>Protein Blend</strong>&nbsp;(hydrolyzed milk protein isolate, milkprotein isolate),&nbsp;<strong>Allulose, Butter</strong>&nbsp;(sweet cream),&nbsp;<strong>Palm Fruit Oil, Soluble Corn Fiber, Unsweetened Chocolate, Erythritol, Chicory Root Fiber, Vegetable Glycerine, Wheat Protein Isolate, Cocoa&nbsp;</strong>processed with alkali,&nbsp;<strong>Palm Kernel Oil, Natural Flavor, Sunflower Lecithin, Dextrose, Cocoa butter, Salt, Xanthan Gum, Steviol Glycosides</strong>&nbsp;(stevia extract),&nbsp;<stron