(204, 58, 1, 'Rip Van Wafels', '<p>A Rip Van&nbsp;Wafel is distinguished from your standard&nbsp;waffle. Inspired on the traditional Amsterdam stroopwafel&nbsp;but much lower in sugar (3g) while still delivering on the carbs (19g), dutchman Rip started making these in his dorm room as a college senior at Brown University.</p>\r\n\r\n<p>Rip Van Wafels use&nbsp;simple&nbsp;NON-GMO&nbsp;ingredients, the same kind you&rsquo;d use if you made them in your own kitchen like eggs, flour, sugar, baking soda and salt. Plus a few nutritious ingredients like,&nbsp;oats, chickpea flour and&nbsp;flax seed oil for an extra dose of Omega 3s. They are soft, easy&nbsp;to chew and don&rsquo;t pack an overdose of calories or carbs. They&rsquo;re perfect.</p>\r\n\r\n<p>We truly believe there is no wrong time to have a wafel.&nbsp; First thing in the morning they go great&nbsp;topped with greek yogurt, nuts and dried fruit or&nbsp;with a steaming cup of coffee. Mid-morning they make a great snack. Slap some nut butter on them and they make the perfect sandwich. Enjoy them placed on top of your 3pm cup of coffee as it cools down and taste a perfectly warmed wafel. Let them carry you through your evening workout, and if you give us time I&rsquo;m sure we can find a way to make dinner with them.</p>', '<h2>What&#39;s Inside</h2>\r\n\r\n<ul>\r\n	<li>\r\n	<p><img src=\\\"https://res.cloudinary.com/shogun-frontend/image/fetch/f_auto,q_auto,c_limit,w_40,h_40/https://cdn.shopify.com/s/files/1/1515/2714/t/40/assets/icon-protein.png\\\" />Protein:&nbsp;1g</p>\r\n	</li>\r\n	<li>\r\n	<p><img src=\\\"https://res.cloudinary.com/shogun-frontend/image/fetch/f_auto,q_auto,c_limit,w_40,h_40/https://cdn.shopify.com/s/files/1/1515/2714/t/40/assets/icon-sugars.png\\\" />Sugars:&nbsp;3g</p>\r\n	</li>\r\n	<li>\r\n	<p><img src=\\\"https://res.cloudinary.com/shogun-frontend/image/fetch/f_auto,q_auto,c_limit,w_40,h_40/https://cdn.shopify.com/s/files/1/1515/2714/t/40/assets/icon-sodium.png\\\" />Sodium:&nbsp;90mg</p>\r\n	</li>\r\n	<li>\r\n	<p><img src=\\\"https://res.cloudinary.com/shogun-frontend/image/fetch/f_auto,q_auto,c_limit,w_40,h_40/https://cdn.shopify.com/s/files/1/1515/2714/t/40/assets/icon-carbohydrates.png\\\" />Carbohydrates:&nbsp;18g</p>\r\n	</li>\r\n	<li>\r\n	<p><img src=\\\"https://res.cloudinary.com/shogun-frontend/image/fetch/f_auto,q_auto,c_limit,w_40,h_40/https://cdn.shopify.com/s/files/1/1515/2714/t/40/assets/icon-fiber.png\\\" />Fiber:&nbsp;6g</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Nutrition Facts</h2>\r\n\r\n<p>Honey and Oats / Single Serving<br />\r\nServing Size:&nbsp;1 Wafel<br />\r\nServings Per Container:&nbsp;1</p>\r\n\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th colspan=\\\"3\\\">Amount Per Serving</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th colspan=\\\"2\\\"><strong>Calories</strong>&nbsp;180</th>\r\n			<td>Calories from Fat&nbsp;0</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\\\"3\\\"><strong>% Daily Value*</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"2\\\"><strong>Total Fat&nbsp;</strong>9g</th>\r\n			<td><strong>14%</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<th>Saturated Fat&nbsp;5g</th>\r\n			<td><strong>25%</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<th>Trans Fat&nbsp;0g</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"2\\\"><strong>Cholesterol</strong>&nbsp;15mg</th>\r\n			<td><strong>5%</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"2\\\"><strong>Sodium</strong>&nbsp;135mg</th>\r\n			<td><strong>6%</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"2\\\"><strong>Total Carbohydrate</strong>&nbsp;19g</th>\r\n			<td><strong>6%</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<th>Dietary Fiber&nbsp;6g</th>\r\n			<td><strong>24%</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<th>Sugars&nbsp;5g</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<th>Other Carbohydrates&nbsp;0g</th>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"2\\\"><strong>Protein</strong>&nbsp;10g</th>\r\n			<td><strong>20%</strong></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>*Percent Daily Values are based on a 2,000 calorie diet. Your daily values may be higher or lower depending on your calorie needs.</p>\r\n\r\n<p><strong>INGREDIENTS FOR&nbsp;RIP VAN WAFEL PROTEIN&nbsp;(HONEY AND OATS / SINGLE SERVING):&nbsp;</strong>CHICORY ROOT FIBER, WHEAT FLOUR, PALM FRUIT OIL, CANE SUGAR, ORGANIC HONEY, BUTTER, VEGETABLE GLYCERIN, MILK PROTEIN ISOLATE, CHICKPEA FLOUR, EGGS, SEA SALT, VANILLA EXTRACT, SUNFLOWER LECITHIN, OAT FIBER, BAKING SODA, MONK FRUIT EXTRACT</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0);
