(206, 59, 1, 'Rip Van Protein Wafel', '<p>Well is it wafel or waffle? We&#39;ll go with Rip Van on this one since their convenient&nbsp;flavored Protein *Wafels* taste so good. Both delicious and healthy, they&#39;re inspired by the traditional Dutch snack and the perfect complement to a warm cup of coffee.</p>\r\n\r\n<p>Being high in fiber from chicory roots, low in sugar, and packed with milk proteins&nbsp;</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(207, 59, 2, 'Rip Van Protein Wafel', '<p>Well is it wafel or waffle? We&#39;ll go with Rip Van on this one since their convenient&nbsp;flavored Protein *Wafels* taste so good. Both delicious and healthy, they&#39;re inspired by the traditional Dutch snack and the perfect complement to a warm cup of coffee.</p>\r\n\r\n<p>Being high in fiber from chicory roots, low in sugar, and packed with milk proteins.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(208, 60, 1, 'Novo Protein Chips', '<ul>\r\n	<li>A healthy high protein alternative to conventional snacks</li>\r\n	<li>Can be enjoyed at any-time by anyone looking for a source of protein to support their active lifestyle</li>\r\n	<li>Each pack of Protein Chips contains 10g of protein</li>\r\n	<li>Less than 155 calories, 12g of carbs and less than 3g fat</li>\r\n	<li>Healthy, tasty and each bag of chips will keep you feeling fuller for longer</li>\r\n	<li>Natural ingredients, delicious flavors</li>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(209, 60, 2, 'Novo Protein Chips', '<ul>\r\n	<li>A healthy high protein alternative to conventional snacks</li>\r\n	<li>Can be enjoyed at any-time by anyone looking for a source of protein to support their active lifestyle</li>\r\n	<li>Each pack of Protein Chips contains 10g of protein</li>\r\n	<li>Less than 155 calories, 12g of carbs and less than 3g fat</li>\r\n	<li>Healthy, tasty and each bag of chips will keep you feeling fuller for longer</li>\r\n	<li>Natural ingredients, delicious flavors</li>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(210, 61, 1, 'Muscle Cheff Protein Chips', '<h1>&nbsp;</h1>\r\n\r\n<ul>\r\n	<li>HIGH PROTEIN: 10g of protein per bag</li>\r\n	<li>CRUNCHY DELIGHT: Muscle Cheff Protein chips have that delightful, satisfying crunch, without any of the guilt!</li>\r\n	<li>NON-GMO: Muscle Cheff Protein chips are non-GMO. Always.</li>\r\n	<li>BAKED, NEVER FRIED FORMULA: Muscle Cheff&nbsp;Protein chips are always baked - you can enjoy them knowing that they are never fried/</li>\r\n	<li>HEALTHY, VERSATILE SNACK: Muscle Cheff BBQ Protein chips are the perfect snack to keep at home or on the go. Perfect on their own or as a topping for salads, meats.</li>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(211, 61, 2, 'Muscle Cheff Protein Chips', '<h1>&nbsp;</h1>\r\n\r\n<ul>\r\n	<li>HIGH PROTEIN: 10g of protein per bag</li>\r\n	<li>CRUNCHY DELIGHT: Muscle Cheff Protein chips have that delightful, satisfying crunch, without any of the guilt!</li>\r\n	<li>NON-GMO: Muscle Cheff Protein chips are non-GMO. Always.</li>\r\n	<li>BAKED, NEVER FRIED FORMULA: Muscle Cheff&nbsp;Protein chips are always baked - you can enjoy them knowing that they are never fried/</li>\r\n	<li>HEALTHY, VERSATILE SNACK: Muscle Cheff BBQ Protein chips are the perfect snack to keep at home or on the go. Perfect on their own or as a topping for salads, meats.</li>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(212, 62, 1, 'Chikalab Chika sport Milk Protien Chocolate', '<p><strong>Chikalab Chika Sport&nbsp;Sugar-&nbsp;Free&nbsp;Protein&nbsp;Milk Chocolate</strong>&nbsp;is a delicious and nutrient-rich treat. One 100 gram bar contains 21 grams of protein, so you can indulge yourself in a delicious dessert without worrying about the effectiveness of your workouts.</p>\r\n\r\n<p>One bar contains at least 26% of milk solids, which guarantees a unique taste and real pleasure for connoisseurs of natural chocolate.&nbsp;The composition includes dietary water-soluble corn fiber, which contributes to the intake of fiber into the body.&nbsp;The manufacturer does not use sugar (replaced by low-calorie sweetener sucralose), GMOs, and other synthetic ingredients.&nbsp;The calorie content of the product is 500 kcal in one plate, so it can be used to get a quick and at the same time useful charge of energy.</p>\r\n\r\n<p>Flavors:&nbsp; Milk Chocolate + Almonds,&nbsp;Milk Chocolate + Hazelnuts,&nbsp;Milk Protein Chocolate,&nbsp;Milk Protein Chocolate + Cashewnuts.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(213, 62, 2, 'Chikalab Chika sport Milk Protien Chocolate', '<p><strong>Chikalab Chika Sport&nbsp;Sugar-&nbsp;Free&nbsp;Protein&nbsp;Milk Chocolate</strong>&nbsp;is a delicious and nutrient-rich treat. One 100 gram bar contains 21 grams of protein, so you can indulge yourself in a delicious dessert without worrying about the effectiveness of your workouts.</p>\r\n\r\n<p>One bar contains at least 26% of milk solids, which guarantees a unique taste and real pleasure for connoisseurs of natural chocolate.&nbsp;The composition includes dietary water-soluble corn fiber, which contributes to the intake of fiber into the body.&nbsp;The manufacturer does not use sugar (replaced by low-calorie sweetener sucralose), GMOs, and other synthetic ingredients.&nbsp;The calorie content of the product is 500 kcal in one plate, so it can be used to get a quick and at the same time useful charge of energy.</p>\r\n\r\n<p>Flavors:&nbsp; Milk Chocolate + Almonds,&nbsp;Milk Chocolate + Hazelnuts,&nbsp;Milk Protein Chocolate,&nbsp;Milk Protein Chocolate + Cashewnuts.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
