(220, 66, 1, 'Snickers Hi Protein Bar', '<p>Be one of the first to try the brand&nbsp;NEW Snickers Hi-Protein Bar which is a tasty way to enjoy protein in your diet, you&rsquo;ll love this bar now with a&nbsp;HUGE 20g of protein - add it to your&nbsp;Protein Package now! This new Hi-Protein Snickers Protein bar contains just 200 plus&nbsp;calories and has the nutritional profile you would expect from any leading protein&nbsp;snack but with all the great taste of your favorite confectionery brand.</p>\r\n\r\n<p>The&nbsp;snickers protein bar is a delicious combination of nuts, caramel, and chocolate with a soft nougaty center containing 20g of protein. The individually wrapped Snickers protein bars can be easily slipped into any gym bag as a post work out snack. Protein&nbsp;by mars has taken protein bars to a whole new level!</p>\r\n\r\n<p><strong>Flavors:</strong> Chocolate, Chocolate Crisp, Peanut butter, White chocolate&nbsp;</p>\r\n\r\n<p><strong>Ingredients</strong>: Protein Blend (19%) (Milk Protein Isolate, Milk Protein, Whey Protein Concentrate (from Milk), Emulsifier (Soya Lecithin)), Milk Chocolate (15%) (Sugar, Cocoa Butter, Skimmed Milk Powder, Cocoa Mass, Lactose and Protein from Whey (from Milk), Palm Fat, Whey Powder (from Milk), Milk Fat, Emulsifier (Soya Lecithin E476), Natural Vanilla Extract), Hydrolysed Collagen (14%), Caramel (14%) (Sweetened Condensed Skimmed Milk, Glucose Syrup, Invert Sugar Syrup, Palm Oil, Butter (from Milk), Sugar, Emulsifier (E471), Stabiliser (Pectin), Salt, Natural Flavouring), Humectant (Maltitol), Peanuts (10%), Humectant (Glycerol), Peanut Flour, Fructo-Oligosaccharide, Natural Flavouring (Peanut), Salt, Colour (Plain Caramel), Antioxidant (Natural Mixed Tocopherols.) May contain (if applicable): Almond, Hazelnut, Pecan Nuts, Gluten, Egg.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(221, 66, 2, 'Snickers Hi Protein Bar', '<p>Be one of the first to try the brand&nbsp;NEW Snickers Hi-Protein Bar which is a tasty way to enjoy protein in your diet, you&rsquo;ll love this bar now with a&nbsp;HUGE 20g of protein - add it to your&nbsp;Protein Package now! This new Hi-Protein Snickers Protein bar contains just 200 plus&nbsp;calories and has the nutritional profile you would expect from any leading protein&nbsp;snack but with all the great taste of your favorite confectionery brand.</p>\r\n\r\n<p>The&nbsp;snickers protein bar is a delicious combination of nuts, caramel, and chocolate with a soft nougaty center containing 20g of protein. The individually wrapped Snickers protein bars can be easily slipped into any gym bag as a post work out snack. Protein&nbsp;by mars has taken protein bars to a whole new level!</p>\r\n\r\n<p><strong>Flavors:</strong> Chocolate, Chocolate Crisp, Peanut butter, White chocolate&nbsp;</p>\r\n\r\n<p><strong>Ingredients</strong>: Protein Blend (19%) (Milk Protein Isolate, Milk Protein, Whey Protein Concentrate (from Milk), Emulsifier (Soya Lecithin)), Milk Chocolate (15%) (Sugar, Cocoa Butter, Skimmed Milk Powder, Cocoa Mass, Lactose and Protein from Whey (from Milk), Palm Fat, Whey Powder (from Milk), Milk Fat, Emulsifier (Soya Lecithin E476), Natural Vanilla Extract), Hydrolysed Collagen (14%), Caramel (14%) (Sweetened Condensed Skimmed Milk, Glucose Syrup, Invert Sugar Syrup, Palm Oil, Butter (from Milk), Sugar, Emulsifier (E471), Stabiliser (Pectin), Salt, Natural Flavouring), Humectant (Maltitol), Peanuts (10%), Humectant (Glycerol), Peanut Flour, Fructo-Oligosaccharide, Natural Flavouring (Peanut), Salt, Colour (Plain Caramel), Antioxidant (Natural Mixed Tocopherols.) May contain (if applicable): Almond, Hazelnut, Pecan Nuts, Gluten, Egg.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(222, 67, 1, 'M&M Hi Protein Bar', '<p>2022 just got better! M&amp;M&#39;s have launched their first-ever protein bar range with three flavors to choose from Peanut, Chocolate, and Crispy.</p>\r\n\r\n<p>Each M&amp;M Protein Bar has over 15 grams of whey protein, low sugar content, and only 192 calories. Keep track of your diet whilst enjoying your favorite chocolate brand.</p>\r\n\r\n<p>One full box contains twelve 51-gram bars, we&#39;re sure you&#39;ll all be going &#39;nuts&#39; for these, so grab them whilst you can!</p>\r\n\r\n<p><strong>Flavors:</strong> Chocolate, Peanut, Chocolate Crisp.</p>\r\n\r\n<p><strong>Ingredients: </strong>Milk Chocolate (16%) (Sugar, Cocoa Butter, Skimmed Milk Powder, Cocoa Mass, Lactose and Protein from Whey (Milk), Palm Fat, Whey Powder (Milk), Milk Fat, Emulsifiers (E322 (Soya), E476), Vanilla Extract), Protein Blend (Milk Protein, Whey Protein Concentrate (Milk), Emulsifier (E322 (Soya), Caramel (10%) (Sweetened Condensed Skimmed Milk (Milk, Sugar), Glucose Syrup, Invert Sugar Syrup, Palm Oil, Butter (Milk), Sugar, Emulsifier (E471), Stabiliser (E440), Salt, Flavouring) (10%), Humectant (Glycerol), Sweetener (Maltitol), hydrolyzed Collagen, Mini M&amp;m&#39;s (7%) (Sugar, Cocoa Mass, Full Cream Milk Powder, Lactose (Milk), Cocoa Butter, Starch, Palm Fat, Shea Fat, Glucose Syrup, Emulsifier (E322(Soya)), Stabiliser (E414), Colours (E100, E133, E160a, E162, E170, E172), Dextrin, Glazing Agent (E903), Palm Kernel Oil, Salt, Vanilla Extract), Soya Protein Isolate, Flour, Glucose Syrup, Sunflower Oil, Flavourings, Salt, Colouring (E150a), Antioxidant (E306). May Contain: Wheat, Barley, Eggs, Nuts, and Oats.</p>\r\n\r\n<p>The ingredients list is based on Peanut M&amp;M&#39;s Protein Bar. Ingredients may vary slightly depending on flavor.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(223, 67, 2, 'M&M Hi Protein Bar', '<p>2022 just got better! M&amp;M&#39;s have launched their first-ever protein bar range with three flavors to choose from Peanut, Chocolate, and Crispy.</p>\r\n\r\n<p>Each M&amp;M Protein Bar has over 15 grams of whey protein, low sugar content, and only 192 calories. Keep track of your diet whilst enjoying your favorite chocolate brand.</p>\r\n\r\n<p>One full box contains twelve 51-gram bars, we&#39;re sure you&#39;ll all be going &#39;nuts&#39; for these, so grab them whilst you can!</p>\r\n\r\n<p><strong>Flavors:</strong> Chocolate, Peanut, Chocolate Crisp.</p>\r\n\r\n<p><strong>Ingredients: </strong>Milk Chocolate (16%) (Sugar, Cocoa Butter, Skimmed Milk Powder, Cocoa Mass, Lactose and Protein from Whey (Milk), Palm Fat, Whey Powder (Milk), Milk Fat, Emulsifiers (E322 (Soya), E476), Vanilla Extract), Protein Blend (Milk Protein, Whey Protein Concentrate (Milk), Emulsifier (E322 (Soya), Caramel (10%) (Sweetened Condensed Skimmed Milk (Milk, Sugar), Glucose Syrup, Invert Sugar Syrup, Palm Oil, Butter (Milk), Sugar, Emulsifier (E471), Stabiliser (E440), Salt, Flavouring) (10%), Humectant (Glycerol), Sweetener (Maltitol), hydrolyzed Collagen, Mini M&amp;m&#39;s (7%) (Sugar, Cocoa Mass, Full Cream Milk Powder, Lactose (Milk), Cocoa Butter, Starch, Palm Fat, Shea Fat, Glucose Syrup, Emulsifier (E322(Soya)), Stabiliser (E414), Colours (E100, E133, E160a, E162, E170, E172), Dextrin, Glazing Agent (E903), Palm Kernel Oil, Salt, Vanilla Extract), Soya Protein Isolate, Flour, Glucose Syrup, Sunflower Oil, Flavourings, Salt, Colouring (E150a), Antioxidant (E306). May Contain: Wheat, Barley, Eggs, Nuts, and Oats.</p>\r\n\r\n<p>The ingredients list is based on Peanut M&amp;M&#39;s Protein Bar. Ingredients may vary slightly depending on flavor.</p>\r\n\r\n<h3>&nbsp;</h3>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(224, 68, 1, 'Bounty Hi Protein Bar', '<p>Back and better than ever before with a brand new recipe. The Official Bounty Hi-Protein Bars now has real desiccated coconut that&#39;s encased in low sugar milk chocolate. The new Bounty recipe packs in over 18-grams of whey protein to aid muscle recovery and synthesis after an intense workout.</p>\r\n\r\n<p>If you&#39;re seeking a healthy coconut and chocolate snack to enjoy, this Bounty Protein Bar will send you coco-nuts.</p>\r\n\r\n<p><strong>Ingredients</strong>: Milk Chocolate (25%) (Sugar, Cocoa Butter, Skimmed Milk Powder, Cocoa Mass, Lactose and Protein from Whey (Milk), Palm Fat, Whey Powder (Milk), Milk Fat, Emulsifier (Soya Lecithin), Natural Vanilla Flavouring), Milk Protein, Collagen Hydrolysate, Polydextrose, Desiccated Coconut (9%), Humectant (Glycerol), Water, Coconut Fat, Flavouring, Sunflower Oil.</p>\r\n\r\n<p><strong>Nutritional Facts</strong></p>\r\n\r\n<table border=\\\"1\\\" cellpadding=\\\"1\\\" cellspacing=\\\"1\\\" style=\\\"width:200px\\\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Calories</td>\r\n			<td>207KCAL</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protein</td>\r\n			<td>18G</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Carbohydrate</td>\r\n			<td>14G</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Of Which Sugars</td>\r\n			<td>8G</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fat</td>\r\n			<td>8.6G</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Of Which Saturates</td>\r\n			<td>6.5 G</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Salt</td>\r\n			<td>0.14 G</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Based on a 52-gram Bounty Hi-Protein Bar.</p>\r\n\r\n<p>&nbsp;</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
