(226, 69, 1, 'Mars Hi Protien Bar', '<p>Missing Mars bars? At Protein Package, we&#39;ve got you covered! Two Mars Hi-Protein Bar flavors are now available: Salted Caramel and Original. Both Mars Protein Bars now come in boxes of 12 and each bar contains a huge 20 grams of protein and only 3 grams of sugar. Protein + Mars = A match made in heaven.&nbsp;</p>\r\n\r\n<p><strong>Ingredients:</strong> Protein Blend (27%) (Soya Protein isolate, Milk Protein Isolate, Skimmed Milk Powder, Whey Protein Concentrate (Milk), Egg Albumen, Emulsifier (Soya Lecithin)), Caramel (16%) (Sweetened Condensed Skimmed Milk, Glucose Syrup, Invert Sugar Syrup, Palm Oil, Butter (Milk), Sugar, Emulsifier (E471), Stabiliser (Pectin), Salt, Natural Flavouring), Milk Chocolate (15%) (Sugar, Cocoa Butter, Skimmed Milk Powder, Cocoa Mass, Lactose and Protein from Whey (Milk), Palm Fat, Whey Powder (Milk), Milk Fat, Emulsifiers (Soya Lecithin, E476), Natural Vanilla Extract, Hydrolysed Collagen (12%), Humectant (Glycerol), Fructo-Oligosaccharide, Humectant (Maltitol), Flavourings, Fat Reduced Cocoa Powder, Barley Malt Extract, Salt.&nbsp; &nbsp; &nbsp; &nbsp; Ingredients may vary slightly depending on flavor.&nbsp;</p>\r\n\r\n<p><strong>Nutritional&nbsp;Facts</strong></p>\r\n\r\n<table border=\\\"1\\\" cellpadding=\\\"1\\\" cellspacing=\\\"1\\\" style=\\\"width:200px\\\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Calories</td>\r\n			<td>219&nbsp;KCAL</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protein</td>\r\n			<td>20 G</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Carbohydrate</td>\r\n			<td>23 G</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Of Which Sugars</td>\r\n			<td>15 G</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fat</td>\r\n			<td>5 G</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Of Which&nbsp;Saturates</td>\r\n			<td>2 G</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fiber</td>\r\n			<td>0 G</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Nutritional values&nbsp;may vary slightly depending on flavor.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
