(228, 70, 1, 'Novo Protein Break Bar', '<p>Novo Protein Break is a delicious low sugar, two finger bar, filled with a chocolate cream and crispy wafer, all enrobed in real milk chocolate.<br />\r\n<br />\r\nIt&#39;s the perfect snack, with an added protein boost, to enjoy anytime and anywhere - not to mention it&#39;s gluten free!</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(229, 70, 2, 'Novo Protein Break Bar', '<p>Novo Protein Break is a delicious low sugar, two finger bar, filled with a chocolate cream and crispy wafer, all enrobed in real milk chocolate.<br />\r\n<br />\r\nIt&#39;s the perfect snack, with an added protein boost, to enjoy anytime and anywhere - not to mention it&#39;s gluten free!</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(230, 71, 1, 'Highkey Mini Cookies', '<p>Low carb &amp; low sugar cookies - HighKey&nbsp; Mini Cookies are an excellent low carb treat for curbing your sweet tooth cravings. Enjoy these no sugar added cookies with your favorite milk or crumbled for a delicious dessert topping. With 0g sugar per serving, our gluten-free cookies are ideal for diabetic snacks, paleo treats, and keto desserts alike. These low sugar cookies have a smooth crunchy texture and are sized to easily pop in your mouth and enjoy! Keto-friendly snack - These HighKey keto snacks are made with only 2g of net carbs, so you can enjoy your favorite sweets while staying in ketosis. Made with wholesome ingredients and no added sugar, these keto Mini Cookies are a smart choice for your low-carb lifestyle. Finding delicious low-carb snacks can be difficult, but we did the hard work for you with these tasty keto cookies.</p>\r\n\r\n<p><strong>Flavors:</strong> Peanut Butter, Snickerdoodle, Chocolate Chip, Double Chocolate Brownie.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Highlights</strong></p>\r\n\r\n<ul>\r\n	<li>Zero&nbsp;Added Sugar</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Keto-Friendly</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Gluten-Free</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Grain-Free</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Low Carb</li>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(231, 71, 2, 'Highkey Mini Cookies', '<p>Low carb &amp; low sugar cookies - HighKey Peanut Butter Mini Cookies are an excellent low carb treat for curbing your sweet tooth cravings. Enjoy these no sugar added cookies with your favorite milk or crumbled for a delicious dessert topping. With 0g sugar per serving, our gluten-free cookies are ideal for diabetic snacks, paleo treats, and keto desserts alike. These low sugar cookies have a smooth crunchy texture and are sized to easily pop in your mouth and enjoy! Keto-friendly snack - These HighKey keto snacks are made with only 2g of net carbs, so you can enjoy your favorite sweets while staying in ketosis. Made with wholesome ingredients and no added sugar, these keto Peanut Butter Mini Cookies are a smart choice for your low-carb lifestyle. Finding delicious low-carb snacks can be difficult, but we did the hard work for you with these tasty keto cookies.</p>\r\n\r\n<p><strong>Flavors:</strong> Peanut Butter, Snickerdoodle, Chocolate Chip, Double Chocolate Brownie.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Highlights</h3>\r\n\r\n<ul>\r\n	<li>ZERO Added Sugar</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Keto-Friendly</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Gluten-Free</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Grain-Free</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Low Carb</li>\r\n</ul>\r\n\r\n<ul>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(232, 72, 1, 'Highkey Plant- based Protien Cereal', '<p>&nbsp;</p>\r\n\r\n<p>Highkey&nbsp;Plant-Based Protein Cereal is vegan-friendly and keto-friendly, with a crunchy texture and that childhood taste you crave - minus all those artificial colors and flavors. Each serving packs a punch with 16 cereal-only delish grams of protein, 4 grams of net carbs, and no added sugar. Go ahead: ditch the sugar buzz, banish cravings, and dig into cereal again. There are two flavors to go around.&nbsp;Gluten-free &amp; Grain-free - with zero artificial sweeteners, this nourishing, powerful mix has all the familiar texture and great taste of an original cereal breakfast. Good food from better ingredients - great for keto, paleo, low carb, high protein, and gluten-free diets.</p>\r\n\r\n<p><br />\r\n<br />\r\n<strong>Ingredients:</strong>&nbsp;Milk Protein Isolate, Erythritol, Medium Chain Triglycerides, Inulin, Allulose Syrup, Cocoa Powder with Potassium Carbonate, Natural Flavors, Natural Caramel Color, Sunflower Lecithin, Salt, Monk Fruit Extract.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(233, 72, 2, 'Highkey Plant- based Protien Cereal', '<p>Highkey&nbsp;Plant-Based Protein Cereal is vegan-friendly and keto-friendly, with a crunchy texture and that childhood taste you crave - minus all those artificial colors and flavors. Each serving packs a punch with 16 cereal-only delish grams of protein, 4 grams of net carbs, and no added sugar. Go ahead: ditch the sugar buzz, banish cravings, and dig into cereal again. There are two flavors to go around.&nbsp;Gluten-free &amp; Grain-free - with zero artificial sweeteners, this nourishing, powerful mix has all the familiar texture and great taste of an original cereal breakfast. Good food from better ingredients - great for keto, paleo, low carb, high protein, and gluten-free diets.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(234, 73, 1, 'Black Max Protein Cookies', '<p><em><strong>CHOCOLATE-DIPPED PROTEIN OREOS!&nbsp;</strong></em></p>\r\n\r\n<p><em>﻿4 Chocolate Coated Protein Sandwich Cookies per pack!&nbsp;</em></p>\r\n\r\n<p>The best thing that could happen to the classic&nbsp;<strong>BLACKMAX&reg; TOTALCHOC</strong>&nbsp;is its new cover in chocolate.<br />\r\nTaste them and immerse yourself in the delicious world&nbsp;<strong>TOTALCHOC.</strong><br />\r\nCrispy chocolate cookie with no added sugar</p>\r\n\r\n<p>Delicious low-fat protein cream<br />\r\nA full bath of soft Belgian chocolate, defatted and without added sugar</p>\r\n\r\n<p><strong>BLACK CHOC</strong>&nbsp;- For chocolate classics<br />\r\n<strong>WHITE CHOC</strong>&nbsp;- For the sweet tooth</p>\r\n\r\n<p><strong>With 27 g of protein and 1% of sugar not added</strong><br />\r\n<strong>BLACKMAX&reg; TOTALCHOC&nbsp;</strong>&nbsp;is destined to be your companions in those moments when your body asks you for chocolate ... but your head asks you to take care of yourself...</p>\r\n\r\n<p><strong>BLACKMAX&reg; TOTALCHOC</strong>!!!<br />\r\nAmazing!</p>\r\n\r\n<p>By&nbsp;<strong>MAX PROTEIN&reg;</strong></p>\r\n\r\n<h2>NUTRITIONAL INFORMATION</h2>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>NUTRITIONAL INFORMATION</td>\r\n			<td>&nbsp;100 G / Per Pack&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Energy</td>\r\n			<td>1500.6 kJ/ 359 Kcal</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fats</td>\r\n			<td>16.2 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Of which saturates</td>\r\n			<td>&nbsp;8.6&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Carbohydrates</td>\r\n			<td>&nbsp;26.1&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Of which sugars</td>\r\n			<td>&nbsp;1.2 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Of which polyols</td>\r\n			<td>15 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fibre</td>\r\n			<td>&nbsp;3.8 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Prote&iacute;ns</td>\r\n			<td>&nbsp;27.2&nbsp; g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Salt</td>\r\n			<td>&nb