(236, 74, 1, 'Dr. Korner Multigrain Crispbread', '<p>The brand Dr.K&ouml;rner combines 100% natural products for a healthy lifestyle made of the most wholesome cereals.</p>\r\n\r\n<p>Dr.K&ouml;rner offers&nbsp;Multigrain&nbsp;Crispy cakes with a variety of flavors to enjoy your snacky.</p>\r\n\r\n<p><strong>Flavors:</strong></p>\r\n\r\n<p>Multigrain&nbsp;Crispy Cranberry&nbsp;Cakes</p>\r\n\r\n<p>Multigrain&nbsp;Crispy Honey Cakes</p>\r\n\r\n<p>Multigrain&nbsp;Crispy Cheese&nbsp;Cakes</p>', '', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(237, 74, 2, 'Dr. Korner Multigrain Crispbread', '<p>The brand Dr.K&ouml;rner combines 100% natural products for a healthy lifestyle made of the most wholesome cereals.</p>\r\n\r\n<p>Dr.K&ouml;rner offers&nbsp;Multigrain&nbsp;Crispy cakes with a variety of flavors to enjoy your snacky.</p>\r\n\r\n<p><strong>Flavors:</strong></p>\r\n\r\n<p>Multigrain&nbsp;Crispy Cranberry&nbsp;Cakes</p>\r\n\r\n<p>Multigrain&nbsp;Crispy Honey Cakes</p>\r\n\r\n<p>Multigrain&nbsp;Crispy Cheese&nbsp;Cakes</p>', '', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(238, 75, 1, 'Applied Nutrition Critical Oats', '<p>Critical Oats Protein Porridge is the perfect on-the-go breakfast or snack. Delivering a well-balanced blend of 100% Organic Wholegrain Oats, high levels of Protein including ISO-XP Protein Isolate, and also features MCT Powder (Healthy Fats) ideal for your Busy/Active Lifestyle.</p>\r\n\r\n<h2>KEY BENEFITS</h2>\r\n\r\n<ul>\r\n	<li>23g Protein per serving</li>\r\n	<li>No Added sugar</li>\r\n	<li>loaded with BCAA &amp; Glutamine</li>\r\n	<li>MCT Powder (Healthy Fats)</li>\r\n	<li>Includes ISO-XP Protein Isolate</li>\r\n	<li>On-The-Go Breakfast</li>\r\n	<li>Organic Oats.</li>\r\n	<li>Halal Certified</li>\r\n	<li>Tested for athletes</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Flavors:</strong> Golden Syrup, Chocolate, Strawberry, Banana, Blueberry, Coconut.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(239, 75, 2, 'Applied Nutrition Critical Oats', '<p>Critical Oats Protein Porridge is the perfect on-the-go breakfast or snack. Delivering a well-balanced blend of 100% Organic Wholegrain Oats, high levels of Protein including ISO-XP Protein Isolate, and also features MCT Powder (Healthy Fats) ideal for your Busy/Active Lifestyle.</p>\r\n\r\n<h2>KEY BENEFITS</h2>\r\n\r\n<ul>\r\n	<li>23g Protein per serving</li>\r\n	<li>No Added sugar</li>\r\n	<li>loaded with BCAA &amp; Glutamine</li>\r\n	<li>MCT Powder (Healthy Fats)</li>\r\n	<li>Includes ISO-XP Protein Isolate</li>\r\n	<li>On-The-Go Breakfast</li>\r\n	<li>Organic Oats.</li>\r\n	<li>Halal Certified</li>\r\n	<li>Tested for athletes</li>\r\n</ul>\r\n\r\n<p><strong>Flavors:</strong> Golden Syrup, Chocolate, Strawberry, Banana, Blueberry, Coconut.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0);
