(240, 76, 1, 'Evogen Evogreens', '<h2>EVOGREENS &ndash; PREMIUM PERFORMANCE GREENS FORMULA</h2>\r\n\r\n<p>EVOGREENS&trade; was designed specifically to address the needs of physique athletes that train hard. The goal was to provide strategically selected ingredients to not only help detoxify and nourish the body but to accelerate overall recovery and well-being in a manner other &ldquo;superfood&rdquo; products cannot. Our goal was to reset the perspective on functional &ldquo;greens&rdquo; products, and we accomplished that with EVOGREENS.</p>\r\n\r\n<ul>\r\n	<li>6 Servings Fruits &amp; Veggies</li>\r\n	<li>2 Billion CFU Probiotics for Immune Support</li>\r\n	<li>150mg VitaGranate for Cardiovascular Health</li>\r\n	<li>Zero Synthetic Colors, Sweeteners or Flavors</li>\r\n	<li>30 Day Supply</li>\r\n</ul>\r\n\r\n<p>This isn&rsquo;t another &ldquo;kitchen sink&rdquo; greens product with 60-70 under-dosed ingredients. Everything in EVOGREENS serves a purpose directly related to training with your health in mind, helping your&nbsp;physique recover and detoxify from the everyday grind. We even took it a step further and included potent and shelf-stable probiotics that not only support immune health but more importantly the well-being of your GI tract. This helps ensure the macro and micronutrient elements of your diet get absorbed properly.</p>\r\n\r\n<h3>SPIRULINA &ndash; THE PERFECT SUPERFOOD, AND WE HAVE MORE THAN ANYONE ELSE</h3>\r\n\r\n<p>Spirulina is one of the oldest life forms on Earth. These blue-green microalgae are partly responsible for producing the oxygen in the planet&rsquo;s atmosphere that allowed the planet&rsquo;s originating life forms to develop billions of years ago. Spirulina is the world&rsquo;s first superfood, and one of the most nutrient-rich foods on Earth.</p>\r\n\r\n<p>It provides a near-instantaneous boost to one&rsquo;s energy while helping to improve endurance and reduce fatigue. It helps improve the immune system and provides exceptional support for the heart, liver, and kidneys. Spirulina is also a natural detoxifier, oxygenating the blood, and helping cleanse the body of toxins and other impurities that may be causing illnesses or other health complications.</p>\r\n\r\n<p>Spirulina is also a natural appetite suppressant, and it helps to improve the body&rsquo;s digestive system. It also has very powerful antioxidant properties and helps to balance the body&rsquo;s pH, thereby possibly reducing inflammation throughout the body in a safe and chemical-free way. This is all extremely beneficial to a hard training athlete, which is why Evogen uses an exceptionally high amount of Spirulina in EVOGREENS, with 2 grams in every serving.</p>\r\n\r\n<h2>POMEGRANATE EXTRACT (VITAGRANATE) &ndash; NATURE&rsquo;S SUPERFRUIT WITH A TECHNOLOGICAL TWIST</h2>\r\n\r\n<p>VitaGranate is standardized to an extremely high content of antioxidants, particularly tannins and flavonoids, which are critical in helping athletes recover and recuperate from strenuous exercise.&nbsp;Pomegranate has also been reported to influence healthy inflammatory response, anti-oxidative conditions, and microbial status.&nbsp;Cellular deterioration from strenuous exercise is compounded by the buildup of harmful free radicals in athletes and can lead to everyday wear and tear on the body. Why not give yourself a little nutraceutical insurance to stay healthy?</p>\r\n\r\n<p>One of the main reasons Evogen researchers chose Vitagranate is because it was found to be an activator of the heart-health-influencing enzyme Paraoxonase 1 (PON1). According to ex vivo study results, VitaGranate stimulated PON1 in human serum by as much as 47 percent. The extract is made with premium quality pomegranate and is standardized to ellagic acid and punicalagin. Recent science also suggests that increases in PON1 activity may aid in promoting overall longevity and health.</p>\r\n\r\n<h2>BACILLUS COAGULANS &amp; BACILLUS SUBTILUS &ndash; HEALTHY GUT FOR BETTER NUTRIENT ABSORPTION AND IMMUNE SUPPORT</h2>\r\n\r\n<p>A healthy gut equals a healthy athlete.&nbsp;These probiotics have a key impact on the effectiveness of EVOGREENS that no other brand can match. The effects of probiotics such as Bacillus Coagulas with protein have been examined in a randomized double-blind crossover clinical trial on key amino acids including leucine (the regulator for muscle protein synthesis), isoleucine, and valine (branched-chain amino acids), as well as histidine, alanine, asparagines, citrulline, cysteine, glutamine (a key amino acid for supporting ph balance and the immune system), methionine, ornithine, serine, threonine, tryptophan, and phenylalanine.</p>\r\n\r\n<p>Data indicated that Bacillus Coagulans has a positive impact on the absorption of a number of these key amino acids: Leucine by 23 percent, Isoleucine by 20 percent, Valine by 7 percent, Glutamine by 116 percent, Ornithine by 100 percent, Tryptophan by 100 percent and Citrulline by 128 percent.</p>\r\n\r\n<p>Bacillus coagulans and Bacillus subtilis have also shown to improve immune system response. The digestive and immune systems of the human body are closely linked, as 70% of the immune system is comprised of gut-associated lymphoid tissue. Therefore, it is no surprise that probiotics have been shown to have a beneficial impact on both digestive and immune functions, both of which are crucial to any hardworking athlete.</p>', '', NULL, 0, '', NULL, NULL, '', NULL, NULL),
