(242, 77, 1, 'Chikalab Protein Dragee Hazelnut', '<h2>PROTEIN DRAGEE&nbsp;HAZELNUT</h2>\r\n\r\n<p>Protein &nbsp;Dragee from Chikalab are sweets that will definitely please everyone, combining a pleasant pastime with benefits for the body.&nbsp;Each Hazelnut dragee&nbsp;is coated with a layer of protein&nbsp;milk chocolate and in white chocolate as well.&nbsp;Moreover, the chocolate used in the production is a unique joint development of the Chikalab company and Italian chocolatiers.&nbsp;It is made from the purest cocoa without sugar.</p>\r\n\r\n<p>CHIKALAB PROTEIN CHOCOLATE DRAGEES</p>\r\n\r\n<p><strong>CHIKALAB PROTEIN DRAGEE&nbsp;HAZELNUT</strong></p>\r\n\r\n<ul>\r\n	<li>Protein dragee in chocolate;</li>\r\n	<li>No added simple sugars or gluten;</li>\r\n	<li>Three layers: chocolate-protein-nut&nbsp;</li>\r\n	<li>Using 100% cocoa;</li>\r\n	<li>Whey concentrate in the composition;</li>\r\n	<li>25 grams of protein per 100g of pills;</li>\r\n	<li>With water-soluble corn fiber.</li>\r\n</ul>\r\n\r\n<p><strong>FEATURES&nbsp;</strong></p>\r\n\r\n<p>These pills are just a breakthrough in the world of healthy snacks.&nbsp;I just want to try them.&nbsp;Judge for yourself.&nbsp;A whole nut covered with a layer of protein and milk chocolate and white chocolate as well.&nbsp;How do such pills deserve the fame of a &ldquo;healthy&rdquo; snack?&nbsp;After all, it is essentially a sweetness, but an unusual sweetness.&nbsp;Let&rsquo;s sort it out in order.</p>\r\n\r\n<p>In the middle, there is a&nbsp;<strong>nut</strong>&nbsp;&ndash;&nbsp;<strong>Hazelnut.</strong>&nbsp;Take your pick.&nbsp;Any nut is a source of valuable nutrients, primarily useful polyunsaturated fats, as well as vitamins and minerals.&nbsp;You can choose such pills with a&nbsp;<strong>cornball</strong>&nbsp;inside.&nbsp;Also a good option.&nbsp;In this case, you are providing yourself with a serving of nutritious water-soluble corn fiber.&nbsp;Again, it&rsquo;s worth mentioning that nuts and corn fiber are both long-lasting satiety.</p>\r\n\r\n<p>Move on.&nbsp;<strong>Protein layer</strong>, and whey concentrate.&nbsp;Any protein is always useful and necessary for the body.</p>\r\n\r\n<p>Finally, a&nbsp;<strong>layer of milk chocolate</strong>.&nbsp;What is its peculiarity?&nbsp;The chocolate used is a joint development of Chikalab technologists and Italian chocolatiers.&nbsp;This chocolate filling contains no sugar and is made with 100 percent cocoa and corn fiber.</p>\r\n\r\n<p><strong>CHIKALAB PROTEIN&nbsp; DRAGEE&nbsp;HAZELNUT</strong></p>\r\n\r\n<p>Protein dragee in chocolate</p>\r\n\r\n<ul>\r\n	<li>25 grams of protein per 100g of pills</li>\r\n	<li>Whey concentrate in the base</li>\r\n	<li>Sugar-free chocolate</li>\r\n	<li>Inside &ndash; &nbsp;Hazelnut&nbsp;</li>\r\n	<li>Three layers &ndash; nut / protein / chocolate</li>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
