(248, 80, 1, 'FA Hair, Nails and Skin Formula', '<h1>HAIR SKIN AND NAILS FORMULA</h1>\r\n\r\n<h2>For healthy functioning skin, nails and hair</h2>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<p><strong>BEAUTIFUL AND HEALTHY HAIR, SKIN AND NAILS | NATURAL COLLAGEN FROM SHARK CARTILAGE | COMPLEX OF VITAMINS AND MINERALS</strong></p>\r\n\r\n<p>The ingredients within&nbsp;<strong>HAIR + NAILS &amp; SKIN FORMULA</strong>&nbsp;comprise a mix of vitamins, minerals, amino acids and natural collagen, all of which have known benefits to the health, well-being and proper functioning of skin, hair and nails.<br />\r\nDesigned for those who wish to maintain strong, healthy and good-looking hair, nails and skin we recommend adding this supplement as part of your regular diet.<strong>&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ingredients:</strong>&nbsp;Shark cartilage, fish collagen, bulking agents (tricalcium phosphate, microcrystalline cellulose), L-cysteine, vitamin C (L-ascorbic acid), zinc gluconate, L-methionine, silicon dioxide, anti-caking agents (E464, magnesium stearate), coating [bulking agents (hydroxypropyl methyl cellulose, polydextrose), colours (E172 (ii), E172 (i), E172(iii), E171), talc, maltodextrin, medium chain triglycerides (MCT)], grape seed extract (<em>Vitis vinifera</em>&nbsp;L.), vitamin E (D-alpha tocopheryl acid succinate), niacin (nicotinamide), pantothenic acid (D-calcium pantothenate), cupric sulphate, vitamin B6 (pyridoxine hydrochloride), vitamin B2 (riboflavin), vitamin B1 (thiamin hydrochloride), vitamin B12 (cyanocobalamin), folate (pteroylomonoglutamic acid), D-biotin.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Servings Per Container:</strong> 60 Tablets</p>\r\n\r\n<p><strong>Recommended use</strong>: Take 1 tablet a day after meal. Not chew.</p>\r\n\r\n<p><strong>Warnings:</strong>&nbsp;Do not exceed the recommended daily dose. Do not use if you are allergic to any ingredients contained in this product. Do not use if pregnant or nursing. Food supplements should not be used as a substitute for a varied, well-balanced diet. A varied and balanced diet and a healthy lifestyle are recommended. Store in a cool, dry place, away from direct sunlight. Keep out of reach of children.</p>\r\n\r\n<p>NUTRITION FACTSServing size: 1 tablet.&nbsp;Servings per container: 30Amount&nbsp;per1 tablet (NRV)Vitamin E15 mg (125)Vitamin C80 mg (100)Vitamin B11,2 mg (110)Vitamin B21,4 mg (100)Niacin16 mg (100)Vitamin B62,1 mg (150)Folic Acid200 &micro;g (100)Vitamin B124,5 &micro;g (180)Biotin100 &micro;g (200)Pantothenic acid7,5 mg (125)Copper1000 &micro;g (100)Zinc12 mg (120)Fish collagen175 mgShark cartilage powder175 mgL-cysteine100 mgL-methionine50mg Silicon dioxide50 mg Grape seed extract30 mg</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
