(250, 81, 1, 'Evogen Evozyme', '<p>Food is fuel. It provides you energy, your macro and micronutrients, and is essential to recovering properly. We all know that the hardest part of looking your best is based on what goes on in your kitchen. However, daily stress and the demands of today&rsquo;s world make this even harder in many ways, including your body&rsquo;s own production of digestive enzymes. We want you to strive to be your best in every way possible which is why we designed our enzyme complex to be used with any and every meal of the day.</p>\r\n\r\n<p>This custom enzyme blend was designed specifically for the needs of physique athletes and can only be found in Evogen Evozyme. The full spectrum enzyme blend was designed to help you not only break down protein properly, but to also help you breakdown different types of carbohydrates and fats with ease. This is crucial to physique success when trying to build mass or when getting shredded. Every macronutrient counts and if they aren&rsquo;t broken down properly, they can go to waste. Evozyme helps ensure this doesn&rsquo;t happen to maximize your food intake every meal, every day.</p>\r\n\r\n<p><strong>Servings Per Container:</strong> 60 Capsules.</p>\r\n\r\n<p><strong>DIRECTIONS FOR USE:&nbsp;</strong>Take 1 capsule with each meal.</p>\r\n\r\n<p><strong>WARNING:</strong></p>\r\n\r\n<p><strong>NOT FOR USE BY INDIVIDUALS UNDER THE AGE OF 18. DO NOT USE IF PREGNANT, EXPECT TO BECOME PREGNANT, OR NURSING. DO NOT</strong>&nbsp;take this product if you have any prior medical condition, including diabetes or high blood pressure. Consult with a qualified healthcare professional prior to using this product, especially if you are taking any prescription medications. Do not use if you are allergic or contraindicated to aspirin. Discontinue use two weeks prior to surgery or if upset stomach occurs.&nbsp;<strong>KEEP OUT OF REACH OF CHILDREN.</strong>&nbsp;Do not use if safety seal is broken or missing. Store at room temperature. Keep bottle tightly closed.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\\\"Evozyme - Premium Digestive Enzyme Support Supplement Facts\\\" src=\\\"https://cdn.shopify.com/s/files/1/0032/5736/8611/t/21/assets/deb48e9787c1--Evozyme-SFP-20200513-80c0cf.png?v=1633294761\\\" style=\\\"height:379px; width:347px\\\" /></p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
