(252, 82, 1, 'Evogen Light & Tight', '<h3>Evogen Light &amp; Tight- 14 Days Digestive&nbsp;Cleanse &amp; Detox</h3>\r\n\r\n<p><strong>14 Servings | 28 Capsules</strong></p>\r\n\r\n<p>Light &amp; Tight is a premium digestive cleanse and detox for those serious about resetting their microbiome and cleansing out their guts. Light &amp; Tight helps to gently flush your gut and intestines of all the waste buildup that has accumulated inside of you. No wonder so many people have distended, bloated stomachs and they feel like they can&rsquo;t lose weight. They&rsquo;ve never used a cleanse with this level of innovation. Light &amp; Tight also helps establish and maintain a healthy gut using the patent Pre for Pro&reg; prebiotic. This helps clear bad bacteria while priming the gut for a balanced and healthy microbiome. With Light &amp; Tight, you experience easy waste elimination and a clean, healthy gut to maximize your health and physique goals.</p>\r\n\r\n<p><strong>Servings Per Container:</strong> 28 Capsules</p>\r\n\r\n<p><strong>SUGGESTED USE:</strong></p>\r\n\r\n<p>As a dietary supplement, take 1-2 capsules with 8-16 oz. of water, once or twice a day - once in the morning and/or once in the afternoon. Drink at least 6 to 8 glasses of water daily. For best results, use with a combined diet and training program under professional supervision.&nbsp;<strong>DO NOT EXCEED RECOMMENDED DOSAGE.</strong></p>\r\n\r\n<h2>WARNING:</h2>\r\n\r\n<p><strong>NOT FOR USE BY INDIVIDUALS UNDER THE AGE OF 18. DO NOT USE IF YOU HAVE FREQUENT DIARRHEA OR ARE PREGNANT, EXPECT TO BECOME PREGNANT, OR NURSING.</strong>&nbsp;Do not use this product if you have any serious medical condition. Before using this product, consult with a licensed, qualified, health care professional, including but not limited to, if you suspect you have or have been treated for, diagnosed with or have a family history of any medical condition, or if you are using any prescription or over the counter medication. Do not use if you have or develop diarrhea, loose stool or abdominal pain.<br />\r\nImmediately discontinue use and contact a medical doctor if you experience any adverse reaction to this product. Discontinue use 2 weeks prior to surgery.&nbsp;<strong>DO NOT CONSUME MORE THAN 4 CAPSULES IN ANY 24-HOUR PERIOD. DO NOT CONSUME WITH ALCOHOL. KEEP OUT OF REACH OF CHILDREN.</strong>&nbsp;Store in a cool, dry place.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This product is only intended to be consumed by healthy adults, 18 years of age or older. Do not use this product if you are pregnant, expect to become pregnant, or are nursing. Always consult with your physician before using this or any other dietary supplement product. Do not use this product without consulting your physician if you are using any prescription or over the counter medication or if you have any pre-existing medical condition. Immediately discontinue use and consult your physician if you experience any adverse reaction to this product. Do not use if safety seal is broken or missing. Store in cool, dry place away from moisture and sunlight.</p>\r\n\r\n<p>KEEP OUT OF REACH OF CHILDREN</p>\r\n\r\n<p>&nbsp;</p>', '<p><img alt=\\\"Light &amp; Tight - 14 Day Digestive Cleanse &amp; Detox Supplement Facts\\\" src=\\\"https://cdn.shopify.com/s/files/1/0032/5736/8611/t/21/assets/37740d035732--Light-Tight-150cc-SFP-20210630-06a80d.png?v=1633300076\\\" style=\\\"height:450px; width:450px\\\" /></p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
