t use if you have or develop diarrhea, loose stool or abdominal pain.<br />\r\nImmediately discontinue use and contact a medical doctor if you experience any adverse reaction to this product. Discontinue use 2 weeks prior to surgery.&nbsp;<strong>DO NOT CONSUME MORE THAN 4 CAPSULES IN ANY 24-HOUR PERIOD. DO NOT CONSUME WITH ALCOHOL. KEEP OUT OF REACH OF CHILDREN.</strong>&nbsp;Store in a cool, dry place.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This product is only intended to be consumed by healthy adults, 18 years of age or older. Do not use this product if you are pregnant, expect to become pregnant, or are nursing. Always consult with your physician before using this or any other dietary supplement product. Do not use this product without consulting your physician if you are using any prescription or over the counter medication or if you have any pre-existing medical condition. Immediately discontinue use and consult your physician if you experience any adverse reaction to this product. Do not use if safety seal is broken or missing. Store in cool, dry place away from moisture and sunlight.</p>\r\n\r\n<p>KEEP OUT OF REACH OF CHILDREN</p>\r\n\r\n<p>&nbsp;</p>', '<p><img alt=\\\"Light &amp; Tight - 14 Day Digestive Cleanse &amp; Detox Supplement Facts\\\" src=\\\"https://cdn.shopify.com/s/files/1/0032/5736/8611/t/21/assets/37740d035732--Light-Tight-150cc-SFP-20210630-06a80d.png?v=1633300076\\\" style=\\\"height:450px; width:450px\\\" /></p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(254, 83, 1, 'Evogen Evolog', '<h2>&nbsp;Evogen Evolog</h2>\r\n\r\n<p><strong>&nbsp; 60 Capsules | 60 Servings</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>ADVANCED NUTRIENT REPARTITIONING - This potent combination of ingredients not only helps you breakdown food more efficiently, but also helps your body absorb more nutrients by positively modulating insulin and blood sugar levels. By doing this your body is more prone to shuttle carbs into muscle as opposed to adipose (fat) tissue. This helps carbs work for you on a whole other level.</li>\r\n	<li>DIHYDROBERBEINE (GlucoVantage) - Another first to the physique industry is the potent berberine extract. This metabolite of berberine actually has up to a 6x greater bioavailability than berberine itself. Berberine is found in many traditional GDA products, but Evogen took it a step further by using a more potent metabolite for improving insulin sensitivity and nutrient portioning at a much lower dosage.</li>\r\n	<li>R- ALPHA LIPOIC ACID - This is the naturally occurring form of lipoic acid, a nutrient present in every cell of the body, essential to chemical reactions that allow the body to produce energy. The fact that the body produces very little alpha lipoic on its own and is included in EVOLOG is because of its ability to enhance the utilization of carbs for proper energy storage and utilization.</li>\r\n	<li>BANABA EXTRACT - This extract is another staple in many GDA products and for good reason. It helps support not only healthy glucose levels, but also supports healthy digestion. It&rsquo;s a perfect for fit EVOLOG which utilizes both GDA&rsquo;s and digestive enzymes for a complete solution.</li>\r\n	<li>EVOZYME ENZYME COMPLEX - This custom enzyme blend was designed specifically for the needs of physique athletes. Its full spectrum enzyme blend was designed to help you not only break down protein properly, but to also help you breakdown different types of carbohydrates with ease. What&rsquo;s the point of eating all those carbs with your GDA if your body can&rsquo;t break them down efficiently?</li>\r\n</ul>\r\n\r\n<p><strong>How to Use ?</strong></p>\r\n\r\n<p>Take one (1) capsule with a high-carb meal, one (1) to three (3) times per day depending on your nutritional goals. Do not exceed three (3) capsules per day. For best results, use for an 8- week period in conjunction with a resistance training program. Always read the entire label before use, and follow the directions provided.</p>\r\n\r\n<p>This product is only intended to be consumed by healthy adults, 18 years of age or older. Do not use this product if you are pregnant, expect to become pregnant, or are nursing. Always consult with your physician before using this or any other dietary supplement product. Do not use this product without consulting your physician if you are using any prescription or over the counter medication or if you have any pre-existing medical condition. Immediately discontinue use and consult your physician if you experience any adverse reaction to this product. Do not use if safety seal is broken or missing. Store in cool, dry place away from moisture and sunlight.</p>\r\n\r\n<p>KEEP OUT OF REACH OF CHILDREN</p>\r\n\r\n<p>* These statements have not been evaluated by the Food and Drug Administration. This product is not intended to diagnose, treat, cure, or prevent any disease.</p>\r\n\r\n<p>&dagger; When combined with a proper exercise and nutrition program. Please consult with your physician before using this or any other dietary supplement product.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '<p><img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/0032/5736/8611/files/evolog-60-servings.jpg?v=1582767902\\\" /></p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
