(257, 84, 2, 'Oat King Protein Pancake Mix', '<p><strong>Oat King Protein Pancake Mix</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Product description:</strong>&nbsp;Powder mixture for protein pancakes made from the finest oat wholegrain flour and high-quality whey protein concentrate.</p>\r\n\r\n<p><strong>Ingredients for the flavor Original Flavor:</strong>&nbsp;OAT KING&reg; Oat Whole Grain Powder, Whey Protein Concentrate, Micellar Casein, Quark Powder (Wheat Flour, Starch, Lean Quark Powder, Diphosphates, Wheat Starch, Raising Agent Sodium Carbonates, Emulsifiers E472e, E481, Salt, Dextrose, Thickener Guar Gum, Xanthan Gum , Wheat protein), flavor, chicken protein, emulsifier soya lecithin, dye beta carotene, sweetener sucralose</p>\r\n\r\n<p><strong>Preparation and consumption:</strong>&nbsp;Add 125 ml of water to a mixing bowl, add 50 g (4 scoops) of powder mixture and mix with a whisk to a smooth dough.&nbsp;Place in a nonstick skillet and bake on both sides until golden brown.&nbsp;A preparation gives two pancakes.</p>\r\n\r\n<p><strong>Nutritional information</strong></p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<th>PER 100 G POWDER</th>\r\n			<th>PER SERVING</th>\r\n		</tr>\r\n		<tr>\r\n			<td>energy</td>\r\n			<td>1,627&nbsp;kJ (&nbsp;385&nbsp;kcal)</td>\r\n			<td>813&nbsp;kJ (&nbsp;193&nbsp;kcal)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>fat</td>\r\n			<td>7&nbsp;g</td>\r\n			<td>3.5&nbsp;g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;saturated fatty acids</td>\r\n			<td>2&nbsp;g</td>\r\n			<td>1&nbsp;g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>carbohydrates</td>\r\n			<td>50&nbsp;g</td>\r\n			<td>25&nbsp;g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Of which sugars</td>\r\n			<td>2&nbsp;g</td>\r\n			<td>1&nbsp;g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>protein</td>\r\n			<td>31&nbsp;g</td>\r\n			<td>15.5&nbsp;g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>salt</td>\r\n			<td>1.49&nbsp;g</td>\r\n			<td>0.75&nbsp;g</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0);
INSERT INTO `products_description` (`id`, `products_id`, `language_id`, `products_name`, `products_description`, `products_details`, `products_url`, `products_viewed`, `products_left_banner`, `products_left_banner_start_date`, `products_left_banner_expire_date`, `products_right_banner`, `products_right_banner_start_date`, `products_right_banner_expire_date`) VALUES
(258, 85, 1, 'Evogen Evovite Multivitamin', '<h3>Evogen Evovite Elite Physique Multivitamin</h3>\r\n\r\n<p><strong>30 Servings | 60 Capsules</strong></p>\r\n\r\n<p>Our goal is to bridge health and physique perfection, and we firmly believe EVOVITE helps to achieve this. EVOVITE is far beyond a mere high-potency multivitamin. It&rsquo;s really three supplements in one.</p>\r\n\r\n<ol>\r\n	<li><strong>A multivitamin/mineral formula with exceptional ingredient forms</strong></li>\r\n	<li><strong>A clinically validated beta-alanine supplement</strong></li>\r\n	<li><strong>A technologically superior curcumin supplement</strong></li>\r\n</ol>\r\n\r\n<p>The reality is, many multivitamin formulations use cheap forms of vitamins and minerals, and often times boast to having up to 70 ingredients that are largely not proven to do anything at the levels they contain. Not EVOVITE. Quality and potency came first.</p>\r\n\r\n<p><strong>Albion&reg; Certified Chelated Minerals</strong>&nbsp;&ndash; When it comes to nutrition it&rsquo;s hard to replace the nutrients found in wholefoods. However, because many farm raised crops have less and less vitamin and mineral composition, it&rsquo;s important for active athletes to supplement with key minerals such as zinc, magnesium, potassium, etc. An athlete&rsquo;s RDA requirements are higher than normal due to their increased activity levels from weightlifting, cardio, and active lifestyles.</p>\r\n\r\n<p>For these reasons, EVOVITE uses only the highest quality chelated minerals. These minerals are bound to amino acids to help ensure maximum bioavailability and utilization by the body. The body naturally chelates certain minerals, so chelated minerals help save a few biochemical processes for your body. It makes no sense to supplement with low quality minerals that ultimately don&rsquo;t get absorbed, and this is why EVOVITE sets the standard for high quality chelated mineral formulations.</p>\r\n\r\n<p><strong>Direction to use:</strong></p>\r\n\r\n<p>As a dietary supplement, take (1) one tablet twice daily with food, preferably with breakfast and dinner. Not formulated for use in children. Do not exceed suggested use. As with any supplement, if you are taking medication, consult your doctor before use.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(259, 85, 2, 'Evogen Evovite Multivitamin', '<h3>Evogen Evovite Elite Physique Multivitamin</h3>\r\n\r\n<p><strong>30 Servings | 60 Capsules</strong></p>\r\n\r\n<p>Our goal is to bridge health and physique perfection, and we firmly believe EVOVITE helps to achieve this. EVOVITE is far beyond a mere high-potency multivitamin. It&rsquo;s really three supplements in one.</p>\r\n\r\n<ol>\r\n	<li><strong>A multivitamin/mineral formula with exceptional ingredient forms</strong></li>\r\n	<li><strong>A clinically validated beta-alanine supplement</strong></li>\r\n	<li><strong>A technologically superior curcumin supplement</strong></li>\r\n</ol>\r\n\r\n<p>The reality is, many multivitamin formulations use cheap forms of vitamins and minerals, and often times boast to having up to 70 ingredients that are largely not proven to do anything at the levels they contain. Not EVOVITE. Quality and potency came first.</p>\r\n\r\n<p><strong>Albion&reg; Certified Chelated Minerals</strong>&nbsp;&ndash; When it comes to nutrition it&rsquo;s hard to replace the nutrients found in wholefoods. However, because many farm raised crops have less and less vitamin and mineral composition, it&rsquo;s important for active athletes to supplement with key minerals such as zinc, magnesium, potassium, etc. An athlete&rsquo;s RDA requirements are higher than normal due to their increased activity levels from weightlifting, cardio, and active lifestyles.</p>\r\n\r\n<p>For these reasons, EVOVITE uses only the highest quality chelated minerals. These minerals are bound to amino acids to help ensure maximum bioavailability and utilization by the body. The body naturally chelates certain minerals, so chelated minerals help save a few biochemical processes for your body. It makes no sense to supplement with low quality minerals that ultimately don&rsquo;t get absorbed, and this is why EVOVITE sets the standard for high quality chelated mineral formulations.</p>\r\n\r\n<p><strong>Direction to use:</strong></p>\r\n\r\n<p>As a dietary supplement, take (1) one tablet twice daily with food, preferably with breakfast and dinner. Not formulated for use in children. Do not exceed suggested use. As with any supplement, if you are taking medication, consult your doctor before use.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(260, 86, 1, 'Muscle Cheff Protein Coffee', '<p>Each serving of this delicious iced coffee contains 13g of protein, less than 1g of sugar and a host of different vitamins and minerals. A delicious way to support your healthy lifestyle at any time of day!<br />\r\n<br />\r\n<strong>Muscle Cheff High Protein Iced Espresso Coffee Highlights:</strong></p>\r\n\r\n<ul>\r\n	<li>No Sugar Added</li>\r\n	<li>Keto-Friendly</li>\r\n	<li>High Protein</li>\r\n</ul>\r\n\r\n<p><strong>How to prepare Muscle Cheff High Protein Iced Coffee:</strong></p>\r\n\r\n<ol>\r\n	<li>Mix 1 scoop (25g) with 150ml cold water or milk in a shaker or mixer.</li>\r\n	<li>Shake or mix well.</li>\r\n	<li>Add a couple of ice cubes and enjoy!</li>\r\n</ol>\r\n\r\n<p><img alt=\\\"Muscle Cheff High Protein Iced Coffee - Espresso\\\" src=\\\"https://cdn.shopify.com/s/files/1/0806/1189/t/105/assets/espresso-1.jpg\\\" style=\\\"height:536px; width:359px\\\" /></p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(261, 86, 2, 'Muscle Cheff Protein Coffee', '<h3>Each serving of this delicious iced coffee contains 13g of protein, less than 1g of sugar and a host of different vitamins and minerals. A delicious way to support your healthy lifestyle at any time of day!<br />\r\n<br />\r\n<strong>Muscle Cheff High Protein Iced Espresso Coffee Highlights:</strong></h3>\r\n\r\n<ul>\r\n	<li>No Sugar Added</li>\r\n	<li>Keto-Friendly</li>\r\n	<li>High Protein</li>\r\n</ul>\r\n\r\n<p><strong>How to prepare Muscle Cheff High Protein Iced Coffee:</strong></p>\r\n\r\n<ol>\r\n	<li>Mix 1 scoop (25g) with 150ml cold water or milk in a shaker or mixer.</li>\r\n	<li>Shake or mix well.</li>\r\n	<li>Add a couple of ice cubes and enjoy!</li>\r\n</ol>\r\n\r\n<p><img alt=\\\"Muscle Cheff High Protein Iced Coffee - Espresso\\\" src=\\\"https://cdn.shopify.com/s/files/1/0806/1189/t/105/assets/espresso-1.jpg\\\" style=\\\"height:536px; width:359px\\\" /></p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(262, 87, 1, 'Grenade Carb Killa Spread', '<p>Treat yourself to one of our delicious Carb Killa protein spreads, available in 4 irresistible flavours: Hazel Nutter, Milk Chocolate, White Chocolate Cookie and Chocolate Chip Salted Caramel. These delicious chocolate protein spreads are made with whey protein and are perfect smothered on top of your favourite foods like toasted bread, or even enjoyed eaten straight out the jar.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Nutritionals</h2>\r\n\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>Typical Values</th>\r\n			<th>Average Quantity per Serving 30g</th>\r\n			<th>Average Quantity per 100g</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Energy</td>\r\n			<td>&nbsp;660kJ (158Cal)</td>\r\n			<td>2200kJ (526Cal)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protein</td>\r\n			<td>&nbsp;5.9g</td>\r\n			<td>19.8g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>- Gluten&nbsp;</td>\r\n			<td>&nbsp;Not Detected</td>\r\n			<td>&nbsp;Not Detected</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fat, Total</td>\r\n			<td>11.9g</td>\r\n			<td>39.6g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>- Saturated&nbsp;</td>\r\n			<td>&nbsp;2.6g</td>\r\n			<td>8.5g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Carbohydrate&nbsp;</td>\r\n			<td>1.8g</td>\r\n			<td>6.1g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>- Sugars</td>\r\n			<td>1.6g</td>\r\n			<td>5.2g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Dietary Fibre</td>\r\n			<td>1.0g</td>\r\n			<td>3.2g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sodium</td>\r\n			<td>24mg</td>\r\n			<td>80mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Maltitol</td>\r\n			<td>8.1g</td>\r\n			<td>27.0g</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>All ingredients</p>\r\n\r\n<p>Vegetable Oil (Canola, Sustainable Palm), Sweetener (Maltitol) (27%), Whey Protein Concentrate (<strong>Milk</strong>) (19%), Skimmed&nbsp;<strong>Milk&nbsp;</strong>Powder, Fat-Reduced Cocoa (7%),&nbsp;<strong>Hazelnut&nbsp;</strong>Pieces (6%), Emulsifier (Sunflower Lecithin), Natural Vanilla Flavouring.</p>\r\n\r\n<p><strong>GRENADE&reg;&nbsp;CARB KILLA SPREAD</strong><strong>:&nbsp;</strong>should be consumed as part of a balanced diet. Product contains more than 10g/100g polyols: excessive consumption may cause laxative effects</p>\r\n\r\n<p><strong>ALLERGY ADVICE:&nbsp;</strong>For allergens see ingredients in<strong>&nbsp;bold</strong>. Manufactured in a facility that handles Wheat, Soy &amp; Nuts.</p>\r\n\r\n<p>Suitable for vegetarians</p>\r\n\r\n<p>&nbsp;</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
