(264, 88, 1, 'Maxsport Organic Protein Pasta', '<p>You will also fall in love with the very popular <strong>Organic&nbsp;Spaghetti and&nbsp;Fettuccine</strong>..&nbsp;<strong>&nbsp;</strong>This amazing clean label organic protein pasta combines the most modern functional benefits &ndash; they are&nbsp;<strong>organic</strong>,&nbsp;<strong>vegan</strong>,&nbsp;<strong>gluten-free</strong>,&nbsp;<strong>have a high protein and fibre content</strong>,&nbsp;<strong>low glycaemic index</strong>, contain no GMO, are quick to prepare and taste great. They will also serve people with dietary restrictions, such as a&nbsp;<strong>source of protein for vegans</strong>,&nbsp;<strong>a gluten-free option for people with celiac disease</strong>, or an alternative with a low glycaemic index for people on a reduction diet. Fit&nbsp;<strong>pasta</strong>&nbsp;for every occasion. The <strong>Organic&nbsp;Spaghetti and&nbsp;Fettuccine</strong>. available in two flavors.</p>\r\n\r\n<p><strong>Flavours:&nbsp;Organic Black Bean Spaghetti,&nbsp;Organic Adzuki Bean Spaghetti.</strong></p>\r\n\r\n<p><strong>Flavours:&nbsp;Organic Quinoa Fettuccine,&nbsp;Organic Green Soybean Fettuccine</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Ingredients</h3>\r\n\r\n<p><strong>&nbsp;Organic Black Bean Spaghetti</strong></p>\r\n\r\n<p>Ingredients: black beans*. *From organic agriculture. May contain&nbsp;soy.&nbsp;</p>\r\n\r\n<p><strong>Organic Adzuki Bean Spaghetti</strong></p>\r\n\r\n<p>Ingredients:&nbsp;soybeans&nbsp;90%*, red bean 10%*. *From organic agriculture. May contain soy.</p>\r\n\r\n<p><strong>Organic Green Soybean Fettuccine</strong></p>\r\n\r\n<p>Ingredients: green&nbsp;soybeans*. *from organic agriculture&nbsp;</p>\r\n\r\n<p><strong>&nbsp;Organic Quinoa Fettuccine</strong></p>\r\n\r\n<p>&nbsp;Ingredients:&nbsp;soybeans&nbsp;95%*, quinoa 5%. *From organic agriculture&nbsp;</p>', '', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(265, 88, 2, 'Maxsport Organic Protein Pasta', '<p>You will also fall in love with the very popular <strong>Organic&nbsp;Spaghetti and&nbsp;Fettuccine</strong>..&nbsp;<strong>&nbsp;</strong>This amazing clean label organic protein pasta combines the most modern functional benefits &ndash; they are&nbsp;<strong>organic</strong>,&nbsp;<strong>vegan</strong>,&nbsp;<strong>gluten-free</strong>,&nbsp;<strong>have a high protein and fibre content</strong>,&nbsp;<strong>low glycaemic index</strong>, contain no GMO, are quick to prepare and taste great. They will also serve people with dietary restrictions, such as a&nbsp;<strong>source of protein for vegans</strong>,&nbsp;<strong>a gluten-free option for people with celiac disease</strong>, or an alternative with a low glycaemic index for people on a reduction diet. Fit&nbsp;<strong>pasta</strong>&nbsp;for every occasion. The <strong>Organic&nbsp;Spaghetti and&nbsp;Fettuccine</strong>. available in two flavors.</p>\r\n\r\n<p><strong>Flavours:&nbsp;Organic Black Bean Spaghetti,&nbsp;Organic Adzuki Bean Spaghetti.</strong></p>\r\n\r\n<p><strong>Flavours:&nbsp;Organic Quinoa Fettuccine,&nbsp;Organic Green Soybean Fettuccine</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Ingredients</h3>\r\n\r\n<p><strong>&nbsp;Organic Black Bean Spaghetti</strong></p>\r\n\r\n<p>Ingredients: black beans*. *From organic agriculture. May contain&nbsp;soy.&nbsp;</p>\r\n\r\n<p><strong>Organic Adzuki Bean Spaghetti</strong></p>\r\n\r\n<p>Ingredients:&nbsp;soybeans&nbsp;90%*, red bean 10%*. *From organic agriculture. May contain soy.</p>\r\n\r\n<p><strong>Organic Green Soybean Fettuccine</strong></p>\r\n\r\n<p>Ingredients: green&nbsp;soybeans*. *from organic agriculture&nbsp;</p>\r\n\r\n<p><strong>&nbsp;Organic Quinoa Fettuccine</strong></p>\r\n\r\n<p>&nbsp;Ingredients:&nbsp;soybeans&nbsp;95%*, quinoa 5%. *From organic agriculture&nbsp;</p>', '', NULL, 0, '', NULL, NULL, '', NULL, NULL),
