(272, 92, 1, 'RedCorn1 MRE bar', '<h3>About this item</h3>\r\n\r\n<ul>\r\n	<li>THE MACROS - A snack or meal replacement that&rsquo;s healthy, limits your sugar intake, and doesn&rsquo;t bring it to excess. These macro counts are perfect to fuel your workout without a drastic insulin spike and perform at your best. Packing only 260 total calories per bar, it&rsquo;s the perfect snack size meal while on the go, or pre-workout, that&rsquo;s loaded with proper nutrition made from real food and won&rsquo;t make you feel overfull.</li>\r\n	<li>GREAT TEXTURE - Redcon1&#39;s MRE Bar easily breaks apart with an amazing food-like texture that&rsquo;s pleasant to chew. MRE Bar looks like real food, tastes like real food and chews like real food. Made from Real Food When eating a meal replacement, you should be eating real food.</li>\r\n	<li>MADE FROM REAL FOOD - Just like with the MRE Protein Powder formula, Redcon1&#39;s MRE Bar contains only whole-food sources which won&#39;t upset your stomach, cause cramping, or give you unwanted gas. Unlike the rest of the bars on the shelf, Redcon1&#39;s MRE Bar has ingredients like oats, salmon, chicken, eggs, brown rice and sweet potato. These ingredients give our meal replacement protein bar an amazing taste, unmatched flavor and the nutrition that gives you sustained energy throughout the day.</li>\r\n	<li>GREAT TASTE - Just like the shake, the MRE Bar is absolutely delicious in any flavor. There is no guess work when it comes to flavors &ndash; you know what you&rsquo;re eating as soon as it hits your tongue. Unlike other bars, MRE Bar is true to flavor name and what you read is what you get. MRE Bar is like having dessert for a snack, but with real whole food and the macros you need to fit your day.</li>\r\n	<li>ON-THE-GO MEAL - The perfect meal while on-the-go that&#39;s loaded with proper nutrition made from real food and won&#39;t make you feel overfull. Use MRE Bar as a meal replacement bar or when you&#39;re in need of a high-protein snack. We recommend eating an MRE Bar as a mid-day snack or for fuel before an intense training session.</li>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
