rotein snack. We recommend eating an MRE Bar as a mid-day snack or for fuel before an intense training session.</li>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(276, 94, 1, 'Applied Nutrition ZMA Pro', '<p>&nbsp;</p>\r\n\r\n<h1><strong>ZMA Pro</strong></h1>\r\n\r\n<h3>60 Capsules | 50g | 30 Servings</h3>\r\n\r\n<p>ZMA Pro is a unique combination of Zinc and Magnesium plus Vitamin B6 and has a number of benefits to the body and its functionality. Each of the three ingredients have been specifically chosen for their unique properties with added KSM-66 Ashwagandha and AstraGin.</p>\r\n\r\n<p>KEY BENEFITS:<br />\r\nZinc contributes to the maintenance of normal Testosterone levels in the blood<br />\r\nMagnesium supports normal functioning of the nervous system and muscle function<br />\r\nVitamin B6 contributes to a reduction in tiredness and fatigue<br />\r\nHalal Certified &amp; Vegan Friendly</p>\r\n\r\n<p><strong>Supplement Facts:</strong><br />\r\nServing Size: 2 Capsules</p>\r\n\r\n<p>Amount Per Serving:<br />\r\nVitamin B6 10.5mg 750%<br />\r\nMagnesium 450mg 120%<br />\r\nZinc 30mg 300%<br />\r\nAstraGin 45mg<br />\r\nKSM-66 Ashwagandha 200mg</p>\r\n\r\n<p><strong>ZMA Pro Other Ingredients:</strong><br />\r\nVegetable Capsule Shell: Hydroxypropylmethyl Cellulose, Vegetable Magnesium Stearate, Silicon Dioxide.</p>\r\n\r\n<p><strong>ZMA Pro Recommended Use:</strong><br />\r\nConsume 2 capsules before bed preferably with food.</p>\r\n\r\n<p><strong>Warnings:</strong><br />\r\nCheck with a qualified health professional before using this product if you are under the age of 18, pregnant or nursing a baby or if you have any known or suspected medical condition(s) and or are taking any prescription or OTC medication(s). Not to be used as a substitute for a varied diet and healthy lifestyle. Store this product in a cool dry place, away from children. Do not exceed suggested use.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(277, 94, 2, 'Applied Nutrition ZMA Pro', '<p>ZMA Pro is a unique combination of Zinc and Magnesium plus Vitamin B6 and has a number of benefits to the body and its functionality. Each of the three ingredients have been specifically chosen for their unique properties with added KSM-66 Ashwagandha and AstraGin.</p>\r\n\r\n<p>KEY BENEFITS:<br />\r\nZinc contributes to the maintenance of normal Testosterone levels in the blood<br />\r\nMagnesium supports normal functioning of the nervous system and muscle function<br />\r\nVitamin B6 contributes to a reduction in tiredness and fatigue<br />\r\nHalal Certified &amp; Vegan Friendly</p>\r\n\r\n<p><strong>Supplement Facts:</strong><br />\r\nServing Size: 2 Capsules<br />\r\nServings Per Container: 30</p>\r\n\r\n<p>Amount Per Serving:<br />\r\nVitamin B6 10.5mg 750%<br />\r\nMagnesium 450mg 120%<br />\r\nZinc 30mg 300%<br />\r\nAstraGin 45mg<br />\r\nKSM-66 Ashwagandha 200mg</p>\r\n\r\n<p><strong>ZMA Pro Other Ingredients:</strong><br />\r\nVegetable Capsule Shell: Hydroxypropylmethyl Cellulose, Vegetable Magnesium Stearate, Silicon Dioxide.</p>\r\n\r\n<p><strong>ZMA Pro Recommended Use:</strong><br />\r\nConsume 2 capsules before bed preferably with food.</p>\r\n\r\n<p><strong>Warnings:</strong><br />\r\nCheck with a qualified health professional before using this product if you are under the age of 18, pregnant or nursing a baby or if you have any known or suspected medical condition(s) and or are taking any prescription or OTC medication(s). Not to be used as a substitute for a varied diet and healthy lifestyle. Store this product in a cool dry place, away from children. Do not exceed suggested use.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(278, 95, 1, 'Applied Nutrition I Drive Capsule', '<h2>I-Drive Capsules</h2>\r\n\r\n<h3>120 Capsules | 145g | 60 Servings</h3>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Glucose Disposal Agent&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Support Protein Synthesis</p>\r\n	</li>\r\n	<li>\r\n	<p>Drives carbohydrates, amino acids, creatine &amp; other Nutrients for normal metabolism&nbsp;</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>i-DRIVE&nbsp;is a glucose disposal agent, designed to support nutrient partitioning, supporting optimal glucose control and metabolism. &nbsp;Developed to support protein synthesis, inhibit protein breakdown and aid in driving vital nutrients into the muscle tissue for optimal glycogen loading, improved muscle fullness and muscle pump.</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>Support Intra-Muscular Carbohydrate, Amino Acid, Creatine &amp; Other Anabolic Nutrients Uptake</li>\r\n	<li>Suitable for vegetarians &amp; vegans</li>\r\n	<li>Plant based veggie shell well suited for consumers with dietary, religious or<br />\r\n	cultural restrictions</li>\r\n	<li>Halal certified product</li>\r\n</ul>\r\n\r\n<h3><br />\r\nSUGGESTED USE</h3>\r\n\r\n<p>For best results take 1 serving, 20 minutes prior to any carbohydrate dense meal or workouts if using a high-carbohydrate intra-workout or recovery-based product.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(279, 95, 2, 'Applied Nutrition I Drive Capsule', '<h2>I-Drive Capsules</h2>\r\n\r\n<h3>120 Capsules | 120g | 60 Servings</h3>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Glucose Disposal Agent&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>Support Protein Synthesis</p>\r\n	</li>\r\n	<li>\r\n	<p>Drives carbohydrates, amino acids, creatine &amp; other Nutrients for normal metabolism&nbsp;</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>i-DRIVE&nbsp;is a glucose disposal agent, designed to support nutrient partitioning, supporting optimal glucose control and metabolism. &nbsp;Developed to support protein synthesis, inhibit protein breakdown and aid in driving vital nutrients into the muscle tissue for optimal glycogen loading, improved muscle fullness and muscle pump.</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>Support Intra-Muscular Carbohydrate, Amino Acid, Creatine &amp; Other Anabolic Nutrients Uptake</li>\r\n	<li>Suitable for vegetarians &amp; vegans</li>\r\n	<li>Plant based veggie shell well suited for consumers with dietary, religious or<br />\r\n	cultural restrictions</li>\r\n	<li>Halal certified product</li>\r\n</ul>\r\n\r\n<h3><br />\r\nSUGGESTED USE</h3>\r\n\r\n<p>For best results take 1 serving, 20 minutes prior to any carbohydrate dense meal or workouts if using a high-carbohydrate intra-workout or recovery-based product.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(280, 96, 1, 'Applied Nutrition ISOXP 1 kg', '<h1>ISO-XP - Funky Flavour</h1>\r\n\r\n<h2>100% WHEY PROTEIN ISOLATE</h2>\r\n\r\n<h2>0G SUGAR | 0G CARBS | 0G FAT | SOY-FREE | GLUTEN FREE</h2>\r\n\r\n<h2>1KG | 40 SERVINGS</h2>\r\n\r\n<h3>Food Supplement with Sweetener</h3>\r\n\r\n<p>ISO-XP is a high protein supplement with sweetener and by far the cleanest and highest quality Whey Protein Isolate available, with only 0.1g Lactose and 22.5g protein per 25g serving. ISO-XP has NO SOY added and instead uses Sunflower Lecithin as the Emulsifier.<br />\r\n<br />\r\nISO-XP is ideal for anyone looking to increase daily protein intake without any additional fats, carbohydrates, or sugars. ISO-XP should be mixed with water or skimmed milk for easy mixing and great taste.<br />\r\n&nbsp;</p>\r\n\r\n<h2>TASTES EVEN YUMMIER WITH MILK!</h2>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>22.5g Protein (per 25g serving)</li>\r\n	<li>0.1g Lactose (per 25g serving)</li>\r\n	<li>0g Sugar (per 25g serving)</li>\r\n	<li>0g Carbs (per 25g serving)</li>\r\n	<li>0g Fat (per 25g serving)</li>\r\n	<li>Soy &amp; Gluten Free</li>\r\n	<li>Easy Mixing</li>\r\n	<li>Whey Produced from Grass-Fed Cows</li>\r\n	<li>Halal Certified Product</li>\r\n</ul>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>SUGGESTED USE</h3>\r\n\r\n<p><strong>Mix 1 scoop (approximately 25g) with 200ml of water or skimmed milk.<br />\r\nUse 1-3 servings daily, depending on your protein requirements.<br />\r\nISO-XP is rapidly absorbed, so the optimal times to use it are when you need protein fast. This includes immediately upon waking before breakfast, and immediately after exercise. After training, many athletes take a double serving (50g) as the body is able to process a larger amount of protein in its depleted state.</strong></p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
