(283, 97, 2, 'Applied Nutrition ISO XP 2Kg', '<h2>100% WHEY PROTEIN ISOLATE</h2>\r\n\r\n<h2>0G SUGAR | 0G CARBS | 0G FAT | SOY-FREE | GLUTEN FREE</h2>\r\n\r\n<h2>2KG | 80SERVINGS</h2>\r\n\r\n<h3>Food Supplement with Sweetener</h3>\r\n\r\n<p>ISO-XP is a high protein supplement with sweetener and by far the cleanest and highest quality Whey Protein Isolate available, with only 0.1g Lactose and 22.5g protein per 25g serving. ISO-XP has NO SOY added and instead uses Sunflower Lecithin as the Emulsifier.<br />\r\n<br />\r\nISO-XP is ideal for anyone looking to increase daily protein intake without any additional fats, carbohydrates, or sugars. ISO-XP should be mixed with water or skimmed milk for easy mixing and great taste.<br />\r\n&nbsp;</p>\r\n\r\n<h2>TASTES EVEN YUMMIER WITH MILK!</h2>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>22.5g Protein (per 25g serving)</li>\r\n	<li>0.1g Lactose (per 25g serving)</li>\r\n	<li>0g Sugar (per 25g serving)</li>\r\n	<li>0g Carbs (per 25g serving)</li>\r\n	<li>0g Fat (per 25g serving)</li>\r\n	<li>Soy &amp; Gluten Free</li>\r\n	<li>Easy Mixing</li>\r\n	<li>Whey Produced from Grass-Fed Cows</li>\r\n	<li>Halal Certified Product</li>\r\n</ul>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>SUGGESTED USE</h3>\r\n\r\n<p><strong>Mix 1 scoop (approximately 25g) with 200ml of water or skimmed milk.<br />\r\nUse 1-3 servings daily, depending on your protein requirements.<br />\r\nISO-XP is rapidly absorbed, so the optimal times to use it are when you need protein fast. This includes immediately upon waking before breakfast, and immediately after exercise. After training, many athletes take a double serving (50g) as the body is able to process a larger amount of protein in its depleted state.</strong></p>', '', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(284, 98, 1, 'Applied Nutrition Digestive Enzyme', '<h3>Digestive Enzyme Capsules</h3>\r\n\r\n<p><strong>60 Capsules&nbsp;| 29G | 60 Servings</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>LACTASE &ndash; Used to break down lactose<br />\r\n<br />\r\nPROTEASE &ndash; Aids the digestion of protein<br />\r\n<br />\r\nAMYLASE &ndash; Aids the digestion of carbohydrates<br />\r\n<br />\r\nZyMate&reg; Max &ndash; Multi Enzyme Complex</p>\r\n\r\n<p>ZyMate&reg; Max is a multi-enzyme blend of alpha amylase, glucoamylase, lactase, neutral protease, acidic protease, lipase, cellulase, bromelain, papain and alpha-galactosidase to aid the digestion of carbohydrates, lactose, proteins, fats and cellulose and to help control flatulence.</p>\r\n\r\n<h3><br />\r\nBENEFITS</h3>\r\n\r\n<ul>\r\n	<li>Expertly formulated blend of naturally occurring digestive enzymes</li>\r\n	<li>Including amylase, bromelain, lactase, lipase and protease</li>\r\n	<li>Aids digestion of carbohydrates, lactose, proteins and fats</li>\r\n	<li>Vegan &amp; vegetarian friendly</li>\r\n	<li>Halal certified product</li>\r\n</ul>\r\n\r\n<h3>&nbsp;</h3>', '<h3>SUGGESTED USE</h3>\r\n\r\n<p>Take 1-2 servings daily with water.<br />\r\n&nbsp;</p>\r\n\r\n<h3>NUTRITIONAL INFORMATION</h3>\r\n\r\n<p><img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/Digestive-Enzymes-60-Capsules---Nutritionals---1000x1000_600x600.jpg?v=1638438167\\\" /></p>\r\n\r\n<h3><br />\r\nINGREDIENTS</h3>\r\n\r\n<p>(Zymate Max Multi-Enzyme Complex) Maltodextrin Powder, Alpha Amylase (Origin: Aspergillus Oryzae), Protease (4.5) (Origin: Bacillus Licheniformis, Protease (3.0) (Origin: Aspergillus Oryzae), Lipase (Origin: Aspergillus Oryzae), Glucoamylase (Origin: Aspergillus Niger), Papain (Origin: Latex of Carica Papaya L), Bromelain (Origin: Stem of Ananas Comosus L.), Lactase (Origin: Aspergillus Oryzae), Cellulase (Origin: Trichoderma Reesei), Alpha Galactosidase (Origin: Aspergillus Niger), Capsule Shell (HPMC), Bulking Agent: Microcrystalline Cellulose, Magnesium Stearate, Silicon Dioxide.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>TESTED FOR ATHLETES</h3>\r\n\r\n<p>Every ingredient within this batch undergoes rigorous scrutiny and testing for banned substances prior to production under a monitored programme. Final products are then produced and packaged at an ISO 22000, BRC, GMP &amp; Halal accredited lab to provide the highest level of assurance for athletes to use.</p>\r\n\r\n<h3>CAUTION</h3>\r\n\r\n<p>Check with a qualified health professional before using this product if you are under the age of 18, pregnant or nursing a baby, or if you have any known or suspected medical condition(s) and or are taking any prescription or OTC medication(s). Not to be used as a substitute for a varied diet and healthy lifestyle. Store this product in a cool dry place, away from children. Do not exceed the suggested use.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(285, 98, 2, 'Applied Nutrition Digestive Enzyme', '<h1>Digestive Enzyme Capsules</h1>\r\n\r\n<h2>60 CAPSULES | 29G | 60 SERVINGS</h2>\r\n\r\n<h3>LACTASE &ndash; Used to break down lactose<br />\r\n<br />\r\nPROTEASE &ndash; Aids the digestion of protein<br />\r\n<br />\r\nAMYLASE &ndash; Aids the digestion of carbohydrates<br />\r\n<br />\r\nZyMate&reg; Max &ndash; Multi Enzyme Complex</h3>\r\n\r\n<p>ZyMate&reg; Max is a multi-enzyme blend of alpha amylase, glucoamylase, lactase, neutral protease, acidic protease, lipase, cellulase, bromelain, papain and alpha-galactosidase to aid the digestion of carbohydrates, lactose, proteins, fats and cellulose and to help control flatulence.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>Expertly formulated blend of naturally occurring digestive enzymes</li>\r\n	<li>Including amylase, bromelain, lactase, lipase and protease</li>\r\n	<li>Aids digestion of carbohydrates, lactose, proteins and fats</li>\r\n	<li>Vegan &amp; vegetarian friendly</li>\r\n	<li>Halal certified product</li>\r\n</ul>\r\n\r\n<h3>&nbsp;</h3>', '<h3>SUGGESTED USE</h3>\r\n\r\n<p>Take 1-2 servings daily with water.<br />\r\n&nbsp;</p>\r\n\r\n<h3>NUTRITIONAL INFORMATION</h3>\r\n\r\n<p><img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/Digestive-Enzymes-60-Capsules---Nutritionals---1000x1000_600x600.jpg?v=1638438167\\\" /></p>\r\n\r\n<h3><br />\r\nINGREDIENTS</h3>\r\n\r\n<p>(Zymate Max Multi-Enzyme Complex) Maltodextrin Powder, Alpha Amylase (Origin: Aspergillus Oryzae), Protease (4.5) (Origin: Bacillus Licheniformis, Protease (3.0) (Origin: Aspergillus Oryzae), Lipase (Origin: Aspergillus Oryzae), Glucoamylase (Origin: Aspergillus Niger), Papain (Origin: Latex of Carica Papaya L), Bromelain (Origin: Stem of Ananas Comosus L.), Lactase (Origin: Aspergillus Oryzae), Cellulase (Origin: Trichoderma Reesei), Alpha Galactosidase (Origin: Aspergillus Niger), Capsule Shell (HPMC), Bulking Agent: Microcrystalline Cellulose, Magnesium Stearate, Silicon Dioxide.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>TESTED FOR ATHLETES</h3>\r\n\r\n<p>Every ingredient within this batch undergoes rigorous scrutiny and testing for banned substances prior to production under a monitored programme. Final products are then produced and packaged at an ISO 22000, BRC, GMP &amp; Halal accredited lab to provide the highest level of assurance for athletes to use.</p>\r\n\r\n<h3>CAUTION</h3>\r\n\r\n<p>Check with a qualified health professional before using this product if you are under the age of 18, pregnant or nursing a baby, or if you have any known or suspected medical condition(s) and or are taking any prescription or OTC medication(s). Not to be used as a substitute for a varied diet and healthy lifestyle. Store this product in a cool dry place, away from children. Do not exceed the suggested use.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(286, 99, 1, 'Applied Nutrition Probiotic - Advanced Multi-strain Formula', '<h2><strong>Probiotic - Advanced Multi-strain Formula</strong></h2>\r\n\r\n<p><strong>60&nbsp;Capsules | 57G | 30 Servings&nbsp;&nbsp;</strong></p>\r\n\r\n<p>Our Probiotic Advanced Multi-Strain Formula contains 10 Billion CFU per serving, helping to promote optimal gut health, protect your immune system and help your body maintain a healthy balance.</p>\r\n\r\n<h3><br />\r\n&nbsp;BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>Each serving contains 10 Billion CFU (Colony-Forming Units)</li>\r\n	<li>Friendly live bacteria to support healthy digestion</li>\r\n	<li>Supports gastrointestinal health</li>\r\n	<li>Boosts immune health</li>\r\n	<li>Promotes healthy weight management</li>\r\n	<li>100% Vegan Halal certified product</li>\r\n</ul>\r\n\r\n<h3>&nbsp;</h3>', '<h3>SUGGESTED USE</h3>\r\n\r\n<p>Take 2&nbsp;capsules daily.<br />\r\n&nbsp;</p>\r\n\r\n<h3>TESTED FOR ATHLETES</h3>\r\n\r\n<p>Every batch of this product is tested for banned substances under a monitored programme. Products undergo rigorous testing at an ISO 17025 accredited lab to provide the highest level of assurance that they are safer for athletes to use.</p>\r\n\r\n<h3><br />\r\nGMP</h3>\r\n\r\n<p>This product was manufactured in a GMP facility under strict quality control to assure consistent high quality that meets the requirements of the marketing authorization (MA) or product specification.</p>\r\n\r\n<h3><br />\r\nCAUTION</h3>\r\n\r\n<p>Check with a qualified health professional before using this product if you are under the age of 18, pregnant or nursing a baby or if you have any known or suspected medical condition(s) and or are taking any prescription or OTC medication(s). Not to be used as a substitute for a varied diet and healthy lifestyle. Store this product in a cool dry place, away from children. Do not exceed suggested use.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>NUTRITIONAL INFORMATION</h3>\r\n\r\n<p><img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/products/Probiotic-60-Capsules---Nutritionals---1000x1000_600x600.jpg?v=1638438498\\\" /></p>\r\n\r\n<h3><br />\r\nINGREDIENTS</h3>\r\n\r\n<p>Bacterial Strains (Saccharomyces Boulardii, Lactobacillus Acidophilus, Bifidobacterium Longum, Bifidobacterium Infantis, Lactobacillus Casei, Lactobacillus Rhamnosus, Streptococcus Thermophilus, Lactobacillus Plantarum, Bifidobacterium Breve, Bifidobacterium Bifidum), Fructo-oligosaccharides, Rice Flour (Bulking Agent), HPMC (Vegetarian Capsule Shell), Silica, Magnesium Stearate (Anti-Caking Agent).</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0);
