(288, 100, 1, 'Applied Nutrition Diet Whey', '<h1>Applied Nutrition Diet Whey 2 KG</h1>\r\n\r\n<h2>LEAN ISO WHEY BLEND</h2>\r\n\r\n<h2>CLA | L-CARNITINE | GREEN TEA EXTRACT | ISO-XP PROTEIN</h2>\r\n\r\n<p>Diet Whey is by far the most advanced weight management supplement available, combining all of the main ingredients which are currently known to contribute towards weight management including CLA, L-Carnitine, Green Tea, Whey Protein Isolate &amp; Whey Protein Concentrate resulting in an extremely low carb high protein blend.<br />\r\n<br />\r\nWhilst focusing primarily on combing all of the vital nutrients &amp; ingredients, we have managed to create an amazing tasting supplement suitable for anyone seeking a more simplistic approach to the weight management process.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>CLA Powder &amp; L-Carnitine</li>\r\n	<li>Green Tea Extract</li>\r\n	<li>Weight Management Support</li>\r\n	<li>Low Carbs &amp; Sugars</li>\r\n	<li>Halal Certified Product</li>\r\n</ul>\r\n\r\n<h3><br />\r\nSUGGESTED USE</h3>\r\n\r\n<p>Mix 1 sachet (25g) of protein powder with 150-300ml of cold water and shake well. Have 3 servings of Diet Whey daily (morning, afternoon &amp; evening).<br />\r\n&nbsp;</p>\r\n\r\n<h3>TESTED FOR ATHLETES</h3>\r\n\r\n<p>Every ingredient within this batch undergoes rigorous scrutiny and testing for banned substances prior to production under a monitored programme. Final products are then produced and packaged at an ISO 22000, BRC, GMP &amp; Halal accredited lab to provide the highest level of assurance that they are safe for athletes to use.</p>\r\n\r\n<h3><br />\r\nCAUTION</h3>\r\n\r\n<p>Check with a qualified health professional before using this product if you are under the age of 18, pregnant or nursing a baby, or if you have any known or suspected medical condition(s) and or are taking any prescription or OTC medication(s). Not to be used as a substitute for a varied diet and healthy lifestyle. Store this product in a cool dry place, away from children. Do not exceed the suggested use.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(289, 100, 2, 'Applied Nutrition Diet Whey', '<h1>Applied Nutrition Diet Whey 2 KG</h1>\r\n\r\n<h2>LEAN ISO WHEY BLEND</h2>\r\n\r\n<h2>CLA | L-CARNITINE | GREEN TEA EXTRACT | ISO-XP PROTEIN</h2>\r\n\r\n<p>Diet Whey is by far the most advanced weight management supplement available, combining all of the main ingredients which are currently known to contribute towards weight management including CLA, L-Carnitine, Green Tea, Whey Protein Isolate &amp; Whey Protein Concentrate resulting in an extremely low carb high protein blend.<br />\r\n<br />\r\nWhilst focusing primarily on combing all of the vital nutrients &amp; ingredients, we have managed to create an amazing tasting supplement suitable for anyone seeking a more simplistic approach to the weight management process.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>CLA Powder &amp; L-Carnitine</li>\r\n	<li>Green Tea Extract</li>\r\n	<li>Weight Management Support</li>\r\n	<li>Low Carbs &amp; Sugars</li>\r\n	<li>Halal Certified Product</li>\r\n</ul>\r\n\r\n<h3><br />\r\nSUGGESTED USE</h3>\r\n\r\n<p>Mix 1 sachet (25g) of protein powder with 150-300ml of cold water and shake well. Have 3 servings of Diet Whey daily (morning, afternoon &amp; evening).<br />\r\n&nbsp;</p>\r\n\r\n<h3>TESTED FOR ATHLETES</h3>\r\n\r\n<p>Every ingredient within this batch undergoes rigorous scrutiny and testing for banned substances prior to production under a monitored programme. Final products are then produced and packaged at an ISO 22000, BRC, GMP &amp; Halal accredited lab to provide the highest level of assurance that they are safe for athletes to use.</p>\r\n\r\n<h3><br />\r\nCAUTION</h3>\r\n\r\n<p>Check with a qualified health professional before using this product if you are under the age of 18, pregnant or nursing a baby, or if you have any known or suspected medical condition(s) and or are taking any prescription or OTC medication(s). Not to be used as a substitute for a varied diet and healthy lifestyle. Store this product in a cool dry place, away from children. Do not exceed the suggested use.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(290, 101, 1, 'Applied Nutrition Critical Whey', '<h1>Critical Whey</h1>\r\n\r\n<h3>Whey Protein Concentrate &bull; Whey ISO-XP &bull; Hydrolysed Whey</h3>\r\n\r\n<p>Critical Whey Protein has been developed using a unique blend of Whey Protein Concentrate, Whey Protein Isolate &amp; Hydrolysed Whey Protein. Whey Protein Concentrate is produced by Ultra-Filtration Technology containing high levels of Protein and Branched Chain Amino Acids (BCAAs). Whey Protein Isolate is the highest quality of Protein and is produced using Cross-Flow-Micro-Filtration. Hydrolysed Whey Protein is a pre-digested protein enzymatically broken down into Peptides. These high biological value and easily digested proteins support the growth and maintenance of muscle.<br />\r\n<br />\r\nCritical Whey Protein provides 21g of Protein derived from Grass-Fed Cows, 4.8g of naturally occurring BCAAs &amp; 4g of Glutamine per serving. Critical Whey Protein is Gluten Free, Halal Certified, low in sugar, and makes a great tasting shake &ndash; just add to water or low-fat milk.<br />\r\n&nbsp;</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>Build &amp; Maintain Muscle</li>\r\n	<li>Delicious Taste &amp; Mixes Instantly</li>\r\n	<li>Gluten-Free</li>\r\n	<li>High Levels of Protein &amp; BCAAs</li>\r\n	<li>Batch Tested for Athletes by Informed-Sport</li>\r\n	<li>Halal Certified Product</li>\r\n</ul>\r\n\r\n<h3>&nbsp;</h3>', '<h3>SUGGESTED USE</h3>\r\n\r\n<p>Mix 2 Scoops (30g) of protein powder with 250-500ml of water or milk and shake well. Consume immediately after training or throughout the day on non-training days.<br />\r\n<em>*Scoops are estimated only, weighing scales are recommended.</em><br />\r\n&nbsp;</p>\r\n\r\n<h3><br />\r\nINFORMED SPORT - PROFESSIONAL</h3>\r\n\r\n<p>Every batch of this product is tested for banned substances under the Informed-Sport programme. Products undergo rigorous testing at an ISO 17025 accredited lab to provide the highest level of assurance that they are safer for athletes to use.</p>\r\n\r\n<h3><br />\r\n<br />\r\nCAUTION</h3>\r\n\r\n<p>Check with a qualified health professional before using this product if you are under the age of 18, pregnant or nursing a baby, or if you have any known or suspected medical condition(s) and or are taking any prescription or OTC medication(s). Not to be used as a substitute for a varied diet and healthy lifestyle. Store this product in a cool dry place, away from children. Do not exceed the suggested use.&nbsp;For allergens see ingredients in&nbsp;<strong>Bold.</strong>&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<h3><br />\r\nNUTRITIONAL INFORMATION</h3>\r\n\r\n<p><img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/New---Critical-Whey-2.27kg---Nutritionals-_Vanilla-Ice-Cream_-1---1000x1000_480x480.jpg?v=1631626790\\\" /><br />\r\n<br />\r\n<img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/New---Critical-Whey-2.27kg---Nutritionals-_Vanilla-Ice-Cream_-2---1000x1000_480x480.jpg?v=1631626808\\\" /><br />\r\n<em>*Nutritional information for Vanilla, other flavours may vary</em><br />\r\n&nbsp;</p>\r\n\r\n<h3><br />\r\nINGREDIENTS</h3>\r\n\r\n<p><strong>Strawberry Milkshake</strong><br />\r\nWhey Protein Concentrate (<strong>Soy</strong>&nbsp;Lecithin,&nbsp;<strong>Milk</strong>&nbsp;(<strong>Lactose</strong>)), ISO-XP Whey Protein Isolate (<strong>Milk</strong>), Hydrolysed Whey Protein (<strong>Milk</strong>) (81%), Emulsifier (<strong>Soy</strong>&nbsp;Lecithin), Flavour, Natural Colouring Agent (Beetroot Powder), Sweetener (Sucralose).<br />\r\n<br />\r\n<strong>Chocolate Milkshake</strong><br />\r\nWhey Protein Concentrate (<strong>Soy</strong>&nbsp;Lecithin,&nbsp;<strong>Milk</strong>&nbsp;(<strong>Lactose</strong>)), ISO-XP Whey Protein Isolate (<strong>Milk</strong>), Hydrolysed Whey Protein (<strong>Milk</strong>) (81%), Emulsifier (<strong>Soy</strong>&nbsp;Lecithin), Cocoa Powder, Flavour, Sweetener (Sucralose).<br />\r\n<br />\r\n<strong>Vanilla Ice Cream</strong><br />\r\nWhey Protein Concentrate (<strong>Soy</strong>&nbsp;Lecithin,&nbsp;<strong>Milk</strong>&nbsp;(<strong>Lactose</strong>)), ISO-XP Whey Protein Isolate (<strong>Milk</strong>), Hydrolysed Whey Protein (<strong>Milk</strong>) (81%), Emulsifier (<strong>Soy</strong>&nbsp;Lecithin), Flavour, Sweetener (Sucralose).<br />\r\n<br />\r\n<strong>Banana Milkshake</strong><br />\r\nWhey Protein Concentrate (<strong>Soy</strong>&nbsp;Lecithin,&nbsp;<strong>Milk</strong>&nbsp;(<strong>Lactose</strong>)), ISO-XP Whey Protein Isolate (<strong>Milk</strong>), Hydrolysed Whey Protein (<strong>Milk</strong>) (81%), Emulsifier (<strong>Soy</strong>&nbsp;Lecithin), Flavour, Natural Colouring Agent (Curcumin), Sweetener (Sucralose).<br />\r\n<br />\r\n<strong>Lemon Cheesecake</strong><br />\r\nWhey Protein Concentrate (<strong>Soy</strong>&nbsp;Lecithin,&nbsp;<strong>Milk</strong>&nbsp;(<strong>Lactose</strong>)), ISO-XP Whey Protein Isolate (<strong>Milk</strong>), Hydrolysed Whey Protein (<strong>Milk</strong>) (81%), Emulsifier (<strong>Soy</strong>&nbsp;Lecithin), Flavour, Sweetener (Sucralose).<br />\r\n<br />\r\n<strong>White Chocolate Raspberry</strong><br />\r\nWhey Protein Concentrate (<strong>Soy</strong>&nbsp;Lecithin,&nbsp;<strong>Milk</strong>&nbsp;(<strong>Lactose</strong>)), ISO-XP Whey Protein Isolate (<strong>Milk</strong>), Hydrolysed Whey Protein (<strong>Milk</strong>) (81%), Emulsifier (<strong>Soy</strong>&nbsp;Lecithin), Flavour, Natural Colouring Agent (Beetroot Powder), Sweetener (Sucralose).<br />\r\n<br />\r\n<strong>ALLERGENS</strong>&nbsp;see ingredients in&nbsp;<strong>BOLD</strong></p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
