(292, 102, 1, 'Nuzest Clean Lean Protein', '<p>100% natural, allergen-free, Premium European Golden Pea Protein for energy, recovery, repair and weight management..</p>\r\n\r\n<p>20g Protein&nbsp;<strong>|&nbsp;</strong>1g Carbs&nbsp;&nbsp;<strong>|&nbsp;&nbsp;</strong>0g Sugar&nbsp;&nbsp;<strong>|&nbsp;</strong>100% Plant- Based</p>\r\n\r\n<p>Clean Lean Protein is not just any protein; it comes from the highest quality European Golden Peas and is the most potent of all vegetable proteins. In fact, it&#39;s perfect for:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>19-21 grams of protein per 25 gram serving (79%-84% protein depending on flavour)</li>\r\n	<li>Very Low Fat and Carbs. Less than 1/2 gram of fat, only 2 grams or less of carbs</li>\r\n	<li>Vegan, Dairy Free, Soy Free, GMO Free &amp; Gluten Free</li>\r\n	<li>No added sugar (less than 1/4 gram naturally occurring)&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '<p>Most importantly, it contains ALL your essential amino acids and is really easy to digest - meaning no more bloating and no more discomfort.</p>\r\n\r\n<p>The allergen-free and 100% natural vegetable protein that&rsquo;s great for every-body. High in protein yet low in carbohydrates and fat, it supports healthy weight management and helps your body recover faster, so you can get back to doing the things you love.</p>\r\n\r\n<p>100% vegan, raw and suitable for a paleo diet, Clean Lean Protein is perfect for everyone from children to seniors and busy parents to professional athletes.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(293, 102, 2, 'Nuzest Clean Lean Protein', '<p>100% natural, allergen-free, Premium European Golden Pea Protein for energy, recovery, repair and weight management..</p>\r\n\r\n<p>20g Protein&nbsp;<strong>|&nbsp;</strong>1g Carbs<strong>&nbsp;&nbsp;|&nbsp;</strong>&nbsp;0g Sugar&nbsp;&nbsp;<strong>|&nbsp;</strong>100% Plant- Based</p>\r\n\r\n<p>Clean Lean Protein is not just any protein; it comes from the highest quality European Golden Peas and is the most potent of all vegetable proteins. In fact, it&#39;s perfect for:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>19-21 grams of protein per 25 gram serving (79%-84% protein depending on flavour)</li>\r\n	<li>Very Low Fat and Carbs. Less than 1/2 gram of fat, only 2 grams or less of carbs</li>\r\n	<li>Vegan, Dairy Free, Soy Free, GMO Free &amp; Gluten Free</li>\r\n	<li>No added sugar (less than 1/4 gram naturally occurring)&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '<p>Most importantly, it contains ALL your essential amino acids and is really easy to digest - meaning no more bloating and no more discomfort.</p>\r\n\r\n<p>The allergen-free and 100% natural vegetable protein that&rsquo;s great for every-body. High in protein yet low in carbohydrates and fat, it supports healthy weight management and helps your body recover faster, so you can get back to doing the things you love.</p>\r\n\r\n<p>100% vegan, raw and suitable for a paleo diet, Clean Lean Protein is perfect for everyone from children to seniors and busy parents to professional athletes.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(294, 103, 1, 'Nuzest Clean Lean Plant- Based Protein Bar', '<p>Deliciously handy plant-based protein bars, perfect for pre- and post-workouts, mid-day fuel or an on-the-go snack. Made by blending our premium European golden pea protein with whole fruits, nuts, and seeds, our Clean Lean Protein Bars are high in protein and fiber, and are a good source of iron. Available in three flavors - Coconut &amp; Lemon, Almond &amp; Vanilla, and Peanut Butter &amp; Chocolate. Each bar contains all nine essential amino acids to support recovery and repair. Unwrap your way to cleaner protein!</p>\r\n\r\n<ul>\r\n	<li>Vegan</li>\r\n	<li>Gluten free</li>\r\n	<li>Low carb</li>\r\n	<li>Naturally sweetened</li>\r\n	<li>Good source of Iron</li>\r\n	<li>Good source of Fibre</li>\r\n	<li>Contains all 9 essential amino acids</li>\r\n</ul>\r\n\r\n<p><strong>Nuzest&rsquo;s Clean Lean Protein Bars</strong>&nbsp;come in a range of three flavors:</p>\r\n\r\n<ul>\r\n	<li>Lemon &amp; Coconut</li>\r\n	<li>Peanut Butter &amp; Chocolate</li>\r\n	<li>Vanilla &amp; Almond</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
