(296, 104, 1, 'Rabeko Zero Cooking Spray', '<p>Rabeko Zero Cooking Sprays are low in calories and guaranteed sugar-free. They are recommended for all your cooking and pasta dishes, or for seasoning your salads.</p>\r\n\r\n<p>Benefits:</p>\r\n\r\n<ul>\r\n	<li>Low-calorie cooking sprays (4,9 Kcal/serving of 0,6 ml)</li>\r\n	<li>Sugar free</li>\r\n	<li>Available in 4 incredible flavours.</li>\r\n	<br />\r\n	<li>&nbsp;</li>\r\n</ul>\r\n\r\n<h2>How To Use It?</h2>\r\n\r\n<p>Shake lightly before use. Spray for 1/2 second at a distance of 20cm on your food or cooking surface.</p>\r\n\r\n<h2>Product Composition</h2>\r\n\r\n<p>Refined rapeseed oil (97%), stabilizer: rapeseed lecithin E322 (3%), flavour (0,2%)</p>', '<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>Nutritional value per 100 ml</td>\r\n			<td>Nutritional value per serving of 0,6 ml</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;Energy value</td>\r\n			<td>3330 Kj /810 Kcal</td>\r\n			<td>20 Kj / 4,9 Kcal</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fat</td>\r\n			<td>90 g</td>\r\n			<td>0,54 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Saturated fats</td>\r\n			<td>7,2 g</td>\r\n			<td>0,04 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Carbohydrate</td>\r\n			<td>0&nbsp;g</td>\r\n			<td>0&nbsp;g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sugars</td>\r\n			<td>0 g</td>\r\n			<td>0 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;Proteins</td>\r\n			<td>0&nbsp;g</td>\r\n			<td>0&nbsp;g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;Salt</td>\r\n			<td>0 g</td>\r\n			<td>0 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Flavour</td>\r\n			<td>Butter&nbsp;,&nbsp;Garlic&nbsp;,&nbsp;Italian Herbs&nbsp;,&nbsp;Chili</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Size</td>\r\n			<td>200 ml</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(297, 104, 2, 'Rabeko Zero Cooking Spray', '<p>Rabeko Zero Cooking Sprays are low in calories and guaranteed sugar-free. They are recommended for all your cooking and pasta dishes, or for seasoning your salads.</p>\r\n\r\n<p>Benefits:</p>\r\n\r\n<ul>\r\n	<li>Low-calorie cooking sprays (4,9 Kcal/serving of 0,6 ml)</li>\r\n	<li>Sugar free</li>\r\n	<li>Available in 4&nbsp;incredible flavours.</li>\r\n	<br />\r\n	<li>&nbsp;</li>\r\n</ul>\r\n\r\n<h2>How To Use It?</h2>\r\n\r\n<p>Shake lightly before use. Spray for 1/2 second at a distance of 20cm on your food or cooking surface.</p>\r\n\r\n<h2>Product Composition</h2>\r\n\r\n<p>Refined rapeseed oil (97%), stabilizer: rapeseed lecithin E322 (3%), flavour (0,2%)</p>', '<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>Nutritional value per 100 ml</td>\r\n			<td>Nutritional value per serving of 0,6 ml</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;Energy value</td>\r\n			<td>3330 Kj /810 Kcal</td>\r\n			<td>20 Kj / 4,9 Kcal</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fat</td>\r\n			<td>90 g</td>\r\n			<td>0,54 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Saturated fats</td>\r\n			<td>7,2 g</td>\r\n			<td>0,04 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Carbohydrate</td>\r\n			<td>0&nbsp;g</td>\r\n			<td>0&nbsp;g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sugars</td>\r\n			<td>0 g</td>\r\n			<td>0 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;Proteins</td>\r\n			<td>0&nbsp;g</td>\r\n			<td>0&nbsp;g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;Salt</td>\r\n			<td>0 g</td>\r\n			<td>0 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Flavour</td>\r\n			<td>Butter&nbsp;,&nbsp;Garlic&nbsp;,&nbsp;Italian Herbs&nbsp;,&nbsp;Chili</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Size</td>\r\n			<td>200 ml</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(298, 105, 1, 'Qvie Protein Pasta', '<p>Craving for a Pasta dish? <strong>Our Macaroni And Cheese | Fettucini Alfredo</strong> fits in the weight loss phase and maintenance phase of the Qvie program. Limit the pasta to one per day in weight loss and enjoy as a meal or snack during maintenance.</p>\r\n\r\n<p><strong>Features:</strong></p>\r\n\r\n<ul>\r\n	<li>Specially-formulated for weight loss</li>\r\n	<li>Macaroni and Cheese contains 220 calories, 12 grams of protein and only 4 gram of fat</li>\r\n	<li>During the weight loss phase, limit one per day</li>\r\n	<li>Individually packed in sachets for your convenience (3 per box)</li>\r\n	<li>Aspartame Free</li>\r\n</ul>', '<h3><strong>Macaroni and Cheese [3 servings per box]</strong></h3>\r\n\r\n<p><strong>Ingredients:</strong>&nbsp;Enriched Macaroni (Durum Semolina [From Wheat], Niacin, Ferrous Sulfate, Thiamin Mononitrate, Riboflavin, Folic Acid), Cheddar, Romano and Parmesan Cheeses (Cow&rsquo;s and Sheep&rsquo;s Milk, Cheese Cultures, Salt, Enzymes, Annatto [For Color]), Milk Protein Isolate, Whey, Buttermilk, Salt, Modified Food Starch, Unsalted Butter (Pasteurized Cream, Natural Flavor), Natural Flavor, Yeast Extract, Guar Gum, Lactic Acid, Sodium Phosphate, Disodium Phosphate, Annatto and Turmeric Extracts (For Color), Yellow #5, Yellow #6.</p>\r\n\r\n<p><strong>Contains:&nbsp; Wheat and Milk.</strong></p>\r\n\r\n<p>Directions:</p>\r\n\r\n<p><em>Microwave:</em></p>\r\n\r\n<ol>\r\n	<li>Combine the contents of one packet and 8 ounces of warm water in a medium size microwave-safe bowl.&nbsp; Stir thoroughly.</li>\r\n	<li>Microwave on HIGH (100%) for 4 minutes; stir.&nbsp; Continue cooking on HIGH for 2 to 4 minutes or until the macaroni is tender. The sauce will thicken upon standing. &nbsp;(Microwave ovens vary; adjust time as needed.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>Stove-top:</em></p>\r\n\r\n<ol>\r\n	<li>Combine the contents of one packet and 8 ounces of warm water in a medium size saucepan.&nbsp; Stir thoroughly.</li>\r\n	<li>Bring to a low boil over medium heat.&nbsp; Reduce heat and simmer uncovered 6 to 8 minutes or until the macaroni is tender, stirring frequently.&nbsp; The sauce will continue to thicken upon standing.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Contains No:</strong></p>\r\n\r\n<ul>\r\n	<li>Artificial flavor</li>\r\n	<li>Added sugars</li>\r\n	<li>MSG</li>\r\n	<li>PHO</li>\r\n</ul>\r\n\r\n<p><img alt=\\\"\\\" src=\\\"https://www.qvie.ae/wp-content/uploads/2019/01/Macaroni-and-cheese-600x546.jpg\\\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Fettucini Alfredo [3 servings per box]</strong></h3>\r\n\r\n<p><strong>Ingredients:</strong>&nbsp;Pasta (Durum Semolina [From Wheat], Niacin, Ferrous Sulfate, Thiamin Mononitrate, Riboflavin and Folic Acid), Parmesan Cheese (Pasteurized Milk, Cheese Cultures, Salt, Enzymes), Milk Protein Isolate, Whey, Salt, Natural Flavor, Buttermilk, Nonfat Milk, Sodium Phosphate, Butter Powder, Romano Cheese (Pasteurized Cow&rsquo;s Milk, Cheese Cultures, Salt, Enzymes), Potassium Chloride, Guar Gum, Fructose, Yeast Extract, Ground Garlic, Lactic Acid, Modified Food Starch, Disodium Inosinate and Disodium Guanylate, Maltodextrin, Spices, Dextrose, Disodium Phosphate, Spice Extractives, Xanthan Gum, Tocopherols and Ascorbyl Palmitate (To Preserve Freshness).</p>\r\n\r\n<p><strong>Contains:&nbsp; Wheat and Milk.</strong></p>\r\n\r\n<p>Directions:</p>\r\n\r\n<p><em>Microwave:</em></p>\r\n\r\n<ol>\r\n	<li>Combine the contents of one packet and 8 ounces of warm water in a medium size microwave-safe bowl.&nbsp; Stir thoroughly.</li>\r\n	<li>Microwave on HIGH (100%) for 4 minutes; stir.&nbsp; Continue cooking on HIGH for 2 to 4 minutes or until the noodles are tender. The sauce will thicken upon standing.&nbsp; (Microwave ovens vary; adjust time as needed.)</li>\r\n</ol>\r\n\r\n<p><em>Stove-Top:</em></p>\r\n\r\n<ol>\r\n	<li>Combine the contents of one packet and 8 ounces of warm water in a medium size saucepan.&nbsp; Stir thoroughly.</li>\r\n	<li>Bring to a low boil over medium heat.&nbsp; Reduce heat and simmer uncovered 6 to 8 minutes or until the noodles are tender, stirring frequently.&nbsp; The sauce will continue to thicken upon standing.</li>\r\n</ol>\r\n\r\n<p><img alt=\\\"\\\" src=\\\"https://www.qvie.ae/wp-content/uploads/2019/02/fettucini-alfredo-600x546.jpg\\\" /></p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(299, 105, 2, 'Qvie Protein Pasta', '<p>Craving for a Pasta dish? Our Macaroni And Cheese/&nbsp; fits in the weight loss phase and maintenance phase of the Qvie program. Limit the pasta to one per day in weight loss and enjoy as a meal or snack during maintenance.</p>\r\n\r\n<p><strong>Features:</strong></p>\r\n\r\n<ul>\r\n	<li>Specially-formulated for weight loss</li>\r\n	<li>Macaroni and Cheese contains 220 calories, 12 grams of protein and only 4 gram of fat</li>\r\n	<li>During the weight loss phase, limit one per day</li>\r\n	<li>Individually packed in sachets for your convenience (3 per box)</li>\r\n	<li>Aspartame Free</li>\r\n</ul>', '<h3><strong>Macaroni and Cheese [3 servings per box]</strong></h3>\r\n\r\n<p><strong>Ingredients:</strong>&nbsp;Enriched Macaroni (Durum Semolina [From Wheat], Niacin, Ferrous Sulfate, Thiamin Mononitrate, Riboflavin, Folic Acid), Cheddar, Romano and Parmesan Cheeses (Cow&rsquo;s and Sheep&rsquo;s Milk, Cheese Cultures, Salt, Enzymes, Annatto [For Color]), Milk Protein Isolate, Whey, Buttermilk, Salt, Modified Food Starch, Unsalted Butter (Pasteurized Cream, Natural Flavor), Natural Flavor, Yeast Extract, Guar Gum, Lactic Acid, Sodium Phosphate, Disodium Phosphate, Annatto and Turmeric Extracts (For Color), Yellow #5, Yellow #6.</p>\r\n\r\n<p><strong>Contains:&nbsp; Wheat and Milk.</strong></p>\r\n\r\n<p>Directions:</p>\r\n\r\n<p><em>Microwave:</em></p>\r\n\r\n<ol>\r\n	<li>Combine the contents of one packet and 8 ounces of warm water in a medium size microwave-safe bowl.&nbsp; Stir thoroughly.</li>\r\n	<li>Microwave on HIGH (100%) for 4 minutes; stir.&nbsp; Continue cooking on HIGH for 2 to 4 minutes or until the macaroni is tender. The sauce will thicken upon standing. &nbsp;(Microwave ovens vary; adjust time as needed.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>Stove-top:</em></p>\r\n\r\n<ol>\r\n	<li>Combine the contents of one packet and 8 ounces of warm water in a medium size saucepan.&nbsp; Stir thoroughly.</li>\r\n	<li>Bring to a low boil over medium heat.&nbsp; Reduce heat and simmer uncovered 6 to 8 minutes or until the macaroni is tender, stirring frequently.&nbsp; The sauce will continue to thicken upon standing.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Contains No:</strong></p>\r\n\r\n<ul>\r\n	<li>Artificial flavor</li>\r\n	<li>Added sugars</li>\r\n	<li>MSG</li>\r\n	<li>PHO</li>\r\n</ul>\r\n\r\n<p><img alt=\\\"\\\" src=\\\"https://www.qvie.ae/wp-content/uploads/2019/01/Macaroni-and-cheese-600x546.jpg\\\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Fettucini Alfredo [3 servings per box]</strong></h3>\r\n\r\n<p><strong>Ingredients:</strong>&nbsp;Pasta (Durum Semolina [From Wheat], Niacin, Ferrous Sulfate, Thiamin Mononitrate, Riboflavin and Folic Acid), Parmesan Cheese (Pasteurized Milk, Cheese Cultures, Salt, Enzymes), Milk Protein Isolate, Whey, Salt, Natural Flavor, Buttermilk, Nonfat Milk, Sodium Phosphate, Butter Powder, Romano Cheese (Pasteurized Cow&rsquo;s Milk, Cheese Cultures, Salt, Enzymes), Potassium Chloride, Guar Gum, Fructose, Yeast Extract, Ground Garlic, Lactic Acid, Modified Food Starch, Disodium Inosinate and Disodium Guanylate, Maltodextrin, Spices, Dextrose, Disodium Phosphate, Spice Extractives, Xanthan Gum, Tocopherols and Ascorbyl Palmitate (To Preserve Freshness).</p>\r\n\r\n<p><strong>Contains:&nbsp; Wheat and Milk.</strong></p>\r\n\r\n<p>Directions:</p>\r\n\r\n<p><em>Microwave:</em></p>\r\n\r\n<ol>\r\n	<li>Combine the contents of one packet and 8 ounces of warm water in a medium size microwave-safe bowl.&nbsp; Stir thoroughly.</li>\r\n	<li>Microwave on HIGH (100%) for 4 minutes; stir.&nbsp; Continue cooking on HIGH for 2 to 4 minutes or until the noodles are tender. The sauce will thicken upon standing.&nbsp; (Microwave ovens vary; adjust time as needed.)</li>\r\n</ol>\r\n\r\n<p><em>Stove-Top:</em></p>\r\n\r\n<ol>\r\n	<li>Combine the contents of one packet and 8 ounces of warm water in a medium size saucepan.&nbsp; Stir thoroughly.</li>\r\n	<li>Bring to a low boil over medium heat.&nbsp; Reduce heat and simmer uncovered 6 to 8 minutes or until the noodles are tender, stirring frequently.&nbsp; The sauce will continue to thicken upon standing.</li>\r\n</ol>\r\n\r\n<p><img alt=\\\"\\\" src=\\\"https://www.qvie.ae/wp-content/uploads/2019/02/fettucini-alfredo-600x546.jpg\\\" /></p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(300, 106, 1, 'Tropicana Slim Arabic Sweet Syrup', '<h1>ARABIC SWEET SYRUP</h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Sugar Free and Low in Calories</strong><br />\r\nTropicana Slim Arabic Sweet Syrup is sugar free and low in calories, making it suitable for diabetics and perfectly meeting the sugar intake of a low calorie diet.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>It&rsquo;s practical</strong></p>\r\n\r\n<p>Tropicana Slim Arabic Sweet Syrup is packed in a &lsquo;ready to use&rsquo; bottle that makes it easy to add to anything you eat or drink.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n</ul>', '<p><strong>Why Tropicana Slim Arabic Sweet Syrup?</strong><br />\r\nSugar free and low in calories, adding a bit of Tropicana Slim Arabic Sweet Syrup gets you all the sweetness you want, with less calories. Being sugar free, it is the perfect sweet syrup for diabetes and diet regimens and works well with any kind of cake, drink and even as a salad dressing!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Variant :</strong></p>\r\n\r\n<ul>\r\n	<li>350 ml</li>\r\n</ul>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
