(304, 108, 1, 'Applied Nutrition Protien Shake', '<h2>HIGH&nbsp;PROTEIN MILK&nbsp;SHAKE&nbsp;WITH ADDED SWEETENER</h2>\r\n\r\n<h2>NO ADDED SUGAR* | 42G PROTEIN&nbsp;| LOW FAT</h2>\r\n\r\n<h2>High Protein Shake 8x500ml</h2>\r\n\r\n<p>The Applied Nutrition High Protein Shake is a delicious, smooth and creamy milkshake with sweetener.</p>\r\n\r\n<h3><br />\r\nSTORAGE</h3>\r\n\r\n<p>Keep sealed in a cool dry place. Once opened, keep refrigerated and consume within 24 hours. This product is ready to use. Shake well before use. Best before date: see side of sleeve.</p>', '<h3>NUTRITIONAL INFORMATION</h3>\r\n\r\n<h3><img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/High-Protein-Shake-500ml---Nutritionals---1000x1000_44f2a024-a18a-4744-9309-6acac85c8262_600x600.jpg?v=1640091774\\\" /></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>INGREDIENTS</h3>\r\n\r\n<p><strong>Vanilla Ice Cream</strong><br />\r\n<strong>Milk</strong>&nbsp;Protein Concentrate (65%), Water, Skimmed&nbsp;<strong>Milk</strong>&nbsp;(7.5%), Flavouring, Stabiliser (Carrageenan), Acidity Regulator (Trisodium Citrate), Sweetener (Sucralose), Colour (Beta Carotene).<br />\r\n<br />\r\n<strong>Strawberries &amp; Cream</strong><br />\r\n<strong>Milk</strong>&nbsp;Protein Concentrate (65%), Water, Skimmed&nbsp;<strong>Milk</strong>&nbsp;(7.5%), Stabiliser (Carrageenan), Acidity Regulator (Trisodium Citrate), Flavouring, Colour (Lycopene), Sweetener (Sucralose).<br />\r\n<br />\r\n<strong>Double Chocolate</strong><br />\r\n<strong>Milk</strong>&nbsp;Protein Concentrate (62%), Water, Skimmed&nbsp;<strong>Milk</strong>&nbsp;(10%), Fat Reduced Cocoa Powder (0.87%), Stabiliser (Carrageenan), Acidity Regulator (Trisodium Citrate), Flavouring, Sweetener (Sucralose).</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(305, 108, 2, 'Applied Nutrition Protien Shake', '<h2>HIGH&nbsp;PROTEIN MILK&nbsp;SHAKE&nbsp;WITH ADDED SWEETENER</h2>\r\n\r\n<h2>NO ADDED SUGAR* | 42G PROTEIN&nbsp;| LOW FAT</h2>\r\n\r\n<h2>High Protein Shake 8x500ml</h2>\r\n\r\n<p>The Applied Nutrition High Protein Shake is a delicious, smooth and creamy milkshake with sweetener.</p>\r\n\r\n<h3><br />\r\nSTORAGE</h3>\r\n\r\n<p>Keep sealed in a cool dry place. Once opened, keep refrigerated and consume within 24 hours. This product is ready to use. Shake well before use. Best before date: see side of sleeve.</p>', '<h3>NUTRITIONAL INFORMATION</h3>\r\n\r\n<h3><img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/High-Protein-Shake-500ml---Nutritionals---1000x1000_44f2a024-a18a-4744-9309-6acac85c8262_600x600.jpg?v=1640091774\\\" /></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>INGREDIENTS</h3>\r\n\r\n<p><strong>Vanilla Ice Cream</strong><br />\r\n<strong>Milk</strong>&nbsp;Protein Concentrate (65%), Water, Skimmed&nbsp;<strong>Milk</strong>&nbsp;(7.5%), Flavouring, Stabiliser (Carrageenan), Acidity Regulator (Trisodium Citrate), Sweetener (Sucralose), Colour (Beta Carotene).<br />\r\n<br />\r\n<strong>Strawberries &amp; Cream</strong><br />\r\n<strong>Milk</strong>&nbsp;Protein Concentrate (65%), Water, Skimmed&nbsp;<strong>Milk</strong>&nbsp;(7.5%), Stabiliser (Carrageenan), Acidity Regulator (Trisodium Citrate), Flavouring, Colour (Lycopene), Sweetener (Sucralose).<br />\r\n<br />\r\n<strong>Double Chocolate</strong><br />\r\n<strong>Milk</strong>&nbsp;Protein Concentrate (62%), Water, Skimmed&nbsp;<strong>Milk</strong>&nbsp;(10%), Fat Reduced Cocoa Powder (0.87%), Stabiliser (Carrageenan), Acidity Regulator (Trisodium Citrate), Flavouring, Sweetener (Sucralose).</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0);
