Mononitrate, Manganese Sulfate), Soy Lecithin, Sucralose, Salt, Acesulfame Potassium.</p>\r\n\r\n<p><strong>Contains Milk, Soy</strong>&nbsp;(Lecithin).</p>\r\n\r\n<p><strong>Recommended Use:</strong>&nbsp;Shake well and serve cold. Refrigerate after opening.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(307, 109, 2, 'Labarada Lean Body Protien Shake', '<h2>Lean Body&reg;&nbsp;gives You High-Protein Nutrition&nbsp;<strong>On-The-Go!</strong></h2>\r\n\r\n<p>To many people, a &quot;Lean Body&quot; means better health, more energy, strength, and an improved sense of well being. Whatever goal drives you, Lean Body&reg; Ready-to-Drink (RTD) Shakes can help you reach it. Lean Body&reg; RTDs provide high-quality protein without sugar or gluten. The protein in Lean Body&reg; RTDs provide nutritional support for lean muscle in a convenient shake with a delicious, creamy taste that hits the spot every time.</p>\r\n\r\n<p>Lean Body&reg; RTDs can help you manage your weight by helping curb appetite and food cravings. The protein in Lean Body can help you feel more full and satisfied. And when you feel satisfied, you&#39;re less likely to over-indulge in unhealthy snacks.</p>\r\n\r\n<p>Lean Body&reg; RTDs also make it easy to reach your goals because they&#39;re convenient, and you can take them anywhere. After all, when it comes to shaping up, being prepared is half the battle. If you always have great nutrition at your fingertips, you&#39;ll be less tempted to hit those fast food drive-thrus on every corner. At home or on the go, Lean Body&reg; RTDs have you covered with high-protein, ready-made nutrition at your fingertips.</p>\r\n\r\n<p><strong>Note:</strong>&nbsp;Lean Body&reg; RTD comes in a Tetra Pak&reg; carton that protects what&#39;s good inside and out. It protects the product taste and nutrition without the need for added preservatives or refrigeration. It also helps preserve resources for future generations &ndash; Tetra Pak&reg; cartons are recyclable and made from FSC&reg; certified paper, renewable resource from selectively harvested, re-grown trees.&nbsp;<strong>And now, Lean Body&reg; RTDs come with a&nbsp; recyclable, sugarcane plant-based cap! Protecting What&#39;s Good.&reg;</strong></p>', '<h2><strong>Nutrition Facts</strong></h2>\r\n\r\n<h3>&nbsp;</h3>\r\