(310, 111, 1, 'Applied Nutrition CLA Gold 1000', '<h2>CLA GOLD 1000</h2>\r\n\r\n<p>CLA, otherwise known as Conjugated Linoleic Acid, is one of the most popular and widely used supplements within the Sports Nutrition and health industry. CLA is a naturally occurring Omega-6 Fatty Acid, which plays a role in human health.</p>\r\n\r\n<p><br />\r\n<strong>KEY BENEFITS</strong></p>\r\n\r\n<ul>\r\n	<li>Halal Certified Product</li>\r\n	<li>Easy to Swallow Veggie Softgels</li>\r\n	<li>Natural Source of Omega 6 Essential Fatty Acid<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '<p><strong>SUGGESTED USE</strong></p>\r\n\r\n<p>Take 2 softgels 1 to 3 times daily with meals.</p>\r\n\r\n<p><strong>Serving Size: 2 Softgels</strong></p>\r\n\r\n<p><strong>Servings Per Container: 50</strong></p>\r\n\r\n<p><strong>CAUTION</strong></p>\r\n\r\n<p>Check with a qualified health professional before using this product if you are under the age of 18, pregnant or nursing a baby, or if you have any known or suspected medical condition(s) and or are taking any prescription or OTC medication(s). Not to be used as a substitute for a varied diet and healthy lifestyle. Store this product in a cool dry place, away from children. Do not exceed the suggested use. For allergens see ingredients in&nbsp;<strong>Bold</strong>.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
