(312, 112, 1, 'Applied Nutrition Multi-Vitamin Complex Capsules', '<h2>Multi-Vitamin Complex&nbsp;Capsules</h2>\r\n\r\n<h3>90 CAPSULES | 72G | 90 SERVINGS</h3>\r\n\r\n<p>Multi-Vitamin Complex contributes to the normal function of the immune system during and after intense physical exercise, the nervous system as well as normal muscle and cognitive function, and the normal formation of connective tissue.</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>30+ Vitamins, Minerals, Probiotics &amp; Antioxidants</li>\r\n	<li>Only the most bioavailable sources used</li>\r\n	<li>Plant-based veggie shell well suited for consumers with dietary, religious, or cultural restrictions</li>\r\n	<li>Leading dosages of every ingredient</li>\r\n	<li>Halal Certified Product<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<h3>&nbsp;</h3>', '<h3><img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/Multi-Vitamin-Capsules---Nutritionals---1000x1000_1_480x480.jpg?v=1628847601\\\" /><br />\r\n<br />\r\nOTHER INGREDIENTS</h3>\r\n\r\n<p>Micro Crystalline Cellulose (Binding Agent), Calcium Carbonate, Magnesium Oxide, Ascorbic Acid, Citrus Bioflavonoids (35% Hesperidin), Green Tea Extract (95% Polyphenols), Choline Bitartrate, Grape Seed 95% Extract, Riboflavin, Vitamin B3 (Nicotinamide), Calcium D Pantothenate, Pyridoxine HCL, Quercetin, Inositol, Zinc Oxide, Ferrous Fumarate,</p>\r\n\r\n<p>DL Alpha Tocopherol, Magnesium Stearate (flow agent), Silicon Dioxide (flow agent), Lactobacillus Acidophilus, L-Seleno Methionine, Marigold Extract (90% Lutein), Co Enzyme Q10, Black Pepper Extract (95% Piperine), Lycopene, Retinol Acetate, Folic Acid, D-Biotin, Manganese Citrate, Copper Citrate, Vitamin K1, Chromium Picolinate, Boric Acid, Vitamin B12 (Cyanocobalamin), Seleno Methionine, Cholecalciferol.</p>\r\n\r\n<h3>SUGGESTED USE</h3>\r\n\r\n<p>Take&nbsp;1 serving (1 capsule) 3 times daily with food.<br />\r\n&nbsp;</p>\r\n\r\n<h3>CAUTION</h3>\r\n\r\n<p>Check with a qualifi