 product if you are under the age of 18, pregnant or nursing a baby, or if you have any known or suspected medical condition(s) and or are taking any prescription or OTC medication(s). Not to be used as a substitute for a varied diet and healthy lifestyle. Store this product in a cool dry place, away from children. Do not exceed the suggested use. For allergens see ingredients in&nbsp;<strong>Bold</strong>.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>TESTED FOR ATHLETES</h3>\r\n\r\n<p>Every batch of this product is tested for banned substances under a monitored programme. Products undergo rigorous testing at an ISO 17025 accredited lab to provide the highest level of assurance that they are safer for athletes to use.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>GMP</h3>\r\n\r\n<p>This product was manufactured in a GMP facility under strict quality control to assure consistent high quality that meets the requirements of the marketing authorization (MA) or product specification.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(314, 113, 1, 'Applied Nutrition Zinc Tablet', '<h3>Zinc</h3>\r\n\r\n<p><strong>90 TABLETS | 90G | 90 SERVINGS</strong></p>\r\n\r\n<p>Zinc is an essential mineral that is involved in numerous aspects of cellular metabolism. It is required for the catalytic activity of many enzymes and it plays a role in immune function, protein synthesis. Zinc also supports normal growth and development. A daily intake of Zinc is required to maintain a steady-state because the body has no specialized Zinc storage system.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>Essential Mineral</li>\r\n	<li>Easily Absorbed Source</li>\r\n	<li>Halal Certified Product</li>\r\n	<li>Contributes to the Normal Function of the Immune System During &amp; After Intense Physical Exercise<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<h3>&nbsp;</h3>', '<h3>SERVING AMOUNT</h3>\r\n\r\n<p><strong>Serving Size:</strong>&nbsp;1 Tablet</p>\r\n\r\n<p><strong>Servings Per Container:</strong>&nbsp;90</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Amount Per Serving</strong></p>\r\n\r\n<p>Vitamin C&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 60 mg&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 75% *RI</p>\r\n\r\n<p>Zinc&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 15 mg&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 150% *RI</p>\r\n\r\n<p>* Reference intake of an average adult (8400 kJ/2000 kcal).</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>OTHER INGREDIENTS</h3>\r\n\r\n<p>Calcium Carbonate, Bulking Agents (Di Calcium Phosphate, Microcrystalline Ce