(318, 115, 1, 'Bang Energy Drink', '<p>Bang&reg; is not your typical sugar-filled, soul-sucking soda masquerading as an energy drink. If it&rsquo;s just a jolt of energy you want, have a candy bar, wear a tinfoil hat in a lightning storm, or try one of the other &ldquo;energy&rdquo; drinks on the market. But if you&rsquo;re looking for something to fuel your next workout or hike, if you want sustained energy, as well as peak mental and physical performance, Bang&reg; is the energy drink for you!</p>\r\n\r\n<p>Every 16-ounce can of Bang&reg; &mdash; that&rsquo;s right, no wimpy 12-ounce cans here &mdash; contains 300 milligrams of caffeine, which has been shown to increase endurance, as well as strength in some cases. Even better, Bang&reg; is sugar-free and has ZERO calories &mdash; yet it tastes great, with a variety of fantastic&nbsp;flavors to choose from! &nbsp;</p>\r\n\r\n<p>Bang&reg; energy drinks also contain other ingredients designed to help you get more out of your workout, your day and your life&hellip; OK, that last one may be a little much, but Bang&reg; generates that kind of enthusiasm! It&rsquo;s why Bang&reg; is not only America&rsquo;s top-growing energy drink, but the No. 1 overall growth-beverage in the entire non-alcoholic beverage industry (through 2018)!</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(319, 115, 2, 'Bang Energy Drink', '<p>Bang&reg; is not your typical sugar-filled, soul-sucking soda masquerading as an energy drink. If it&rsquo;s just a jolt of energy you want, have a candy bar, wear a tinfoil hat in a lightning storm, or try one of the other &ldquo;energy&rdquo; drinks on the market. But if you&rsquo;re looking for something to fuel your next workout or hike, if you want sustained energy, as well as peak mental and physical performance, Bang&reg; is the energy drink for you!</p>\r\n\r\n<p>Every 16-ounce can of Bang&reg; &mdash; that&rsquo;s right, no wimpy 12-ounce cans here &mdash; contains 300 milligrams of caffeine, which has been shown to increase endurance, as well as strength in some cases. Even better, Bang&reg; is sugar-free and has ZERO calories &mdash; yet it tastes great, with a variety of fantastic&nbsp;flavors to choose from! &nbsp;</p>\r\n\r\n<p>Bang&reg; energy drinks also contain other ingredients designed to help you get more out of your workout, your day and your life&hellip; OK, that last one may be a little much, but Bang&reg; generates that kind of enthusiasm! It&rsquo;s why Bang&reg; is not only America&rsquo;s top-growing energy drink, but the No. 1 overall growth-beverage in the entire non-alcoholic beverage industry (through 2018)!</p>', '<p><strong>RECOMMENDED USE</strong></p>\r\n\r\n<p>Serving Size 1 can</p>\r\n\r\n<p><img alt=\\\"Bang-RTD-Label\\\" src=\\\"https://bangenergy.com/wp-content/uploads/2019/05/Bang-RTD-Label.png\\\" style=\\\"height:706px; width:421px\\\" /></p>\r\n\r\n<p><strong>Warning</strong>&nbsp;</p>\r\n\r\n<p>Do not use this product if you are pregnant or nursing. Do not consume this product if you are taking any prescription drug and/or have any medical condition. The user of this product assumes all liability if this product is used in a manner not consistent with label guidelines. This product contains caffeine and should not be used with any other caffeine-containing products. This product is intended for use by healthy individuals only.&nbsp;</p>\r\n\r\n<p>Too much caffeine may cause nervousness, irritability, sleeplessness, and, occasionally, rapid heartbeat. Not recommended for use by children under 18 years of age. One&nbsp;can&nbsp;of Bang&reg; provides 300 mg of caffeine,&nbsp;which is more than two cups of coffee.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(320, 116, 1, 'Eat Real Quinoa Chips', '<h2>Eat Real Quinoa Chips</h2>\r\n\r\n<p>By harnessing this &quot;Supergrain&quot; source to Eat Real&#39;s ever-expanding range of snack products, Eat Real is delighted to bring these tasty light Quinoa Chips in mouthwatering flavours</p>\r\n\r\n<p>Eat Real Quinoa Chips are a crunchy and crispy snack made from quinoa flour.</p>\r\n\r\n<p>Eat Real snacks are based on three very simple concepts that are Taste, Nutrition and Real Ingredients. Eat Real&#39;s desire is to create a product that is an enjoyable healthier alternative to standard snack and confectionery items and to distinguish themselves from other brands that are ever present on supermarket shelves.<br />\r\n<br />\r\nMade from real, natural ingredients with 29% Quinoa and no added nasties (artificial flavourings, colourings and preservatives), Eat Real have something for the whole family that can be enjoyed at any time of the day!</p>\r\n\r\n<ul>\r\n	<li>Vegan</li>\r\n	<li>Gulten-free</li>\r\n</ul>\r\n\r\n<p><br />\r\n<br />\r\nSharing Pack: 80g</p>', '<h3>Ingredients</h3>\r\n\r\n<p>Quinoa Flour (29%), Corn Flour, Rice Flour, Corn Starch, Lentil Flour, Pea Flour, Rapeseed Oil, Sour Cream &amp; Chive Seasoning (7%) (Rice Flour, Onion Powder, Sugar, Salt, Yeast Extract Powder, Natural Flavouring, Garlic Powder, Herb (Chive), Citric Acid), Sugar, Salt.</p>\r\n\r\n<h3>Allergen Advice</h3>\r\n\r\n<p>Free from all 14 declarable allergens.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(321, 116, 2, 'Eat Real Quinoa Chips', '<h2>Eat Real Quinoa Chips</h2>\r\n\r\n<p>By harnessing this &quot;Supergrain&quot; source to Eat Real&#39;s ever-expanding range of snack products, Eat Real is delighted to bring these tasty light Quinoa Chips in mouthwatering flavours</p>\r\n\r\n<p>Eat Real Quinoa Chips are a crunchy and crispy snack made from quinoa flour.</p>\r\n\r\n<p>Eat Real snacks are based on three very simple concepts that are Taste, Nutrition and Real Ingredients. Eat Real&#39;s desire is to create a product that is an enjoyable healthier alternative to standard snack and confectionery items and to distinguish themselves from other brands that are ever present on supermarket shelves.<br />\r\n<br />\r\nMade from real, natural ingredients with 29% Quinoa and no added nasties (artificial flavourings, colourings and preservatives), Eat Real have something for the whole family that can be enjoyed at any time of the day!<br />\r\n<br />\r\nSharing Pack: 80g</p>', '<h3>Ingredients</h3>\r\n\r\n<p>Quinoa Flour (29%), Corn Flour, Rice Flour, Corn Starch, Lentil Flour, Pea Flour, Rapeseed Oil, Sour Cream &amp; Chive Seasoning (7%) (Rice Flour, Onion Powder, Sugar, Salt, Yeast Extract Powder, Natural Flavouring, Garlic Powder, Herb (Chive), Citric Acid), Sugar, Salt.</p>\r\n\r\n<h3>Allergen Advice</h3>\r\n\r\n<p>Free from all 14 declarable allergens.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(322, 117, 1, 'Eat Real Lentil Chips', '<p>From humble lentil to crunchy crispy chip, the added touch of light freshly&nbsp; mouth-wateringly delicious taste. We are sure that you will enjoy eating our flavoured lentil chips as much as we have enjoyed making them.</p>\r\n\r\n<p>Eat Real snacks are based on three very simple concepts that are Taste, Nutrition and Real Ingredients. Eat Real&#39;s desire is to create a product that is an enjoyable healthier alternative to standard snack and confectionery items and to distinguish themselves from other brands that are ever present on supermarket shelves.<br />\r\n<br />\r\nWith no added sugar (only the natural stuff) you&#39;re getting a healthy snack.<br />\r\nMade from real, natural ingredients with no added nasties (artificial flavourings, colourings and preservatives), Eat Real have something for the whole family that can be enjoyed at any time of the day!</p>\r\n\r\n<ul>\r\n	<li>Vegan</li>\r\n	<li>Gulten-free</li>\r\n</ul>\r\n\r\n<p><br />\r\nSharing Pack: 113g.</p>', '<h3>Ingredients</h3>\r\n\r\n<p>Lentil Flour (40%), Potato Starch, Corn Starch, Rapeseed Oil, Sea Salt.</p>\r\n\r\n<h3>Allergen Advice</h3>\r\n\r\n<p>Free from all 14 declarable allergens.</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
