(326, 119, 1, 'Maxsport  Protein Chips', '<p>A great revolution in the field of salty delicacies is coming! Max Sport perfectly demonstrates how to enjoy a tasty yet handy snack. Our gluten-free PROTEIN CHIPS are a symphony of endless taste and benefits that you won&rsquo;t find in ordinary salty delicacies. This delicacy with a high fiber and protein content is even vegan and reduced in fat due to longer baking. Share it and enjoy!</p>\r\n\r\n<h2>Highlists</h2>\r\n\r\n<ul>\r\n	<li>&nbsp;<strong>Gluten-free</strong></li>\r\n	<li>&nbsp;<strong>20% protein</strong></li>\r\n	<li>&nbsp;<strong>Vegan</strong></li>\r\n	<li>&nbsp;<strong>Baked, not fried</strong></li>\r\n	<li>&nbsp;<strong>High fibre</strong></li>\r\n	<li>&nbsp;<strong>Well seasoned</strong></li>\r\n	<li>&nbsp;<strong>Thin and crunchy</strong></li>\r\n	<li>&nbsp;<strong>No soy</strong></li>\r\n	<li>&nbsp;<strong>No GMO</strong></li>\r\n</ul>', '<h2>Nutrition Fats</h2>\r\n\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>Nutritional values</th>\r\n			<th>100 g</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th>Energy value</th>\r\n			<td>1 706 kJ/ 404 kcal</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Fat</th>\r\n			<td>7,6 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th>of which saturates</th>\r\n			<td>1,5 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Carbohydrates</th>\r\n			<td>61 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th>of which sugars</th>\r\n			<td>4,5 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Dietary fibre</th>\r\n			<td>6 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Protein</th>\r\n			<td>20 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Salt</th>\r\n			<td>2,5 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Package volume</th>\r\n			<td>45 g</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>Nutritional values</th>\r\n			<th>100 g</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th>Energy value</th>\r\n			<td>1 706 kJ/ 404 kcal</td>\r\n		</tr>\r\n		<tr>\r\n			<th>Fat</th>\r\n			<td>7,6 g</td>\r\n		</tr>\r\n	