c powder, tomato powder, rice flour, yeast extract, herb (parsley), colour: paprika extract], canola oil, sugar, salt, rice fibres, spice (red paprika), dried onion, dried garlic, raising agents: sodium bicarbonate, sodium acid pyrophosphate, monocalcium phosphate; emulsifier: sunflower lecithin, natural flavouring, antioxidant: rosemary extract. Packed in a protective atmosphere.&nbsp;</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(328, 120, 1, 'Dymatize ISO 100 Hydrolized', '<h2>Dymatize ISO 100 Hydrolized Whey Isolate</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Calories&nbsp;110 | &lt;1g Sugar&nbsp;| 5.5g BCAAS |&nbsp;2.6g Leucine</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dymatize ISO 100 Protein Isolate is simply muscle-building fuel. Known worldwide for quality, taste, and purity. If your goal is to gain muscle size and strength, then ISO100 Protein is your perfect workout partner. Loaded with muscle-building amino acids, ISO100 Protein can support even the most serious resistance-training programs.</p>\r\n\r\n<p>Known worldwide for quality, taste, and purity, Dymatize ISO 100 Protein is produced to our highest quality standards. Dymatize ISO 100 Protein is formulated using a cross-flow microfiltration, multi-step purification process that preserves important muscle-building protein fractions while removing excess carbohydrates, fat, lactose, and cholesterol.</p>\r\n\r\n<p>Dymatize ISO 100 Protein Isolate is made with pre-hydrolyzed protein sources to ensure fast digestion and absorption. One look at the facts panel will tell you that Dymatize ISO 100 Protein has a lot to offer:</p>\r\n\r\n<ul>\r\n	<li>25 grams of protein, 5.5 grams of branched-chain amino acids (BCAAs), and 2.7 grams of Leucine per serving</li>\r\n	<li>Fast digesting and absorbing protein, great before, during, or after workouts</li>\r\n	<li>Maintaining a positive nitrogen balance, which is critical during periods of intense training</li>\r\n</ul>', '<h2>Nutrition Facts</h2>\r\n\r\n<p><strong>Serving Size: 1 Scoop (30g)</strong></p>\r\n\r\n<table>\r\n	<caption>NUTRITION FACTS TABLE</caption>\r\n	<thead>\r\n		<tr>\r\n			<th colspan=\\\"2\\\" scope=\\\"colgroup\\\">AMOUNT PER SERVING</th>\r\n			<th scope=\\\"col\\\">% DAILY&nbsp;VALUE<a href=\\\"https://dymatize.com/products/iso100-gourmet-vanilla#nf-footnotes-detail-a\\\">*</a></th>\r\n		</tr>\r\n	</thead>\r\n	<tfoot>\r\n		<tr>\r\n			<td colspan=\\\"3\\\">\r\n			<h2>FOOTNOTES</h2>\r\n\r\n			<p>* The % Daily Value (DV) tells you how much a nutrient in a serving of food contributes to a daily diet. 2,000 calories a day is used for general nutrition advice.<a href=\\\"https://dymatize.com/products/iso100-gourmet-vanilla#nf-footnotes-ref-a\\\">↩</a></p>\r\n			</td>\r\n		</tr>\r\n	</tfoot>\r\n	<tbody>\r\n		<tr>\r\n			<th scope=\\\"row\\\">CALORIES</th>\r\n			<td>110</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">TOTAL FAT</th>\r\n			<td>0g</td>\r\n			<td>0%</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">SATURATED FAT</th>\r\n			<td>0g</td>\r\n			<td>0%</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">TRANS FAT</th>\r\n			<td>0g</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">CHOLESTEROL</th>\r\n			<td>10mg</td>\r\n			<td>4%</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">SODIUM</th>\r\n			<td>100mg</td>\r\n			<td>4%</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">TOTAL CARBOHYDRATE</th>\r\n			<td>1g</td>\r\n			<td>0%</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">DIETARY FIBER</th>\r\n			<td>0g</td>\r\n			<td>0%</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">TOTAL SUGARS</th>\r\n			<td>&lt;1g</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">INCLUDES 0G ADDED SUGARS</th>\r\n			<td>&nbsp;</td>\r\n			<td>0%</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">PROTEIN</th>\r\n			<td>25g</td>\r\n			<td>50%</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">VITAMIN D</th>\r\n			<td>0mcg</td>\r\n			<td>0%</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">CALCIUM</th>\r\n			<td>90mg</td>\r\n			<td>6%</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">IRON</th>\r\n			<td>0mg</td>\r\n			<td>0%</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">POTASSIUM</th>\r\n			<td>100mg</td>\r\n			<td>2%</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>INGREDIENTS:</strong></p>\r\n\r\n<p>HYDROLYZED WHEY PROTEIN ISOLATE. WHEY PROT