(329, 120, 2, 'Dymatize ISO 100 Hydrolized', '<h2>Dymatize ISO 100 Hydrolized&nbsp;Whey Isolate</h2>\r\n\r\n<h3>Calories&nbsp;110 | &lt;1g Sugar&nbsp;| 5.5g BCAAS |&nbsp;2.6g Leucine</h3>\r\n\r\n<p>Dymatize ISO 100 Protein Isolate is simply muscle-building fuel. Known worldwide for quality, taste, and purity. If your goal is to gain muscle size and strength, then ISO100 Protein is your perfect workout partner. Loaded with muscle-building amino acids, ISO100 Protein can support even the most serious resistance-training programs.</p>\r\n\r\n<p>Known worldwide for quality, taste, and purity, Dymatize ISO 100 Protein is produced to our highest quality standards. Dymatize ISO 100 Protein is formulated using a cross-flow microfiltration, multi-step purification process that preserves important muscle-building protein fractions while removing excess carbohydrates, fat, lactose, and cholesterol.</p>\r\n\r\n<p>Dymatize ISO 100 Protein Isolate is made with pre-hydrolyzed protein sources to ensure fast digestion and absorption. One look at the facts panel will tell you that Dymatize ISO 100 Protein has a lot to offer:</p>\r\n\r\n<ul>\r\n	<li>25 grams of protein, 5.5 grams of branched-chain amino acids (BCAAs), and 2.7 grams of Leucine per serving</li>\r\n	<li>Fast digesting and absorbing protein, great before, during, or after workouts</li>\r\n	<li>Maintaining a positive nitrogen balance, which is critical during periods of intense training</li>\r\n</ul>', '<h2>Nutrition Facts</h2>\r\n\r\n<p><strong>Serving Size: 1 Scoop (30g)</strong></p>\r\n\r\n<table>\r\n	<caption>NUTRITION FACTS TABLE</caption>\r\n	<thead>\r\n		<tr>\r\n			<th colspan=\\\"2\\\" scope=\\\"colgroup\\\">AMOUNT PER SERVING</th>\r\n			<th scope=\\\"col\\\">% DAILY&nbsp;VALUE<a href=\\\"https://dymatize.com/products/iso100-gourmet-vanilla#nf-footnotes-detail-a\\\">*</a></th>\r\n		</tr>\r\n	</thead>\r\n	<tfoot>\r\n		<tr>\r\n			<td colspan=\\\"3\\\">\r\n			<h2>FOOTNOTES</h2>\r\n\r\n			<p>* The % Daily Value (DV) te