(332, 122, 1, 'Applied Nutrition BCAA Amino - Hydrate', '<h1>BCAA Amino Hydrate</h1>\r\n\r\n<h2>NEXT GENERATION</h2>\r\n\r\n<p>BCAA Amino Hydrate is the SUGAR-FREE intra workout &amp; recovery drink-mix that all Athletes, Bodybuilders, Powerlifters, Boxers and general keep fitters should be consuming during every workout.<br />\r\n<br />\r\nBCAA Amino Hydrate was formulated to deliver maximum amounts of highly tested Branch Chain Amino Acids that will maximize your training intensity and longevity while flooding your body with a perfect blend of re-hydrating electrolytes and salts with added Citrulline for intra workout pump.<br />\r\n<br />\r\nFuelling your body&#39;s engine during your workout is the key to progress.</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>Informed-Sport Batch Tested for Athletes</li>\r\n	<li>Replenish Electrolytes</li>\r\n	<li>Featuring Citrulline (Intra-Workout Pump)</li>\r\n	<li>Easy Mixing with the Critical Jug Allowing you to Intake Extra Water</li>\r\n	<li>Halal Certified Product</li>\r\n</ul>', '<h3><img src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/New---BCAA-450g----Nutritionals---1000x1000_9e9a57f8-2073-486e-b197-a83ac3f55e2a_480x480.jpg?v=1631617079\\\" /></h3>\r\n\r\n<h3>SUGGESTED USE</h3>\r\n\r\n<p>Mix 1 serving (1 scoop 14g) with 500ml of water and shake well. Consume during exercise on training days or throughout the day on nontraining days.<br />\r\n<em>*Scoops are estimated only, weighing scales are recommended.</em><br />\r\n&nbsp;</p>\r\n\r\n<h3>INFORMED SPORT - PROFESSIONAL</h3>\r\n\r\n<p>Every batch of this product is tested for banned substances under the Informed-Sport programme. Products undergo rigorous testing at an ISO 17025 accredited lab to provide the highest level of assurance that they are safer for athletes to use.</p>\r\n\r\n<h3><br />\r\nCAUTION</h3>\r\n\r\n<p>Check with a qualified health professional before using this product if you are under the age of 18, pregnant or nursing a baby, or if you have any known or suspected medical condition(s) and or are taking any prescription or OTC medication(s). Not to be used as a substitute for a varied diet and healthy lifestyle. Store this product in a cool dry place, away from children. Do not exceed the suggested use. For allergens see ingredients in&nbsp;<strong>Bold</strong>.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(333, 122, 2, 'Applied Nutrition BCAA Amino - Hydrate', '<h1>BCAA Amino Hydrate</h1>\r\n\r\n<h2>NEXT GENERATION</h2>\r\n\r\n<p>BCAA Amino Hydrate is the SUGAR-FREE intra workout &amp; recovery drink-mix that all Athletes, Bodybuilders, Powerlifters, Boxers and general keep fitters should be consuming during every workout.<br />\r\n<br />\r\nBCAA Amino Hydrate was formulated to deliver maximum amounts of highly tested Branch Chain Amino Acids that will maximize your training intensity and longevity while flooding your body with a perfect blend of re-hydrating electrolytes and salts with added Citrulline for intra workout pump.<br />\r\n<br />\r\nFuelling your body&#39;s engine during your workout is the key to progress.</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>Informed-Sport Batch Tested for Athletes</li>\r\n	<li>Replenish Electrolytes</li>\r\n	<li>Featuring Citrulline (Intra-Workout Pump)</li>\r\n	<li>Easy Mixing with the Critical Jug Allowing you to Intake Extra Water</li>\r\n	<li>Halal Certified Product</li>\r\n</ul>\r\n\r\n<h3>&nbsp;</h3>', '<h3><img src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/New---BCAA-450g----Nutritionals---1000x1000_9e9a57f8-2073-486e-b197-a83ac3f55e2a_480x480.jpg?v=1631617079\\\" /></h3>\r\n\r\n<h3>SUGGESTED USE</h3>\r\n\r\n<p>Mix 1 serving (1 scoop 14g) with 500ml of water and shake well. Consume during exercise on training days or throughout the day on nontraining days.<br />\r\n<em>*Scoops are estimated only, weighing scales are recommended.</em><br />\r\n&nbsp;</p>\r\n\r\n<h3>INFORMED SPORT - PROFESSIONAL</h3>\r\n\r\n<p>Every batch of this product is tested for banned substances under the Informed-Sport programme. Products undergo rigorous testing at an ISO 17025 accredited lab to provide the highest level of assurance that they are safer for athletes to use.</p>\r\n\r\n<h3><br />\r\nCAUTION</h3>\r\n\r\n<p>Check with a qualified health professional before using this product if you are under the age of 18, pregnant or nursing a baby, or if you have any known or suspected medical condition(s) and or are taking any prescription or OTC medication(s). Not to be used as a substitute for a varied diet and healthy lifestyle. Store this product in a cool dry place, away from children. Do not exceed the suggested use. For allergens see ingredients in&nbsp;<strong>Bold</strong>.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(334, 123, 1, 'Xtend Original BCAA', '<h2>THE OFFICIAL RECOVERY BRAND OF CHAMPIONS</h2>\r\n\r\n<p>Faster recovery is key to better results. For over 10 years, XTEND&reg; has been making the best recovery products in the world. Powered by 7 grams of branched chain amino acids (BCAAs), which have been clinically shown to support muscle recovery and growth, XTEND&reg; Original also contains hydrating electrolytes and additional performance ingredients to help you refuel, repair, and recover. Try all the sugar-free, mouthwatering flavors of XTEND&reg; to support your fitness goals.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>7G OF BCAAS</strong>&nbsp;- Contains 7g of BCAAs in the nature-designed and research-proven 2:1:1 ratio</li>\r\n	<li><strong>0 CARBS, 0 CALS, 0 SUGAR</strong></li>\r\n	<li><strong>3.5g&nbsp;</strong>of Leucine for Muscle Protein Synthesis</li>\r\n	<li><strong>2.5g&nbsp;</strong>of L-Glutamine &amp; 1g of Citrulline Malate</li>\r\n	<li>Stay Hydrated Pre-, During, and Post Workout with Electrolytes in&nbsp;XTEND</li>\r\n</ul>', '<p><img src=\\\"https://cdn.shopify.com/s/files/1/0024/5943/5106/files/Xtend_Original_WE30_Flat.jpg?17841133351795634410\\\" /></p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(335, 123, 2, 'Xtend Original BCAA', '<h2>THE OFFICIAL RECOVERY BRAND OF CHAMPIONS</h2>\r\n\r\n<p>Faster recovery is key to better results. For over 10 years, XTEND&reg; has been making the best recovery products in the world. Powered by 7 grams of branched chain amino acids (BCAAs), which have been clinically shown to support muscle recovery and growth, XTEND&reg; Original also contains hydrating electrolytes and additional performance ingredients to help you refuel, repair, and recover. Try all the sugar-free, mouthwatering flavors of XTEND&reg; to support your fitness goals.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>7G OF BCAAS</strong>&nbsp;- Contains 7g of BCAAs in the nature-designed and research-proven 2:1:1 ratio</li>\r\n	<li><strong>0 CARBS, 0 CALS, 0 SUGAR</strong></li>\r\n	<li><strong>3.5g&nbsp;</strong>of Leucine for Muscle Protein Synthesis</li>\r\n	<li><strong>2.5g&nbsp;</strong>of L-Glutamine &amp; 1g of Citrulline Malate</li>\r\n	<li>Stay Hydrated Pre-, During, and Post Workout with Electrolytes in&nbsp;XTEND</li>\r\n</ul>', '<p><img src=\\\"https://cdn.shopify.com/s/files/1/0024/5943/5106/files/Xtend_Original_WE30_Flat.jpg?17841133351795634410\\\" /></p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
