INSERT INTO `products_description` (`id`, `products_id`, `language_id`, `products_name`, `products_description`, `products_details`, `products_url`, `products_viewed`, `products_left_banner`, `products_left_banner_start_date`, `products_left_banner_expire_date`, `products_right_banner`, `products_right_banner_start_date`, `products_right_banner_expire_date`) VALUES
(338, 125, 1, 'C4 Energy Drink (RTD)', '<p><strong>C4 Energy Drink 500ml</strong></p>\r\n\r\n<ul>\r\n	<li>Formulated for Performance</li>\r\n	<li>C4&reg; On the go</li>\r\n	<li>Naturally flavoured, Zero sugar, Low Calorie</li>\r\n</ul>\r\n\r\n<p>C4&reg; contains vitamins such as Niacin and vitamin B12, which support the reduction of tiredness and fatigue while contributing to normal energy metabolism. Caffeine helps to increase alertness and helps concentration.</p>\r\n\r\n<p>C4&reg; is specifically engineered to deliver enhanced energy and performance in the gym, on the field or wherever your fitness journey may take you.</p>\r\n\r\n<ul>\r\n</ul>', '<p><strong>C4 Energy Drink Ingredients</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Caffeine</strong>&nbsp;&mdash; 200mg of caffeine provides explosive energy and performance</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><strong>CarnoSyn&reg; Beta-Alanine</strong>&nbsp;&mdash;&nbsp;clinically shown to delay the onset of fatigue resulting in improved muscular endurance and muscle capacity</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><strong>BetaPower&reg; Betaine</strong>&nbsp;&mdash; Naturally-derived betaine from beets, helps maintain muscle cell hydration*</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><strong>L-Citrulline</strong>&nbsp;&mdash;&nbsp;Helps to increase nitric oxide for better blood flow</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><strong>N-Acetyl-L-Tyrosine</strong>&nbsp;&mdash;&nbsp;Used to support focus during stressful activities like physical training&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Always read the label</p>\r\n\r\n<p>&nbsp;Water, Natural Flavouring, Carbon Dioxide, Acidity Regulators (Malic Acid and Citric Acid), L-Arginine (0.21%), Taurine (0.21%), Betaine (BetaPower&reg;), Sweeteners (Sucralose and Steviol Glycosides), Caffeine Anhydrous, Niacinamide, Cyanocobalamin.</p>\r\n\r\n<p>&nbsp;Suitable for Vegetarian, Vegan.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(339, 125, 2, 'C4 Energy Drink (RTD)', '<p><strong>C4 Energy Drink 500ml</strong></p>\r\n\r\n<ul>\r\n	<li>Formulated for Performance</li>\r\n	<li>C4&reg; On the go</li>\r\n	<li>Naturally flavoured, Zero sugar, Low Calorie</li>\r\n</ul>\r\n\r\n<p>C4&reg; contains vitamins such as Niacin and vitamin B12, which support the reduction of tiredness and fatigue while contributing to normal energy metabolism. Caffeine helps to increase alertness and helps concentration.</p>\r\n\r\n<p>C4&reg; is specifically engineered to deliver enhanced energy and performance in the gym, on the field or wherever your fitness journey may take you.</p>', '<p><strong>C4 Energy Drink Ingredients</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Caffeine</strong>&nbsp;&mdash; 200mg of caffeine provides explosive energy and performance</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><strong>CarnoSyn&reg; Beta-Alanine</strong>&nbsp;&mdash;&nbsp;clinically shown to delay the onset of fatigue resulting in improved muscular endurance and muscle capacity</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><strong>BetaPower&reg; Betaine</strong>&nbsp;&mdash; Naturally-derived betaine from beets, helps maintain muscle cell hydration*</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><strong>L-Citrulline</strong>&nbsp;&mdash;&nbsp;Helps to increase nitric oxide for better blood flow</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><strong>N-Acetyl-L-Tyrosine</strong>&nbsp;&mdash;&nbsp;Used to support focus during stressful activities like physical training&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Always read the label</p>\r\n\r\n<p>&nbsp;Water, Natural Flavouring, Carbon Dioxide, Acidity Regulators (Malic Acid and Citric Acid), L-Arginine (0.21%), Taurine (0.21%), Betaine (BetaPower&reg;), Sweeteners (Sucralose and Steviol Glycosides), Caffeine Anhydrous, Niacinamide, Cyanocobalamin.</p>\r\n\r\n<p>&nbsp;Suitable for Vegetarian, Vegan.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(342, 127, 1, 'Laperva Keto Cola', '<p>Laperva Keto Cola is a wonderful and refreshing Keto Cola soft drink enriched with an important set of ingredients that makes it the number one choice in its class, the world&#39;s first Laperva Soft Drink Contains 5 mg of MCT &amp; nbsp; BCAAs are important in the process of building muscle, and glutamine is very important in the process of muscle recovery and pain relief, and it also contains important minerals such as sodium, magnesium and potassium.</p>\r\n\r\n<h2>Features of Laperva Keto Cola</h2>\r\n\r\n<ul>\r\n	<li>Has 5mg of MCT</li>\r\n	<li>Gluten Free</li>\r\n	<li>Sweetened with stevia and sucralose.</li>\r\n	<li>Contains 100 mg of BCAAs.</li>\r\n	<li>rich in fiber</li>\r\n	<li>Soy-Free</li>\r\n	<li>Free of lactose, dairy, and artificial colors</li>\r\n	<li>Contains 3 mg of Glutamine</li>\r\n	<li>Has 56mg of caffeine</li>\r\n	<li>It contains important minerals such as sodium, magnesium and potassium</li>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
