(344, 128, 1, 'Green Cola', '<p>An unmatched taste, zero calories, no sugar, sweetener from the stevia plant and caffeine from green coffee beans! (This is why we are called Green Cola by the way, in case you were wondering)</p>\r\n\r\n<ul>\r\n	<li>With sweeteners from stevia plant</li>\r\n	<li>100% Taste</li>\r\n	<li>0% Aspartame</li>\r\n	<li>0% Calories</li>\r\n	<li>0% Perservatives</li>\r\n	<li>No added sugar</li>\r\n	<li>Natural Caffeine</li>\r\n</ul>', '<h3>Green Cola</h3>\r\n\r\n<p>Ingredients:<br />\r\nWater, Carbon Dioxide. Colourant: Sulphite Ammonia Caramel. Acidifiers: Tartaric Acid and Malic Acid. Sweeteners: Steviol Glycosides (less than 80 mg/L) and Sucralose (less than 200 mg/L). Natural Flavourings. Natural Caffeine: 10.5 mg / 100 ml, Salt: 0.03 g / 100 ml.</p>\r\n\r\n<h3>Green Cherry</h3>\r\n\r\n<p>Ingredients:</p>\r\n\r\n<p>Water, Sour Cherry Juice 10% (from Concentrated Juice), Carbon Dioxide, Acidifier: Citric Acid. Preservatives: Potassium Sorbate and Sodium Benzoate. Sweeteners: Steviol Glycosides (less than 80 mg/L) and Sucralose (less than 300 mg/L), Flavourings, Colourant: Black Carrot, Salt 0.03 g / 100 ml</p>\r\n\r\n<h3>Green Lemon</h3>\r\n\r\n<p>Ingredients:</p>\r\n\r\n<p>Water, Lemon Juice 6% (from Concentrated Juice), Carbon Dioxide, Acidifiers: Citric Acid and Malic Acid. Preservative: Potassium Sorbate. Antioxidant: Ascorbic Acid. Acidity Regulator: Sodium Citrate. Sweeteners: Steviol Glycosides (less than 80 mg/L) and Sucralose (less than 300 mg/L). Natural Flavourings, Flavourings, Stabilizers: Locust Bean Gum, Gum Arabic and Glycerol Esters of Wood Rosins. Salt 0.05 g/100 ml.</p>\r\n\r\n<p>Mocktail Mojitho</p>\r\n\r\n<p>Ingredients:</p>\r\n\r\n<p>Water,&nbsp; Juice 10% (from Concentrated Juice), Carbon Dioxide, Acidifier: Citric Acid. Preservatives: Potassium Sorbate and Sodium Benzoate. Sweeteners: Steviol Glycosides (less than 80 mg/L) and Sucralose (less than 300 mg/L), Flavorings, Colorant: Black Carrot, Salt 0.03 g / 100 ml.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
