</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(346, 129, 1, 'Finaflex Oatmeal Protein Pie', '<p>Meet the oatmeal protein pie, a fantastically unique, all-natural, non-GMO functional food that delivers 14 grams of the highest quality protein in every delicious pie! Oatmeal protein pie sandwiches two soft and chewy oatmeal cookies together with a creamy flavourful filling, creating a taste that will leave you scratching your head on how a healthy food can taste this good. Hungry yet? Try the oatmeal protein pie.</p>\r\n\r\n<ul>\r\n	<li>Kill sweet tooth cravings</li>\r\n	<li>Build muscle</li>\r\n	<li>Maintain a healthy weight</li>\r\n	<li>Natural detox</li>\r\n	<li>Rich in vitamins, minerals, and antioxidants</li>\r\n</ul>\r\n\r\n<p>Fiber is a natural detox that soaks up toxins, unhealthy fats, and excess hormones before they can be absorbed by the body. Fiber also increases the bioavailability of healthy vitamins in the body which is why it is such a great aid in regulating weight, digestion and appetite. The finaflex oatmeal protein pie contains a whopping 12g of fiber so you can get more satisfaction, guilt free!</p>', '<h3>14 Grams Of Protein</h3>\r\n\r\n<p>Out of all three macronutrients, protein takes the most energy for you body to digest....which means you burn more calories from digesting protein than fat or carbs. Not only that, 14g is enough to maintain and even build lean muscle mass while keeping you full at the same time.</p>\r\n\r\n<h3>12 Grams Of Fiber</h3>\r\n\r\n<p>When your body is hungry, feed it fiber. Not only will it help with digestion and help regulate cholesterol, fiber is infamously known for keeping you from getting hungry throughout the day. You can use your Protein Pie to keep you from craving those midnight snacks.</p>\r\n\r\n<h3>All Natural Ingredients</h3>\r\n\r\n<p>At FINAFLEX, quality is everything. We don&#39;t use any synthetic or artificial fillers to make our Protein Pie&#39;s taste great. That delicious and chewy texture that reminds you of Grandma&#39;s secret recipe comes from Mother Nature herself.&nbsp;</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
