(350, 131, 1, 'Applied Nutrition Test-X Capsules', '<h2>Test-X&nbsp;Capsules</h2>\r\n\r\n<h3>TESTOSTERONE SUPPORT&nbsp;</h3>\r\n\r\n<h3>120 Capsules | 110g | 30 Servings<br />\r\n<br />\r\n<strong>Supports Natural Testosterone Production&nbsp; |&nbsp; Ultra Concentrated Formula&nbsp; | Supports Lean Muscle Tissue Gains&nbsp;</strong></h3>\r\n\r\n<p>TEST-X provides a carefully formulated blend of vital nutrients, minerals, Fenugreek, D-Aspartic Acid, Panax Ginseng, Maca Root, Ashwagandha, Mucuna Pruriens &amp; Methoxy-Isoflavone.</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>Supports natural testosterone production&nbsp;</li>\r\n	<li>Ultra concentrated formula</li>\r\n	<li>Suitable for vegetarians &amp; vegans</li>\r\n	<li>Plant based veggie shell well suited for consumers with dietary, religious or cultural restrictions</li>\r\n	<li>Halal Certified Product</li>\r\n</ul>', '<h3>SUGGESTED USE</h3>\r\n\r\n<p>Consume 4 capsules daily with food.<br />\r\n&nbsp;</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>NUTRITIONAL INFORMATION</h3>\r\n\r\n<p><img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/Test-X-Capsules---Nutritionals---1000x1000_600x600.png?v=1646925782\\\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><br />\r\nINGREDIENTS</h3>\r\n\r\n<p>D-Aspartic Acid, Avena Sativa Extract (4:1) (leaf) (<strong>Oats</strong>) (&dagger;equivalent to 1200mg Avena Sativa), Korean (Panax Ginseng) Root Extract (10:1) (&dagger;equivalent to 3000mg Panax Ginseng), Fenugreek Seed Extract (4:1) (25% Fenusides) (&dagger;equivalent to 1080mg Fenugreek), Magnesium (Magnesium Oxide), Ashwagandha Root Extract (Withania somnifera, Standardised to 7% Withanolides), Mucana Pruriens (std. to 40% Extract yielding 80mg L-Dopa), Maca (Lepidium Meyenii) Root Extract (4:1) (&dagger;equivalent to 750mg Maca Root), Diindolylmethane (DIM), Vitamin C (L-Ascorbic Acid), Zinc (Zinc Oxide), Methoxy-Isoflavone (<strong>Soy</strong>), Vitamin B6 (Pyridoxine Hydrochloride), Anti-Caking Agent (Magnesium Stearate), Copper (Copper Gluconate), Vitamin D3 (Cholecalciferol), L-Selenomethionine, Capsule Shell (Hydroxypropyl Methylcellulose).<br />\r\n<br />\r\n<strong>ALLERGENS:</strong>&nbsp;For allergens, see ingredients listed in&nbsp;<strong>Bold</strong>.</p>\r\n\r\n<h3><br />\r\nTESTED FOR ATHLETES</h3>\r\n\r\n<p>Every ingredient within this product is a carefully selected and monitored through our quality management system to bring you the highest level of assurance. Final products are produced and packaged in an ISO 22000, BRC, GMP &amp; Halal accredited laboratory.</p>\r\n\r\n<p><br />\r\n<strong>FOOD SUPPLEMENT WITH VITAMINS, MINERALS &amp; BOTANICALS (120 CAPSULES). KEEP THIS PRODUCT IN A COOL DRY PLACE OUT OF REACH OF CHILDREN.</strong></p>\r\n\r\n<h3><br />\r\nCAUTION</h3>\r\n\r\n<p>Check with a qualified healthcare professional before using this product. Do not use if elderly, pregnant, nursing or under the age of 18. Do not exceed the recommended daily intake. Food supplements should not replace a balanced, varied diet and healthy training plan.<br />\r\n&nbsp;</p>\r\n\r\n<p>1&nbsp;Zinc contributes &nbsp;to the maintenance of normal testosterone levels in the blood &amp; normal fertility and reproduction.</p>\r\n\r\n<p>2&nbsp;Zinc contributes to normal protein synthesis.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
