(354, 133, 1, 'Alpro Soya High Protein', '<h2>Soya High Protein</h2>\r\n\r\n<p>You&rsquo;re our kind of person. Yes, you are. By picking up this carton, full of&nbsp;<strong>plant-based protein</strong>, you&rsquo;re doing yourself and the planet a favor. So while you&rsquo;re kind to this world, you can enjoy the great taste. The soya beans that go into this smooth drink are responsibly farmed, leaving the rainforests lush and lovely. We&rsquo;d rather leave the trees for climbing and hugging. GOOD FOR YOU*</p>\r\n\r\n<p>* Source of calcium. Calcium is needed for the maintenance of normal bones. A varied and balanced diet and a healthy lifestyle are recommended for good health.</p>\r\n\r\n<h3>Benefits</h3>\r\n\r\n<ul>\r\n	<li>Naturally Lactose-Free</li>\r\n	<li>100% plant-based</li>\r\n	<li>Vegetarian &amp; Vegan</li>\r\n	<li>Naturally low in saturated fat</li>\r\n	<li>Low in sugars</li>\r\n	<li>Rich in Fibre</li>\r\n	<li>Source of high-quality protein</li>\r\n</ul>', '<table>\r\n	<caption>100ml</caption>\r\n	<tbody>\r\n		<tr>\r\n			<th colspan=\\\"1\\\">Energy</th>\r\n			<td>239 kJ / 57 kcal</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"1\\\">Fat</th>\r\n			<td>2.8 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"1\\\">Saturates</th>\r\n			<td>0.5 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"1\\\">Mono-Unsaturates</th>\r\n			<td>0.6 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"1\\\">Polyunsaturates</th>\r\n			<td>1.7 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"1\\\">Carbohydrate</th>\r\n			<td>2.5 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"1\\\">Sugars</th>\r\n			<td>2.5 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"1\\\">Fibre</th>\r\n			<td>0.9 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"1\\\">Protein</th>\r\n			<td>5 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"1\\\">Salt</th>\r\n			<td>0.1 g</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"2\\\">Minerals</th>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"1\\\">Calcium</th>\r\n			<td>120 mg</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<ul>\r\n	<li>Fat2.8 g4 %</li>\r\n	<li>Salt0.1 g2 %</li>\r\n	<li>Energy57 kcal3 %</li>\r\n	<li>Sugars2.5 g3 %</li>\r\n	<li>Saturates0.5 g2 %</li>\r\n</ul>\r\n\r\n<p>*&nbsp;Reference intake of an average adult (8 400 kJ / 2 000 kcal)</p>\r\n\r\n<p>Ingredients</p>\r\n\r\n<p><strong>Soya</strong>&nbsp;base (Water, Hulled&nbsp;<strong>soya</strong>&nbsp;beans (13.1%)), Sugar, Acidity regulator (Potassium phosphates), Calcium (Calcium carbonate), Flavouring, Sea salt, Stabiliser (Gellan gum), Vitamins (B2, B12, D2).</p>\r\n\r\n<p>Allergies</p>\r\n\r\n<p>&nbsp;Gluten free.</p>\r\n\r\n<p>Naturally lactose free &amp; dairy free</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
