(356, 134, 1, 'Barebells Double bite Protein Bar', '<p>Double Bite contains two individual bars within each packet, making it easy to share but too tasty to want to!&nbsp;The new snack is available in a duo of delicious flavours:</p>\r\n\r\n<p><strong>Caramel Crisp</strong>&nbsp;features a smooth caramel centre surrounded by puffed soy crisps and covered in milk chocolate.<br />\r\n<strong>Chocolate Crisp</strong>&nbsp;contains a rich and crispy cocoa core,&nbsp;this too&nbsp;wrapped in a creamy layer of milk chocolate.</p>\r\n\r\n<p>True to Barebells&rsquo; ethos of snack alternatives that never compromise on flavour, it&rsquo;s hard to believe that both mouth-watering flavours are enriched with 16 grams of protein and contain no added sugar or palm oil.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(357, 134, 2, 'Barebells Double bite Protein Bar', '<p>Double Bite contains two individual bars within each packet, making it easy to share but too tasty to want to!&nbsp;The new snack is available in a duo of delicious flavours:</p>\r\n\r\n<p><strong>Caramel Crisp</strong>&nbsp;features a smooth caramel centre surrounded by puffed soy crisps and covered in milk chocolate.<br />\r\n<strong>Chocolate Crisp</strong>&nbsp;contains a rich and crispy cocoa core,&nbsp;this too&nbsp;wrapped in a creamy layer of milk chocolate.</p>\r\n\r\n<p>True to Barebells&rsquo; ethos of snack alternatives that never compromise on flavour, it&rsquo;s hard to believe that both mouth-watering flavours are enriched with 16 grams of protein and contain no added sugar or palm oil.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(358, 135, 1, 'Nestle Nesquik', '<ul>\r\n	<li>\r\n	<p>NESQUIK No Sugar Added Chocolate Flavored Powder turns milk into a treat that has the taste you love and the nutrition you need</p>\r\n	</li>\r\n	<li>\r\n	<p>Enjoy no sugar added chocolate powder with low-fat vitamin A &amp; D milk for calcium, 8 grams of protein, and 7 essential vitamins and minerals</p>\r\n	</li>\r\n	<li>\r\n	<p>Our chocolate flavored powder has no high fructose corn syrup, and is certified kosher.</p>\r\n	</li>\r\n</ul>', '', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(359, 135, 2, 'Nestle Nesquik', '<ul>\r\n	<li>\r\n	<p>NESQUIK No Sugar Added Chocolate Flavored Powder turns milk into a treat that has the taste you love and the nutrition you need</p>\r\n	</li>\r\n	<li>\r\n	<p>Enjoy no sugar added chocolate powder with low-fat vitamin A &amp; D milk for calcium, 8 grams of protein, and 7 essential vitamins and minerals</p>\r\n	</li>\r\n	<li>\r\n	<p>Our chocolate flavored powder has no high fructose corn syrup, and is certified kosher.</p>\r\n	</li>\r\n</ul>', '', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(360, 136, 1, 'Body Attack Choc N Dip', '<p>Body Attack Protein Choc`N Dip is a protein-focused snack that is made up of a delicious hazelnut cocoa cream and 13 crispy breadsticks that you can dip into the delicious cream. This snack is the ideal companion on the go - whether in the cinema, during an open-air event, in the office, or during sports. The small snack box fits perfectly in every handbag and sports bag. The Body Attack Protein Choc `N Dip is a delicious change to protein bars or protein spreads.</p>\r\n\r\n<p><strong>Product Highlights</strong></p>\r\n\r\n<ul>\r\n	<li>Delicious nutty-chocolate taste</li>\r\n	<li>With high-quality whey protein</li>\r\n	<li>Only 3.2 g of sugar per serving</li>\r\n	<li>Ideal for on the go or doing sports</li>\r\n	<li>Without palm oil</li>\r\n	<li>With cocoa butter and coconut oil</li>\r\n	<li>With a natural vanilla aroma</li>\r\n	<li>39 g cream plus 13 sticks</li>\r\n	<li>Made in Germany</li>\r\n</ul>', '<h2>SWEET SNACK WITH TOP NUTRITIONAL VALUES ​​</h2>\r\n\r\n<p><br />\r\nThe special feature of the snack is the added whey protein concentrate, which means that the snack delivers 100 g&nbsp;<strong>over 18 g of protein</strong>. It is a very high-quality whey protein, which is one of the best protein sources due to its high biological value. It provides a large amount of the 8 essential amino acids that can be used to maintain and build muscle</p>\r\n\r\n<h2>SWEET SNACK WITH TOP NUTRITIONAL VALUES ​​</h2>\r\n\r\n<p><br />\r\nThe special feature of the snack is the added whey protein concentrate, which means that the snack delivers 100 g&nbsp;<strong>over 18 g of protein</strong>. It is a very high-quality whey protein, which is one of the best protein sources due to its high biological value. It provides a large amount of the 8 essential amino acids that can be used to maintain and build muscle. Dip it. Snack it. Love it.<br />\r\n<br />\r\nWith&nbsp;<strong>3.2 g of sugar per serving&nbsp;</strong>(52g), this snack contains significantly less sugar than conventional comparison products, which contain approx. 22 g sugar per serving. With the addition of maltitol, a low-calorie sweetener, the BODY ATTACK Protein Choc `N Dip Snack not only impresses with its sweet taste but also has up to almost 10 times less sugar than some comparable snacks. Conventional snacks often contain over 30 g of carbohydrates per serving. The BODY ATTACK Choc `N Dip, on the other hand, contains&nbsp;<strong>only 22 g of carbohydrates per serving</strong>.<br />\r\n<br />\r\n<br />\r\nThe snack is not only suitable for people who want to gain bodyweight and muscle mass, but also for figure-conscious people who are looking for an alternative to sugar-rich snacks.<br />\r\n<br />\r\nSince palm oil is highly criticized, consumers are paying more and more attention to palm oil-free products. Therefore, this snack is ideal for people who want to avoid palm oil.<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<h2>THE CHOC `N DIPSTICKS SNACK WITH HIGH-QUALITY INGREDIENTS</h2>\r\n\r\n<p>The BODY ATTACK Protein Choc `N Dip Snack has more to offer than top nutritional values. Because high-quality ingredients such as 8% hazelnuts and 5% cocoa powder were used.<br />\r\n<br />\r\nInstead of the highly criticized palm oil, the extremely popular coconut oil, cocoa butter, and sunflower oil are used in the recipe. The delicious taste was rounded off with a natural vanilla aroma.</p>\r\n\r\n<p><br />\r\nWith&nbsp;<strong>3.2 g of sugar per serving&nbsp;</strong>(52g), this snack contains significantly less sugar than conventional comparison products, which contain approx. 22 g sugar per serving. With the addition of maltitol, a low-calorie sweetener, the BODY ATTACK Protein Choc `N Dip Snack not only impresses with its sweet taste but also has up to almost 10 times less sugar than some comparable snacks. Conventional snacks often contain over 30 g of carbohydrates per serving. The BODY ATTACK Choc `N Dip, on the other hand, contains&nbsp;<strong>only 22 g of carbohydrates per serving</strong>.<br />\r\n<br />\r\n<br />\r\nThe snack is not only suitable for people who want to gain bodyweight and muscle mass, but also for figure-conscious people who are looking for an alternative to sugar-rich snacks.<br />\r\n<br />\r\nSince palm oil is highly criticized, consumers are paying more and more attention to palm oil-free products. Therefore, this snack is ideal for people who want to avoid palm oil.<br />\r\n&nbsp;</p>\r\n\r\n<h2>THE CHOC `N DIPSTICKS SNACK WITH HIGH-QUALITY INGREDIENTS</h2>\r\n\r\n<p><img alt=\\\" Without Palm Oil \\\" src=\\\"https://www.body-attack.com/pictures%20/%20News%20/%20No-Palmoil.png\\\" style=\\\"width:100\\\" />The BODY ATTACK Protein Choc `N Dip Snack has more to offer than top nutritional values. Because high-quality ingredients such as 8% hazelnuts and 5% cocoa powder were used.<br />\r\n<br />\r\nInstead of the highly criticized palm oil, the extremely popular coconut oil, cocoa butter, and sunflower oil are used in the recipe. The delicious taste was rounded off with a natural vanilla aroma.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
