sp;<strong>only 22 g of carbohydrates per serving</strong>.<br />\r\n<br />\r\n<br />\r\nThe snack is not only suitable for people who want to gain bodyweight and muscle mass, but also for figure-conscious people who are looking for an alternative to sugar-rich snacks.<br />\r\n<br />\r\nSince palm oil is highly criticized, consumers are paying more and more attention to palm oil-free products. Therefore, this snack is ideal for people who want to avoid palm oil.<br />\r\n&nbsp;</p>\r\n\r\n<h2>THE CHOC `N DIPSTICKS SNACK WITH HIGH-QUALITY INGREDIENTS</h2>\r\n\r\n<p><img alt=\\\" Without Palm Oil \\\" src=\\\"https://www.body-attack.com/pictures%20/%20News%20/%20No-Palmoil.png\\\" style=\\\"width:100\\\" />The BODY ATTACK Protein Choc `N Dip Snack has more to offer than top nutritional values. Because high-quality ingredients such as 8% hazelnuts and 5% cocoa powder were used.<br />\r\n<br />\r\nInstead of the highly criticized palm oil, the extremely popular coconut oil, cocoa butter, and sunflower oil are used in the recipe. The delicious taste was rounded off with a natural vanilla aroma.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(362, 137, 1, 'Body Attack Protein Coffee Drink', '<p>&nbsp;</p>\r\n\r\n<h1>BODY ATTACK<br />\r\nPROTEIN COFFEE&nbsp;250ML</h1>\r\n\r\n<p>Maximum enjoyment for coffee lovers, fitness fans, and caffeine junkies: Our Protein Coffee makes a sip better every morning. The&nbsp;<strong>ice-cooled mix of 100% Arabica beans</strong>, high-quality milk protein, and lots of caffeine ensures this. Our fat-free coffee refreshment is a really good coffee. The best-iced coffee on the market, we think. Full-bodied in taste.&nbsp;<strong>No added sugar and no fat.&nbsp;</strong>And the best thing is: we deliver the strongly aromatic coffee pleasure with feather-light 58 kcal directly to your home - accompanied by&nbsp;<strong>25 g protein per can</strong>. Because we love coffee. And protein.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Protein Coffee is perfectly suited for these goals:</strong></p>\r\n\r\n<ul><br />\r\n	<li>Muscle growth and preservation</li>\r\n	<li>Figure-conscious nutrition / diet</li>\r\n	<li>Healthy, high-protein diet</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>For whom is our iced coffee just the right thing:</strong></p>\r\n\r\n<ul>\r\n	<li>For coffee lovers who like ice-cold caffeinated protein sources</li>\r\n	<li>For figure-conscious people who appreciate fat-free and low-calorie drinks</li>\r\n	<li>For athletes who like high protein in coffee form</li>\r\n	<li>For all caffeine junkies</li>\r\n</ul>', '<h2>LOW-CALORIE COFFEE DRINK WITH NO ADDED SUGAR</h2>\r\n\r\n<p>Whether early in the morning, after long meetings or in the evening before a workout: The&nbsp;<strong>ice-cooled mix of Arabica coffee beans and high-quality milk protein</strong>&nbsp;make our Protein Coffee the absolute favourite drink. In contrast to conventional calorie and sugar bombs from the refrigerated shelf, our&nbsp;<strong>Protein Coffee with 58 kcal</strong>&nbsp;per 100 ml fits perfectly into your figure-conscious diet. Unsweetened and unadulterated. For indulgence without compromise, we do completely without refined household sugar. Our fitness caffeine drink owes its real sweetness to natural lactose from skimmed milk and&nbsp;<a href=\\\"https://www.body-attack.com/whey-protein.html\\\">milk protein</a>&nbsp;and the sweetener sucralose.<br />\r\n&nbsp;</p>\r\n\r\n<h2>ICE-COLD ENJOYMENT: CAFFEINE MEETS MILK PROTEIN</h2>\r\n\r\n<p>Our iced coffee contains the&nbsp;<strong>best Arabica coffee beans</strong>. And of course 100%. The beans are processed to the highest quality - so that all the precious flavours make it into the can.&nbsp;<strong>For the special kick, 75 mg of caffeine per can</strong>&nbsp;is responsible. Caffeine has a proven effect on your concentration and attention. You can also boost your endurance with our Good Morning Coffee*. The high protein content of 25 g of milk protein from whey and casein ensures your daily protein supply and supports you in&nbsp;<a href=\\\"https://www.body-attack.com/muscle-building-proteins.html\\\">muscle growth</a>. By the way, our Protein Coffee contains as much protein as conventional protein shakes. If you like protein shakes with a strong coffee flavour, why not try our iced coffee!</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0);
