(366, 139, 1, 'Quest Tortilla style Protein Chips', '<p>Quest tortilla chip you can enjoy any time? Lucky you! We made Quest&nbsp;Tortilla Style Protein Chips to feed your craving with protein and Yummy flavors.</p>\r\n\r\n<table border=\\\"0\\\" cellpadding=\\\"0\\\" cellspacing=\\\"0\\\">\r\n	<tbody>\r\n		<tr>\r\n			<td>18g</td>\r\n			<td>4g</td>\r\n			<td>&lt;1g</td>\r\n			<td>1g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protein</td>\r\n			<td>Net Carbs*</td>\r\n			<td>Sugar</td>\r\n			<td>Fiber</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Highlights</h3>\r\n\r\n<ul>\r\n	<li>18g Protein per serving</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>4g Net Carbs per serving*</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Baked - never fried</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>All natural, gluten free, potato free</li>\r\n</ul>\r\n\r\n<ul>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '<h2>Nutrition information</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Refer to the product label for full dietary information, which may be available as an alternative product image.</p>\r\n\r\n<p>1 serving per container</p>\r\n\r\n<p>Serving Size1 bag (32g)</p>\r\n\r\n<p>Amount per serving</p>\r\n\r\n<p>Calories140</p>\r\n\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th scope=\\\"col\\\">Amount per serving</th>\r\n			<th scope=\\\"col\\\">% Daily Value*</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Total Fat&nbsp;6g</td>\r\n			<td>8%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Saturated Fat1g</td>\r\n			<td>5%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Trans Fat0g</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cholesterol&nbsp;10mg</td>\r\n			<td>3%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sodium&nbsp;340mg</td>\r\n			<td>15%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Total Carbohydrate&nbsp;5g</td>\r\n			<td>2%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Dietary Fiber1g</td>\r\n			<td>4%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sugars1g</td>\r\n			<td>0%</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Includes Added Sugars0g</td>\r\n			<td>&nb