(370, 141, 1, 'Protein Pretzel Twists', '<h2>Protein Pretzel Twists</h2>\r\n\r\n<p>.Whether you need a crunchy protein snack to tide you over between meals or to fuel your muscles after a hard workout, our healthy, diet-optimized Pretzel Twists are the best choice for you. Delicious and satisfying, this salty crunchy snack brings you all the goodness of traditional salty pretzels without the excess of calories and carbs. Every 120-calorie serving supplies 12 grams of quality protein and 4 grams of fiber and has a low 11 grams of carbs, making these an excellent alternative to the less weight loss-friendly snacks. Enjoy our Pretzel Twists straight out of the bag or serve with hummus or low-fat cheese for a complete meal replacement. Enjoy!&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Product Highlights:</strong></p>\r\n\r\n<ul>\r\n	<li>12 grams high protein per serving</li>\r\n	<li>120 calories</li>\r\n	<li>4 grams of high fiber per serving</li>\r\n	<li>Aspartame free</li>\r\n	<li>Lactose-free</li>\r\n	<li>Kosher</li>\r\n	<li>IPA Unrestricted</li>\r\n	<li>Enjoy as an on the go snack</li>\r\n</ul>', '<p>Ingredents:&nbsp;Soy Protein Isolate, Wheat Flour, Modified Wheat Starch, Soy Flour, Butter (From Milk), Wheat Gluten, Wheat Protein Isolate, Corn Syrup, Malt Syrup, Pectin, Salt, Baking Powder, Soy Lecithin, Natural Flavors, Yeast.</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
