(372, 142, 1, 'Santiveri Digestive Biscuits Coated With Milk Chocolate', '<p>Santiveri biscuits are perfect for people on a low-sugar diet. They are soft and delicious yet good for you at the same time.</p>\r\n\r\n<p>This whole-grain digestive biscuit contains folic acid and healthy olive oil with pieces of chocolate. They are an excellent alternative to traditional, sugar-filled biscuits.</p>\r\n\r\n<ul>\r\n	<li>Sugar-free milk chocolate biscuits</li>\r\n	<li>Low in calories</li>\r\n	<li>Healthy Spanish cookies</li>\r\n</ul>', '<p><strong>Ingredients:</strong><br />\r\nwholemeal wheat Flour (51.4%) milk chocolate covering 18% (sweeteners [maltitol, estevol glucosides] (7.2%), whole milk in powder cocoa butter, cocoa paste, emulsifier (soy lecithin, polyglycerol polyricinleate) vanilla natural flavouring), sweetener [maltitol syrup (14.7%]), vegetable oils (sun flower olive)(9%) oat flour, salt, emulsifier (sunflower lecithin, colour (plain caramel), leavening agents (sodium bicarbonate, ammonium bicarbonate). flavouring (artificial vanilla, butter flavor), antioxdant (tocopherol rich extract), folic acid.&not;&dagger;</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
