(374, 143, 1, 'Santiveri Digestive Biscuits', '<p>Santiveri Digestive Wholemeal Biscuits Original. Sugar-free. With sweetener. Lactose-free. Free from dairy derivates. Egg-free. Enriched with folic acid. High monosaturated fat. Palm oil-free.&nbsp;</p>\r\n\r\n<p>Always a popular treat, a&nbsp;cracker or biscuit has been keeping people satisfied in between meals for decades. Whether it&rsquo;s a chunky chocolate chip cookie or perhaps a savory rice cake, it&rsquo;s good to have something close at hand that hits the hunger spot and with&nbsp;a huge variety to choose from, you are certain to find your favorite.&nbsp;</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
