(376, 144, 1, 'Milkyway Hi Protein Bar', '<p>For an out-of-this-world protein bar experience, you can now enjoy the light and delicious taste of the Milky Way, with a super galactic 15g of protein!</p>\r\n\r\n<p>Milky Way Hi-Protein bar boasts the unique light whipped nougat flavor of Milky Way, packed into two tasty chocolate-coated squares, containing 192 calories. This is one intergalactic new launch you are not going to want to miss!</p>', '<p>Container Size: 12x50g g Serving Size: 1 bar (50g)&nbsp;</p>\r\n\r\n<p>Per Serving&nbsp;</p>\r\n\r\n<p>Calories 192<br />\r\nProtein: 15g&nbsp;<br />\r\nCarbohydrates: 23g&nbsp;<br />\r\nFat: 4.5g&nbsp;<br />\r\nSalt: 0.2g</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ingredients: fluffy white centre (82%) (glucose syrup, milk protein, fructose syrup, collagen hydrolysate, palm fat, whey protein<strong>&nbsp;(milk)</strong>, natural flavouring, salt, colour plain caramel), milk chocolate (18%) (sugar, cocoa butter, skimmed milk powder, cocoa mass, palm fat, lactose&nbsp;<strong>(milk)</strong>, sweet whey powder&nbsp;<strong>(milk)</strong>, milk fat, whey protein<strong>&nbsp;(milk),</strong>&nbsp;emulsifier (soya lecithin), natural vanilla flavouring), Please Note: Nutritional facts and ingredients may vary slightly between flavours.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
