(380, 146, 1, 'Go Fitness Protein Waffle', '<h2>Go Fitness Protein Waffle</h2>\r\n\r\n<p>If you are looking for healthy and delicious snacks, you absolutely cannot miss the Go Fitness Protein Waffle! Soft waffles rich in proteins and without added sugars, perfect for giving a fit but tasty touch to your snacks or breakfasts. When you&#39;re in a hurry and hungry but don&#39;t want to go too far, unwrap your Protein Waffle and enjoy a snack that&#39;s as good as fresh from the oven!</p>\r\n\r\n<ul>\r\n	<li>11 g protein per waffle</li>\r\n	<li>0 added sugar</li>\r\n	<li>Ready to eat</li>\r\n	<li>Super soft!</li>\r\n</ul>\r\n\r\n<p>Protein Waffles are available in two delicious flavors: Double Chocolate and Vanilla</p>\r\n\r\n<p><strong>Double chocolate:</strong></p>\r\n\r\n<p>The soft waffles covered with delicious Belgian chocolate set a new accent on the fitness-oriented diet. The waffle batter is made with protein, whole wheat flour, and eggs. The coating of delicious Belgian milk chocolate.</p>\r\n\r\n<p><strong>Vanilla:</strong></p>\r\n\r\n<p>Fans of sweet fitness snacks will be delighted. The soft waffles set a new accent in fitness-oriented nutrition. The waffle batter is made of protein, whole wheat flour and eggs</p>\r\n\r\n<p>&nbsp;</p>', '<h2><strong>Nutritional information</strong></h2>\r\n\r\n<table style=\\\"width:333px\\\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Average values ​​for</strong></td>\r\n			<td><strong>For 50gr</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Power</td>\r\n			<td>205kcal</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fat</td>\r\n			<td>11gr</td>\r\n		</tr>\r\n		<tr>\r\n			<td>of which saturated</td>\r\n			<td>6gr</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Carbohydrates</td>\r\n			<td>18gr</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Of which sugars</td>\r\n			<td>0.4gr</td>\r\n		</tr>\r\n		<tr>\r\n			<td>polyols</td>\r\n			<td>11gr</td>\r\n		</tr>\r\n		<tr>\r\n			<td>fibers</td>\r\n			<td>2.6gr</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Proteins</td>\r\n			<td>12gr</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sodium</td>\r\n			<td>0.32gr</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>INGREDIENTS: Eggs, sweeteners: maltitol (18%); vegetable oils (rapeseed, coconut); wheat flour, collagen peptides (bovine), milk proteins, soy proteins, dietary fiber (fructooligosaccharide), soy flour, stabilizer: sorbitol, glycerol; modified corn starch, natural flavoring, leavening agent: diphosphates, sodium carbonate, and calcium phosphate; salt, emulsifier: soy lecithin and mono- and diglycerides of fatty acids; preservative: potassium sorbate; acidity regulator: citric acid and sodium acetate. It naturally contains sugars.</p>\r\n\r\n<p>It may contain traces of Cereals and derivatives, crustaceans, eggs, fish, peanuts, soy, milk, nuts, celery, mustard, sesame, lupins, and mollusks.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
