(382, 147, 1, 'Nutramino Protein Wafer', '<h2>Nutramino Protein Wafer</h2>\r\n\r\n<p><strong>Low sugar&nbsp;|&nbsp; 20%Source Of Protein | 200Calories | 2 X Wafers Per Pack</strong></p>\r\n\r\n<p>The new delicious and crisp, low-sugar protein&nbsp;wafers from Nutramino are the perfect snack on the go.&nbsp;They deliver both taste and texture.&nbsp; Each&nbsp;wafer&nbsp;contains quality protein and has a low sugar content and helps you tackle your daily protein needs and enjoy a healthy snack anytime during the day. The Nutramino wafers contain less than 200 calories per day. bportion, making them the perfect snack with low sugar content.&nbsp;Nutramino Protein Wafer is&nbsp;available in&nbsp;four delicious flavors: Chocolate, hazelnut, vanilla, and coconut.&nbsp;</p>', '<p><strong>Nutritional content per&nbsp;bar (39 g)</strong></p>\r\n\r\n<ul>\r\n	<li>Energy: 189 kcal / 785 kJ</li>\r\n	<li>Fat: 12 g\r\n	<ul>\r\n		<li>of which Saturates: 5.9 g</li>\r\n	</ul>\r\n	</li>\r\n	<li>Carbohydrates: 15 g\r\n	<ul>\r\n		<li>of which Sugars: 1 g</li>\r\n		<li>of which Polyols: 9 g</li>\r\n	</ul>\r\n	</li>\r\n	<li>Fibre: 2.1 g</li>\r\n	<li>Protein: 7.8 g</li>\r\n	<li>Salt: 0.11 g</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ingredients:</strong><br />\r\nSweeteners (Maltitol, Sucralose), Palm Oil, WHEY Protein Isolate [MILK], Maize Flour, Cocoa Nibs (6.9%), Starch, MILK Powder, Cocoa Butter, Bulking Agent (Polydextrose), ALMOND Paste, Dextrose, Fat-Reduced Cocoa Powder, Emulsifier (SOY Lecithin), Salt, Thickener (Guar Gum), Raising Agent (Ammonium Carbonate), Natural VanillaFlavouring, Antioxidant (Ascorbic Acid). For allergens see ingredients capitalised and bold. May Contain: Egg, Gluten, Sesame and other Nuts</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(383, 147, 2, 'Nutramino Protein Wafer', '<h2>Nutramino Protein Wafer</h2>\r\n\r\n<p><strong>Low sugar&nbsp;|&nbsp; 20%Source Of Protein | 200Calories | 2 X Wafers Per Pack</strong></p>\r\n\r\n<p>The new delicious and crisp, low-sugar protein&nbsp;wafers from Nutramino are the perfect snack on the go.&nbsp;They deliver both taste and texture.&nbsp; Each&nbsp;wafer&nbsp;contains quality protein and has a low sugar content and helps you tackle your daily protein needs and enjoy a healthy snack anytime during the day. The Nutramino wafers contain less than 200 calories per day. bportion, making them the perfect snack with low sugar content.&nbsp;Nutramino Protein Wafer is&nbsp;available in&nbsp;four delicious flavors: Chocolate, hazelnut, vanilla, and coconut.&nbsp;</p>', '<p><strong>Nutritional content per&nbsp;bar (39 g)</strong></p>\r\n\r\n<ul>\r\n	<li>Energy: 189 kcal / 785 kJ</li>\r\n	<li>Fat: 12 g\r\n	<ul>\r\n		<li>of which Saturates: 5.9 g</li>\r\n	</ul>\r\n	</li>\r\n	<li>Carbohydrates: 15 g\r\n	<ul>\r\n		<li>of which Sugars: 1 g</li>\r\n		<li>of which Polyols: 9 g</li>\r\n	</ul>\r\n	</li>\r\n	<li>Fibre: 2.1 g</li>\r\n	<li>Protein: 7.8 g</li>\r\n	<li>Salt: 0.11 g</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ingredients:</strong><br />\r\nSweeteners (Maltitol, Sucralose), Palm Oil, WHEY Protein Isolate [MILK], Maize Flour, Cocoa Nibs (6.9%), Starch, MILK Powder, Cocoa Butter, Bulking Agent (Polydextrose), ALMOND Paste, Dextrose, Fat-Reduced Cocoa Powder, Emulsifier (SOY Lecithin), Salt, Thickener (Guar Gum), Raising Agent (Ammonium Carbonate), Natural VanillaFlavouring, Antioxidant (Ascorbic Acid). For allergens see ingredients capitalised and bold. May Contain: Egg, Gluten, Sesame and other Nuts</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
