(388, 150, 1, 'Applied Nutrition ABE Ultimate Pre- Workout', '<h2>ABE - All Black Everything 315g</h2>\r\n\r\n<h2>ULTIMATE PRE-WORKOUT</h2>\r\n\r\n<h2>315G | 30 SERVINGS</h2>\r\n\r\n<h2>4G CITRULLINE | 3.25G CREATINE | 2G BETA-ALANINE | 100MG THEACRINE | VITAMINS B3 &amp; B12</h2>\r\n\r\n<p>ABE is the UK&#39;s best selling pre-workout, delivering a unique blend of the most vital and researched active ingredients known to help increase physical performance*, reduce tiredness &amp; fatigue* and provide continual focus throughout your training, maximizing your body&#39;s potential. However talk is cheap and the proof is in the product, after extensive research, meticulous formulating, and precise lab testing we are confident to let ABE do the talking.</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>* Creatine increases physical performance during high-intensity exercise</li>\r\n	<li>* Niacin contributes to the reduction of tiredness &amp; fatigue</li>\r\n	<li>Vitamin B12 contributes to normal red blood cell formation</li>\r\n	<li>Open your airways with Breathe Easy&trade; formula (Candy Ice Blast Flavour)</li>\r\n	<li>Added Vitamins B3 &amp; B12</li>\r\n	<li>Tested for Athletes</li>\r\n	<li>Halal Certified Product</li>\r\n</ul>\r\n\r\n<h3><br />\r\nSUGGESTED USE</h3>\r\n\r\n<p>Mix 1 serving 10.5g (1 level scoop) with 250ml of cold water and consume 15 minutes prior to exercise.</p>\r\n\r\n<p><em>*Scoops are estimated only, weighing scales are recommended.</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>TESTED FOR ATHLETES - GMP</h3>\r\n\r\n<p>Every ingredient within this batch undergoes rigorous scrutiny and testing for banned substances prior to production under a monitored programme. Final products then undergo random testing at an ISO 17025 accredited lab to provide the highest level of assurance that they are safer for athletes to use.</p>\r\n\r\n<h3><br />\r\nCAUTION</h3>\r\n\r\n<p>Check with a qualified health professional before using this product if you are under the age of 18, pregnant or nursing a baby, or if you have any known or suspected medical condition(s) and or are taking any prescription or OTC medication(s).&nbsp;<strong>Contains Caffeine (200mg per serving).</strong>&nbsp;This product should not be used in combination with caffeine or stimulants from other sources. Not to be used as a substitute for a varied diet and healthy lifestyle. Store this product in a cool dry place, away from children. Do not exceed the suggested use.</p>', '<p><img src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/New---ABE-315G-Nutritional-Information---1000x1000_480x480.jpg?v=1631613691\\\" /></p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
