product if you are under the age of 18, pregnant or nursing a baby, or if you have any known or suspected medical condition(s) and or are taking any prescription or OTC medication(s).&nbsp;<strong>Contains Caffeine (200mg per serving).</strong>&nbsp;This product should not be used in combination with caffeine or stimulants from other sources. Not to be used as a substitute for a varied diet and healthy lifestyle. Store this product in a cool dry place, away from children. Do not exceed the suggested use.</p>', '<p><img src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/New---ABE-315G-Nutritional-Information---1000x1000_480x480.jpg?v=1631613691\\\" /></p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(390, 151, 1, 'Applied Nutrition Glutamine Powder Micronized', '<h2>L-Glutamine Powder</h2>\r\n\r\n<h3>MICRONIZED</h3>\r\n\r\n<p>Glutamine is the most abundant Amino Acid within muscle tissue, however, when you train, Glutamine levels can be significantly reduced as muscle tissue breaks down &ndash; even more so with the bodybuilding style of training. Supplementing with Glutamine (in particular post-workout) can allow you to restore the depleted Glutamine levels.</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>Pure Pharmaceutical Grade Glutamine Powder</li>\r\n	<li>The most Abundant Amino Acid in Muscle Tissue</li>\r\n	<li>Conditionally Essential Amino Acid</li>\r\n	<li>Halal Certified Product</li>\r\n</ul>\r\n\r\n<h3><br />\r\nSUGGESTED USE</h3>\r\n\r\n<p>Consume 1 serving (5g), 1 to 3 times daily at mealtimes. For optimal results consume 1 serving post-training with water or juice.</p>', '<p><img src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/L-Glutamine-250g---Nutritionals---1000x1000_4fac0606-67d2-459c-9c5f-89ac67678bbb_480x480.jpg?v=1616494881\\\" /></p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(391, 151, 2, 'Applied Nutrition Glutamine Powder Micronized', '<h2>L-Glutamine Powder</h2>\r\n\r\n<h3>MICRONIZED</h3>\r\n\r\n<p>Glutamine is the most abundant Amino Acid within muscle tissue, however, when you train, Glutamine levels can be significantly reduced as muscle tissue breaks down &ndash; even more so with the bodybuilding style of training. Supplementing with Glutamine (in particular post-workout) can allow you to restore the depleted Glutamine levels.</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>Pure Pharmaceutical Grade Glutamine Powder</li>\r\n	<li>The most Abundant Amino Acid in Muscle Tissue</li>\r\n	<li>Conditionally Essential Amino Acid</li>\r\n	<li>Halal Certified Product</li>\r\n</ul>\r\n\r\n<h3><br />\r\nSUGGESTED USE</h3>\r\n\r\n<p>Consume 1 serving (5g), 1 to 3 times daily at mealtimes. For optimal results consume 1 serving post-training with water or juice.</p>', '<p><img src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/L-Glutamine-250g---Nutritionals---1000x1000_4fac0606-67d2-459c-9c5f-89ac67678bbb_480x480.jpg?v=1616494881\\\" /></p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(392, 152, 1, 'Applied Nutrition L carnitine 3000 mg liquid', '<h1>L-Carnitine 3000&nbsp;Liquid</h1>\r\n\r\n<h2>3000MG L-CARNITINE | 50MG GREEN TEA | VITAMIN C</h2>\r\n\r\n<p>Applied Nutrition&rsquo;s L-Carnitine Liquid supplement containing 50mg of Green Tea Extract and 3000mg of L-Carnitine per 15ml per serving.<br />\r\n<br />\r\nL-Carnitine plays a critical metabolic role in stimulating weight loss as it helps transport fats to the Mitochondria where they are burned for energy. Clinical research has shown L-Carnitine supports athletic performance and endurance. Through a greater reliance on fat for energy, the body reduces the depletion of muscle Glycogen.<br />\r\n<br />\r\nThis combined with the reduction of Lactic Acid accumulation in muscles can extend exercise capacity before fatigue.</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>3000mg L-Carnitine Per Serving</li>\r\n	<li>50mg Green Tea Extract Per Serving</li>\r\n	<li>Essential Amino Acid</li>\r\n	<li>Suitable for Vegans</li>\r\n	<li>Halal Certified</li>\r\n</ul>\r\n\r\n<h3><br />\r\nSUGGESTED USE</h3>\r\n\r\n<p>Shake before use. Consume one serving (15ml tablespoon) of L-Carnitine liquid daily.<br />\r\n&nbsp;</p>\r\n\r\n<h3>CAUTION</h3>\r\n\r\n<p>Food supplements should not be used as a substitute for a varied diet. Store in a cool dry place. Store out of reach of children.</p>\r\n\r\n<h3><br />\r\nTESTED FOR ATHLETES</h3>\r\n\r\n<p>Every batch of this product is tested for banned substances under a monitored programme. Products undergo rigorous testing at an ISO 17025 accredited lab to provide the highest level of assurance that they are safer for athletes to use.</p>\r\n\r\n<h3><br />\r\nGMP</h3>\r\n\r\n<p>This product was manufactured in a GMP facility under strict quality control to assure consistent high quality that meets the requirements of the marketing authorization (MA) or product specification.</p>', '<p><img src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/L-Carnitine-Liquid---Nutritionals-_All-Flavours_---1000x1000_480x480.jpg?v=1616420760\\\" /></p>', NULL, 0, '', NULL, NULL, '', NULL, NULL);
