rnitine-Liquid---Nutritionals-_All-Flavours_---1000x1000_480x480.jpg?v=1616420760\\\" /></p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(394, 153, 1, 'X50 Green Tea + Resveratrol', '<h2>X50 Green Tea + Resveratrol</h2>\r\n\r\n<p><strong>UNIQUE BLEND&nbsp;</strong>Green tea is considered one of the world best superfoods and for good reason! It provides the body with diverse and powerful antioxidants that work for overall wellbeing. Our formula works hard to provide a source of clean energy, boost to your metabolism and resveratrol provides anti-ageing properties.</p>\r\n\r\n<p><strong>HANDY SINGLE-SERVE SACHETS&nbsp;</strong>Never be without your precious Green Tea X50. Stash some sachets in your handbag, gym bag or work bag!</p>\r\n\r\n<p>Why are people all over the world adding a sachet of Green Tea X50 to chilled water? Because they want to squeeze every last drop out of their day and feel good while doing it. Green Tea X50 is your go-to for a boost of clean energy, extra antioxidants (because you can never have too many!) and a healthy dose of green tea that works to boost your metabolism.</p>\r\n\r\n<p>We also can&rsquo;t forget to mention one of our star ingredients, resveratrol! Resveratrol is a super antioxidant commonly found in grapes (and the reason why they say red wine is good for you!). We added Resveratrol to our formula to boost anti-ageing and protect against free radicals</p>', '<p>Nutritional Information &amp; Ingredients</p>\r\n\r\n<p>Contains approx. 84 mg of caffeine, the equivalent of an instant coffee*</p>\r\n\r\n<table border=\\\"0\\\" cellpadding=\\\"1\\\" cellspacing=\\\"1\\\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\\\"3\\\"><strong>NUTRITIONAL INFORMATION</strong>&nbsp;- X50 GREEN TEA + RESVERATROL&nbsp;ASSORTED</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\\\"3\\\">Serving size: 3g sachet</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>Average Quantity<br />\r\n			Per Serving</td>\r\n			<td>Average Quantity<br />\r\n			Per 100g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Energy</td>\r\n			<td>28&nbsp;kJ</td>\r\n			<td>943 kJ</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>7&nbsp;Cal</td>\r\n			<td>226 Cal</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protein</td>\r\n			<td>0.2 g</td>\r\n			<td>8.0&nbsp;g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>- Gluten</td>\r\n			<td>0.0 g</td>\r\n			<td>0.0 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fat, Total</td>\r\n			<td>0.0 g</td>\r\n			<td>0.0 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>- Saturated</td>\r\n			<td>0.0 g</td>\r\n			<td>0.0 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Carbohydrate</td>\r\n			<td>1.6 g</td>\r\n			<td>52.4 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>- Sugars</td>\r\n			<td>0.0 g</td>\r\n			<td>0.0 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sodium</td>\r\n			<td>3.3&nbsp;mg</td>\r\n			<td>110.0&nbsp;mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\\\"3\\\"><br />\r\n			<strong>INGREDIENTS:</strong>&nbsp;Green Tea Extract (39%), Fallopia Japonica (5.4%), Maltodextrin, Food Acid (Malic Acid and Citric Acid),&nbsp;Sweetener (Xylitol), Natural Flavour,&nbsp;Ascorbic Acid (Vitamin C), Alfalfa Powder, Pepper, Colour.<br />\r\n			&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\\\"3\\\">Do not use if seal is broken. Store below 30&deg;C in a cool, dry place.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
