(396, 154, 1, 'X50 Raw Vegan Organic Protein', '<p>X50 Raw Organic Chocolate Vegan protein is&nbsp;packed with over 4.5g of naturally occurring BCAA&rsquo;s, superfood extracts and added L-Carnitine for enhancing fat utilisation throughout the day and after exercise.</p>\r\n\r\n<p>Utilising a blend of Yellow Pea Protein concentrate with Organic Brown Rice concentrate, X50 Raw Vegan Blend contains 18 naturally occurring amino acids, is low sugar and is only 5% fat, as well as having a high-quality organic ancient&nbsp;grain blend to ensure optimal nutrition is achieved.</p>\r\n\r\n<ul>\r\n	<li><strong>No artificial flavours</strong></li>\r\n	<li><strong>No artificial sweeteners</strong></li>\r\n	<li><strong>No gluten</strong></li>\r\n</ul>\r\n\r\n<p><strong>Yellow Pea Protein</strong></p>\r\n\r\n<p>Pea protein is a dairy and gluten free high-quality protein source with high naturally occurring branched chain amino acids and comprises 65% of the protein blend in X50.</p>\r\n\r\n<p><strong>Organic Brown Rice</strong></p>\r\n\r\n<p>Organic Brown Rice protein is a high recovery amino acid yielding protein source that is dairy and gluten free, providing a high percentage of BCAA&rsquo;s and is great for maximising muscle recovery.</p>\r\n\r\n<p><strong>Superfood Blend</strong></p>\r\n\r\n<p>Utilising a nutrient dense superfood blend like the one in x50 ensures optimal health by providing a high dose of naturally occurring antioxidants, vitamins and minerals, to ensure immune health, cell health and general bodily functions are maintained optimally.</p>\r\n\r\n<p>Consuming high-quality antioxidants has been shown to reduce the negative effects of free radicals, which increase with stressors such as life and exercise, such as decreased systemic inflammation and improved immunity markers.</p>', '<table border=\\\"0\\\" cellpadding=\\\"1\\\" cellspacing=\\\"1\\\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\\\"3\\\"><strong>NUTRITIONAL INFORMATION</strong>&nbsp;</td>\r\n		</tr>\