0 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Methionine</td>\r\n			<td>292 mg</td>\r\n			<td>1170 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Phenylalanine</td>\r\n			<td>1100 mg</td>\r\n			<td>4380 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Threonine</td>\r\n			<td>830 mg</td>\r\n			<td>3320 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tryptophan</td>\r\n			<td>243 mg</td>\r\n			<td>917 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Valine</td>\r\n			<td>1150 mg</td>\r\n			<td>4600 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Alanine</td>\r\n			<td>945 mg</td>\r\n			<td>3780 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Aspartic Acid</td>\r\n			<td>2390 mg</td>\r\n			<td>9570 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cysteine</td>\r\n			<td>305 mg</td>\r\n			<td>1220 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Glutamic Acid</td>\r\n			<td>3720 mg</td>\r\n			<td>14900 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Glycine</td>\r\n			<td>832 mg</td>\r\n			<td>3330 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Proline</td>\r\n			<td>1010 mg</td>\r\n			<td>4040 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Serine</td>\r\n			<td>1110 mg</td>\r\n			<td>4440 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tyrosine</td>\r\n			<td>820 mg</td>\r\n			<td>3280 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Arginine</td>\r\n			<td>1770 mg</td>\r\n			<td>7070 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\\\"3\\\">\r\n			<p>&nbsp;</p>\r\n\r\n			<p>This product is sold by weight contents may settle.</p>\r\n\r\n			<p>Store below 30&ordm;C in cool dry place. MADE IN AUSTRALIA from local and imported ingredients.</p>\r\n\r\n			<p><br />\r\n			<strong>INGREDIENTS:</strong>&nbsp;YELLOW PEA PROTEIN CONCENTRATE (64%), ORGANIC BROWN RICE PROTEIN CONCENTRATE (23%), COCOA (7%), NATURAL FLAVOURS, NATURAL SWEETENERS (1.5%) (XYLITOL, STEVIA), SUPERFOOD BLEND (0.7%) (ORGANIC FREEZE DRIED ACAI, CAMU CAMU, ORGANIC GOJI BERRY, SEA BUCKTHORN JUICE, L-CARNITINE, GREEN COFFEE EXTRACT (0.1%), GREEN TEA EXTRACT (0.1%)), ORGANIC ANCIENT GRAINS BLEND (0.5%) (ORGANIC AMARANTH, ORGANIC QUINOA, ORGANIC BUCKWHEAT, ORGANIC MILLET, ORGANIC CHIA).</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\\\"3\\\">\r\n			<p><strong>Formulated Supplementary Sports Food.</strong>&nbsp;This product is not to be used as a sole source of nutrition. It must be used in conjunction with a nutritious diet and appropriate physical training program.</p>\r\n\r\n			<p>Not suitable for children under 15 years of age or pregnant women: Should only be used under medical or dietetic supervision.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(398, 155, 1, 'Applied Nutrition Cla, L-carnitine & Green Tea Softgel', '<h2>CLA, L-Carnitine &amp; Green Tea</h2>\r\n\r\n<p><strong>100 SOFTGELS | 140G | 50 SERVINGS</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&bull; 1300mg CLA<br />\r\n&bull; 330mg L-Carnitine<br />\r\n&bull; 310mg Green Tea Extract</strong></p>\r\n\r\n<p>CLA, L-Carnitine &amp; Green Tea is ideal for anyone looking to improve their body composition in conjunction with a balanced diet and regular exercise. A compound product that contains a naturally occurring fatty acid CLA (Conjugated Linoleic Acid), highly absorbed L-Carnitine Tartrate and concentrated Green Tea Extract (Camellia Sinensis) in easy-to-swallow softgels.</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>Popular amongst weight&nbsp;loss diet plans</li>\r\n	<li>Plant based veggie softgel well suited for consumers with dietary, religious or cultural restrictions</li>\r\n	<li>Suitable for vegetarians &amp; vegans</li>\r\n	<li>Halal certified product</li>\r\n</ul>\r\n\r\n<h3><br />\r\nSUGGESTED USE</h3>\r\n\r\n<p>Take 2 softgels 1 to 3 times daily with meals.</p>', '<h3>NUTRITIONAL INFORMATION</h3>\r\n\r\n<p><img src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/CLA_-L-Carnitine-_-Green-Tea---Nutritionals---1000x1000_600x600.jpg?v=1655715658\\\" /></p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(399, 155, 2, 'Applied Nutrition Cla, L-carnitine & Green Tea  Softgel', '<h2>CLA, L-Carnitine &amp; Green Tea</h2>\r\n\r\n<h3>100 SOFTGELS | 140G | 50 SERVINGS</h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>&bull; 1300mg CLA<br />\r\n&bull; 330mg L-Carnitine<br />\r\n&bull; 310mg Green Tea Extract</h3>\r\n\r\n<p>CLA, L-Carnitine &amp; Green Tea is ideal for anyone looking to improve their body composition in conjunction with a balanced diet and regular exercise. A compound product that contains a naturally occurring fatty acid CLA (Conjugated Linoleic Acid), highly absorbed L-Carnitine Tartrate and concentrated Green Tea Extract (Camellia Sinensis) in easy-to-swallow softgels.</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>Popular amongst weight&nbsp;loss diet plans</li>\r\n	<li>Plant based veggie softgel well suited for consumers with dietary, religious or cultural restrictions</li>\r\n	<li>Suitable for vegetarians &amp; vegans</li>\r\n	<li>Halal certified product</li>\r\n</ul>\r\n\r\n<h3><br />\r\nSUGGESTED USE</h3>\r\n\r\n<p>Take 2 softgels 1 to 3 times daily with meals.</p>', '<h3>NUTRITIONAL INFORMATION</h3>\r\n\r\n<p><img src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/CLA_-L-Carnitine-_-Green-Tea---Nutritionals---1000x1000_600x600.jpg?v=1655715658\\\" /></p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(400, 156, 1, 'Iwon Organic Protein Stix', '<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>pure organic ingredients:</strong>&nbsp;our crunchy protein stix are formulated with plant-based proteins, and blend the highest quality Non-GMO, soy-free, gluten-free, and kosher ingredients.</li>\r\n	<li><strong>optimal nutritional profile:</strong>&nbsp;10g protein. 5g fiber. Only 1g sugar. Only 180 Calories. All without sacrificing the flavor or crunch you crave.</li>\r\n	<li><strong>on-the-go snacking:</strong>&nbsp;a convenient and tasty high protein snack for anyone living an active lifestyle. sustain your energy levels all day long as you work and play.</li>\r\n	<li><strong>something for everyone:</strong>&nbsp;from fitness enthusiasts looking for a muscle-building snack, to kids and families who know that nutritious should also mean delicious. these stix are for you.</li>\r\n	<li><strong>newly formulated:</strong>&nbsp;aa reinvented snack for your healthy lifestyle. We&rsquo;ve infused our wholesome ingredients with a bold cheesy flavor.</li>\r\n</ul>', '', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(401, 156, 2, 'Iwon Organic Protein Stix', '<p>High in protein. high in fiber. our&nbsp;nacho cheese flavor captures the classic nacho bowl of hot cheesy goodness.</p>\r\n\r\n<ul>\r\n	<li><strong>pure organic ingredients:</strong>&nbsp;our crunchy protein stix are formulated with plant-based proteins, and blend the highest quality Non-GMO, soy-free, gluten-free, and kosher ingredients.</li>\r\n	<li><strong>optimal nutritional profile:</strong>&nbsp;10g protein. 5g fiber. Only 1g sugar. Only 180 Calories. All without sacrificing the flavor or crunch you crave.</li>\r\n	<li><strong>on-the-go snacking:</strong>&nbsp;a convenient and tasty high protein snack for anyone living an active lifestyle. sustain your energy levels all day long as you work and play.</li>\r\n	<li><strong>something for everyone:</strong>&nbsp;from fitness enthusiasts looking for a muscle-building snack, to kids and families who know that nutritious should also mean delicious. these stix are for you.</li>\r\n	<li><strong>newly formulated:</strong>&nbsp;aa reinvented snack for your healthy lifestyle. We&rsquo;ve infused our wholesome ingredients with a bold cheesy flavor.</li>\r\n</ul>', '', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(402, 157, 1, 'Applied Nutrition Amino fuel EAAs', '<h2>Amino Fuel EAA</h2>\r\n\r\n<h3>ESSENTIAL AMINO ACIDS</h3>\r\n\r\n<h3>390G | 30 SERVINGS</h3>\r\n\r\n<p>Amino Fuel is the perfect optimal blend delivering 11g of aminos per serving, 9g of which are Essential Amino Acids (EAA) including 6g of Branched Chain Amino Acids (BCAAs) at a 2:1:1 ratio (3000mg L-Leucine, 1500mg L-Isoleucine, 1500mg L-Valine) with an additional 2500mg of L-Glutamine.<br />\r\n<br />\r\nAmino Acids are complex chemicals that are the building blocks of protein. Essential Amino Acids (EAA) cannot be synthesised or created by the body and therefore must be supplied from the diet.<br />\r\n<br />\r\nAmino Fuel can be consumed 24 hours a day or when extra amino intake is required, such as any form of exercise or activity.</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>11g of aminos per serving</li>\r\n	<li>Open your airways with Breathe Easy&trade; formula (Candy Ice Blast Flavour)</li>\r\n	<li>Building blocks of protein</li>\r\n	<li>Tested for athletes</li>\r\n	<li>Amazing taste &amp; easy mixing</li>\r\n	<li>Halal certified product</li>\r\n</ul>\r\n\r\n<h3><br />\r\nSUGGESTED USE</h3>\r\n\r\n<p>Mix 1 scoop (13g) with 500ml of water and shake well. Consume before, during and post-workout or anytime during the day when amino intake is required.<br />\r\n<br />\r\nScoops are estimate only, weighing scales are recommended.</p>', '<p>NUTRITIONAL INFORMATION</p>\r\n\r\n<p><img src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/Amino-Fuel-390g---Nutritionals---1000x1000_600x600.jpg?v=1656412551\\\" /></p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(403, 157, 2, 'Applied Nutrition Amino fuel EAAs', '<h2>Amino Fuel EAA</h2>\r\n\r\n<h3>ESSENTIAL AMINO ACIDS</h3>\r\n\r\n<h3>390G | 30 SERVINGS</h3>\r\n\r\n<p>Amino Fuel is the perfect optimal blend delivering 11g of aminos per serving, 9g of which are Essential Amino Acids (EAA) including 6g of Branched Chain Amino Acids (BCAAs) at a 2:1:1 ratio (3000mg L-Leucine, 1500mg L-Isoleucine, 1500mg L-Valine) with an additional 2500mg of L-Glutamine.<br />\r\n<br />\r\nAmino Acids are complex chemicals that are the building blocks of protein. Essential Amino Acids (EAA) cannot be synthesised or created by the body and therefore must be supplied from the diet.<br />\r\n<br />\r\nAmino Fuel can be consumed 24 hours a day or when extra amino intake is required, such as any form of exercise or activity.</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>11g of aminos per serving</li>\r\n	<li>Open your airways with Breathe Easy&trade; formula (Candy Ice Blast Flavour)</li>\r\n	<li>Building blocks of protein</li>\r\n	<li>Tested for athletes</li>\r\n	<li>Amazing taste &amp; easy mixing</li>\r\n	<li>Halal certified product</li>\r\n</ul>\r\n\r\n<h3><br />\r\nSUGGESTED USE</h3>\r\n\r\n<p>Mix 1 scoop (13g) with 500ml of water and shake well. Consume before, during and post-workout or anytime during the day when amino intake is required.<br />\r\n<br />\r\nScoops are estimate only, weighing scales are recommended.</p>', '<h3>NUTRITIONAL INFORMATION</h3>\r\n\r\n<p><img src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/Amino-Fuel-390g---Nutritionals---1000x1000_600x600.jpg?v=1656412551\\\" /></p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(404, 158, 1, 'Fulfil Protein Bar With Vitamins', '<h3>Fulfil Protein Bar With Vitamins</h3>\r\n\r\n<p>FULFIL bars are packed with high protein, vitamins, and low sugar and come in a range of delicious flavours, from Salted Caramel right through to Chocolate Brownie.</p>\r\n\r\n<p><strong>Low Sugar&nbsp;&nbsp;|&nbsp;High Protein |&nbsp;Taste Great</strong></p>\r\n\r\n<ul>\r\n	<li>FULFIL bar is packed with 20g of protein.</li>\r\n	<li>FULFIL bars contain 9 multi vitamins which can help reduce tiredness and boost your metabolism.</li>\r\n	<li>FULFIL bars are low in sugar. Each 55g bar has less than&nbsp;<strong>half a teaspoon of sugar.</strong>&nbsp;A typical 55g bar of chocolate has 7 times as much.</li>\r\n	<li>All of our bars are coated in chocolate making FULFIL the perfect snack! TIP: we go great with a cup of tea/ coffee.</li>\r\n</ul>', '<h2>Nutrition facts</h2>\r\n\r\n<p>Per bar</p>\r\n\r\n<p>&nbsp;Nutritional Value Per 55g</p>\r\n\r\n<p>Calories&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;204kcal</p>\r\n\r\n<p>Carbohydrates&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;15g</p>\r\n\r\n<p>Sugar&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1.7g</p>\r\n\r\n<p>Added Sugar&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 0g</p>\r\n\r\n<p>Protein&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;36.3g</p>\r\n\r\n<p>Fat&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;