(405, 158, 2, 'Fulfil Protein Bar With Vitamins', '<p>FULFIL bars are packed with high protein, vitamins, and low sugar and come in a range of delicious flavours, from Salted Caramel right through to Chocolate Brownie.</p>\r\n\r\n<p><strong>Low Sugar&nbsp;&nbsp;|&nbsp;High Protein |&nbsp;Taste Great</strong></p>\r\n\r\n<ul>\r\n	<li>FULFIL bar is packed with 20g of protein.</li>\r\n	<li>FULFIL bars contain 9 multi vitamins which can help reduce tiredness and boost your metabolism.</li>\r\n	<li>FULFIL bars are low in sugar. Each 55g bar has less than&nbsp;<strong>half a teaspoon of sugar.</strong>&nbsp;A typical 55g bar of chocolate has 7 times as much.</li>\r\n	<li>All of our bars are coated in chocolate making FULFIL the perfect snack! TIP: we go great with a cup of tea/ coffee.</li>\r\n</ul>', '<h2>Nutrition facts</h2>\r\n\r\n<p>Per bar</p>\r\n\r\n<p>&nbsp;Nutritional Value Per 55g</p>\r\n\r\n<p>Calories&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;204kcal</p>\r\n\r\n<p>Carbohydrates&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;15g</p>\r\n\r\n<p>Sugar&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1.7g</p>\r\n\r\n<p>Added Sugar&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 0g</p>\r\n\r\n<p>Protein&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;36.3g</p>\r\n\r\n<p>Fat&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;8.3g</p>\r\n\r\n<p>Sodium&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 132mg</p>\r\n\r\n<p>Salt&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 0.73g</p>\r\n\r\n<p>*Your daily values may be higher or lower depending on your calaries needs</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
