(408, 160, 1, 'Olimp Amino EAAs Xplode  Drink With Energy', '<h3>Olimp Amino EAAs Xplode RTD&nbsp;330 ml</h3>\r\n\r\n<p>This product is a carbonated drink with EAA amino acids and caffeine. It stimulates, improves reaction speed, enhances sensitivity, and increases concentration. The drink is lemon-flavored and is a handy and quick way to replenish amino acids. The refreshing formula contains no sugar, fat, or salt. It contains up to 4g of high-quality EAA amino acids and is also low in calories. It&rsquo;s perfect for athletes and those looking to improve concentration during exams and is conducive to vegans and vegetarians.</p>\r\n\r\n<p>Amino EAA Xplode is Olimp&rsquo;s full spectrum amino supplement featuring all nine EAAs to support muscle recovery and repair. In the product&rsquo;s maximum two-scoop serving, you get a combined total of just over 15g of EAAs, with a little more than that being BCAAs. The Polish brand has thrown in a few other amino as well, including glycine, serine, proline, and tyrosine.</p>\r\n\r\n<p>Olimp has now taken Amino EAA Xplode and made it a bit more interesting by turning it into an on-the-go beverage, introducing Amino EAA Xplode Drink Zero. It is a similar kind of concept to the original, bringing together a blend of EAAs to support recovery, although you don&rsquo;t get anywhere near as much as you do in the supplement with only 4g of EAAs in the beverage.</p>\r\n\r\n<p>Another key detail for Olimp&rsquo;s Amino EAA Xplode Drink Zero is that it&rsquo;s actually also an energy drink. To go with the growing trend of energizing beverages, the brand has thrown in some caffeine to go alongside the amino. The product doesn&rsquo;t have a lot of caffeine in it, but enough to get you going and give you an anytime energy boost at 100mg in an entire 330ml can.</p>\r\n\r\n<p>Olimp is launching its all-new Olimp Amino EAA Xplode Drink Zero in Europe shortly with one flavor to choose from in Lemon, which has no sugar or fat, only 20 calories, and its vegan-friendly and naturally flavored.</p>', '<table>\r\n	<tbody>\r\n		<tr>\r\n			<th>Calories</th>\r\n			<th>&nbsp;</th>\r\n			<th>&nbsp;</th>\r\n			<th>&nbsp;</th>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Content</td>\r\n			<td>In 100ml</td>\r\n			<td>In a serving of 330 ml</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Energy value</td>\r\n			<td>25 kJ / 6 kcal)</td>\r\n			<td>83 kJ / 20 kcal</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fat</td>\r\n			<td>0 g</td>\r\n			<td>0 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Incl. fatty acids. Saturated</td>\r\n			<td>0 g</td>\r\n			<td>0 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Carbohydrates</td>\r\n			<td>0 g</td>\r\n			<td>0 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Including sugars</td>\r\n			<td>0 g</td>\r\n			<td>0 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Protein</td>\r\n			<td>1, 2 g</td>\r\n			<td>4 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Salt</td>\r\n			<td>0 g</td>\r\n			<td>0 g</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Caffeine</td>\r\n			<td>30, 3 mg</td>\r\n			<td>100 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>L-leucine</td>\r\n			<td>316 mg</td>\r\n			<td>1043 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>L-valine</td>\r\n			<td>176 mg</td>\r\n			<td>581 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>L- threonine</td>\r\n			<td>170 mg</td>\r\n			<td>561 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>L-lysine</td>\r\n			<td>163 mg</td>\r\n			<td>538 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>L- isoleucine</td>\r\n			<td>139 mg</td>\r\n			<td>459 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>L-methionine</td>\r\n			<td>113 mg</td>\r\n			<td>373 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>L- phenylalanine</td>\r\n			<td>57 mg</td>\r\n			<td>188 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>L-histidine</td>\r\n			<td>46 mg</td>\r\n			<td>152 mg</td>\r\n		</tr>\r\n		<tr>\r\n			<td>L-tryptophan</td>\r\n			<td>32 mg</td>\r\n			<td>106 mg</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
