(410, 161, 1, 'Rabeko Zero Jam', '<h3>Rabeko Zero Jam</h3>\r\n\r\n<p>Rabeko&#39;s famous history began with a varied range of homemade jams based on traditional recipes. Rabeko is now launching a low-calorie version of its jams: the Zero Jam! The unique recipe of this extra light jam contains only 5% sugar, compared to 50-60% for a traditional jam. This jam is available in many delicious flavors.</p>\r\n\r\n<p><strong>Apricot</strong>: dietary fibre: polydextrose (50%), apricots, lemon juice, pectin, sweetener: sucralose, preservative: potassium sorbate.</p>\r\n\r\n<p><strong>Black Cherry</strong>: dietary fibre: polydextrose (50%), black cherries, lemon juice, pectin, sweetener: sucralose, preservative: potassium sorbate.</p>\r\n\r\n<p><strong>Exotic Fruits</strong>&nbsp;: dietary fibre: polydextrose (50%), (ananas, mango, passion fruit), lemon juice, pectin, sweetener: sucralose, preservative: potassium sorbate.</p>\r\n\r\n<p><strong>Forest Fruits</strong>: dietary fibre: polydextrose (50%), (raspberries, blackcurrants, red currants, blackberries), lemon juice, pectin, sweetener: sucralose, preservative: potassium sorbate.</p>\r\n\r\n<p><strong>Orange</strong>: dietary fibre: polydextrose (50%), oranges, lemon juice, pectin, sweetener: sucralose, preservative: potassium sorbate.</p>\r\n\r\n<p><strong>Raspberry</strong>: dietary fibre: polydextrose (50%), raspberries, lemon juice, pectin, sweetener: sucralose, preservative: potassium sorbate.</p>\r\n\r\n<p><strong>Strawberry</strong>: dietary fibre: polydextrose (50%), strawberries, lemon juice, pectin, sweetener: sucralose, preservative: potassium sorbate.</p>\r\n\r\n<p><strong>Keep refrigerated after opening.</strong></p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
