(412, 162, 1, 'Anab Organic Oats Flakes', '<h3>Anab Organic Oats Flakes 500g</h3>\r\n\r\n<p>ANAB Organic Oats Flakes are raw food material that is perfect for breakfast. It is certified EU organic and gluten-free.</p>\r\n\r\n<ul>\r\n	<li>Organic</li>\r\n	<li>Natural</li>\r\n</ul>\r\n\r\n<p>Available in two types. Organic Instant Oat flakes &amp; Organic &amp; Gluten-free oat flakes</p>\r\n\r\n<p>&nbsp;</p>', '', NULL, 0, '', NULL, NULL, '', NULL, NULL),
