(416, 164, 1, 'Applied Nutrition Critical Mass', '<h3><strong>LEAN MASS GAINER</strong></h3>\r\n\r\n<p>Critical Mass&trade; is quite simply the UK&rsquo;s favorite and trusted mass gain supplement. It uses the highest quality ingredients, all of which have been carefully selected for the ability to deliver quality LEAN MASS GAINS allowing you to rack up the calories for your daily count.<br />\r\n<br />\r\nOur lean mass formulation contains 42g of both fast and slowly digested proteins per serving including ISO-XP&trade; whey protein isolate.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>KEY BENEFITS</strong></h3>\r\n\r\n<ul>\r\n	<li>Added HMB, glutamine, leucine &amp; creatine monohydrate</li>\r\n	<li>Creatine increases physical performance in short-term bursts of short-term, high-intensity exercise</li>\r\n	<li>Added fats from&nbsp;CLA &amp; MCT powder</li>\r\n	<li>High calorie protein &amp; carbohydrate shake</li>\r\n	<li>Recommended to be used with iDRIVE&trade; Insulin Driver</li>\r\n	<li>Halal certified product<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<h3><strong>SUGGESTED USE</strong></h3>\r\n\r\n<p>Mix 2.5 scoops (150g) with 500ml of water or skimmed milk and shake well using a shaker bottle. Consume 1-3 servings daily depending on your calorie requirements. Critical Mass is a carbohydrate dense shake and pairs perfectly with Applied Nutrition&rsquo;s GDA (Glucose Disposal Agent) iDRIVE&trade; insulin driver.<br />\r\n<br />\r\nScoops are estimate only, weighing scales are recommended.</p>', '<p><img src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/Critical-Mass-Professional---Nutritionals---1000x1000_600x600.jpg?v=1656349423\\\" /></p>\r\n\r\n<h3><strong>INGREDIENTS</strong></h3>\r\n\r\n<p><strong>Banana Flavour</strong></p>\r\n\r\n<p>Organic Ground&nbsp;<strong>Oats</strong>&nbsp;(Gluten), Maltodextrin, Protein Blend (MPI 90: Milk Protein Isolate (<strong>Milk</strong>), ISO-XPTM 95: Whey Protein Isolate (<strong>Milk</strong>), WPC 80: Whey Protein Concentrate (<strong>Milk</strong>)), L-Leucine, Glutamine Peptides (<strong>Wheat</strong>), Creatine Monohydrate, CLA Powder (Conjugated Linoleic Acid), MCT (Medium Chain Triglycerides), HMB (Beta-Hydroxy Beta-Methylbutyrate), Colour (Turmeric Extract), Flavouring, Emulsifier (Soy Lecithin), HICA (Alpha-Hydroxy Isocaproic Acid), ALA (Alpha Lipoic Acid), DigeZyme&reg; Enzyme Complex (Amylase, Protease, Cellulase, Lactase, Lipase), Sweetener (Sucralose), LactoSpore&reg; (Bacillus Coagulans), Chromium (as Chromium Picolinate).<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Chocolate Flavour</strong></p>\r\n\r\n<p>Organic Ground&nbsp;<strong>Oats</strong>&nbsp;(Gluten), Maltodextrin, Protein Blend (MPI 90: Milk Protein Isolate (<strong>Milk</strong>), ISO-XPTM 95: Whey Protein Isolate (<strong>Milk</strong>), WPC 80: Whey Protein Concentrate (<strong>Milk</strong>)), Fat Reduced Cocoa Powder, L-Leucine, Glutamine Peptides (<strong>Wheat</strong>), Creatine Monohydrate, CLA Powder (Conjugated Linoleic Acid), MCT (Medium Chain Triglycerides), HMB (Beta-Hydroxy Beta-Methylbutyrate), Flavouring, Emulsifier (<strong>Soy</strong>&nbsp;Lecithin), HICA (Alpha-Hydroxy Isocaproic Acid), ALA (Alpha Lipoic Acid), DigeZyme&reg; Enzyme Complex (Amylase, Protease, Cellulase, Lactase, Lipase), Sweetener (Sucralose), LactoSpore&reg; (Bacillus Coagulans), Chromium (as Chromium Picolinate).<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Chocolate Mint Flavour</strong></p>\r\n\r\n<p>Organic Ground&nbsp;<strong>Oats</strong>&nbsp;(Gluten), Maltodextrin, Protein Blend (MPI 90: Milk Protein Isolate (<strong>Milk</strong>), ISO-XPTM 95: Whey Protein Isolate (<strong>Milk</strong>), WPC 80: Whey Protein Concentrate (<strong>Milk</strong>)), Fat Reduced Cocoa Powder, L-Leucine, Glutamine Peptides (<strong>Wheat</strong>), Creatine Monohydrate, CLA Powder (Conjugated Linoleic Acid), MCT (Medium Chain Triglycerides), HMB (Beta-Hydroxy Beta-Methylbutyrate), Flavouring, Emulsifier (<strong>Soy</strong>&nbsp;Leci