(418, 165, 1, 'Applied Nutrition Hair & Nails Capsules', '<h2>Hair, Skin &amp; Nails Capsules</h2>\r\n\r\n<h3>60 CAPSULES | 48G | 30 SERVINGS</h3>\r\n\r\n<p><strong>WITH ZINC, BIOTIN &amp; MARINE COLLAGEN FOR THE MAINTENANCE OF NORMAL HAIR, SKIN &amp; NAIL</strong>S</p>\r\n\r\n<p><strong>Food Supplement</strong></p>\r\n\r\n<p>Hair, Skin &amp; Nails capsules support your natural beauty regime. This product provides key nutrients for healthy hair, skin and nails including zinc, vitamins C &amp; E, biotin and collagen. Zinc contributes to the maintenance of normal hair, skin and nails. Look good and feel great.</p>\r\n\r\n<h3><br />\r\nKEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>Support your natural beauty regime</li>\r\n	<li>With zinc, biotin &amp; marine collagen</li>\r\n	<li>Plant-based veggie shell well suited for consumers with dietary, religious or cultural restrictions</li>\r\n	<li>Halal-certified product</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>SUGGESTED USE</strong></p>\r\n\r\n<p>Take 1 serving (2 capsules) daily with food.</p>', '<h3>NUTRITIONAL INFORMATION</h3>\r\n\r\n<p><img src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/products/Hair_-Skin-_-Nails-Capsules---Nutritionals---1000x1000_600x600.jpg?v=1642241123\\\" /></p>\r\n\r\n<h3>INGREDIENTS</h3>\r\n\r\n<p>Calcium Carbonate, Magnesium Oxide, Ashwagandha Root Extract (Whole Plant) (8:1 Extract) (7% Withanolides), L-Cysteine HCl, Hydrolysed Marine Collagen (<strong>Fish</strong>), Vitamin C, Zinc (Zinc Bisglycinate), Grape Seed Extract, Hyaluronic Acid, Niacin (Nicotinamide), Vitamin E (Dl-Alpha Tocopherol Acetate) (<strong>Soy</strong>), Alpha Lipoic Acid, Pantothenic Acid (D-Pantothenate, Calcium), Copper (Copper Bisglycinate), Vitamin B6 (Pyridoxine Hydrochloride), Vitamin B2 (Riboflavin), Vitamin B1 (Thiamine Mononitrate), Biotin (D-Biotin), Folic Acid (Pteroylmonoglutamic Acid), Vitamin D3 (Cholecalciferol), Vitamin B12 (Cyanocobalamin), Bulking Agent (Microcrystalline Cellulose), Anti-Caking Agents (Silicon Dioxide, Magnesium Stearate), Capsule Shell (Hydroxypropyl Methylcellulose).<br />\r\n<br />\r\n<strong>ALLERGENS:</strong>&nbsp;For allergens, see ingredients listed in&nbsp;<strong>Bold</strong>.</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
