(420, 166, 1, 'THE GYM KEG Sports Water Bottle (2.2 L)', '<h3>THE GYM KEG Sports Water Bottle (2.2 L)</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Huge Water Capacity &ndash; Each plastic drink bottle holds 2.2 litres of water, more than standard water bottles, supporting healthy, all-day hydration for athletes.</li>\r\n	<li>Insulating Sleeve For Fortified Durability &ndash; Crafted with 40% more plastic than standard plastic water bottles and a patent pending neoprene sleeve, The Gym Keg offers more indoor, outdoor and travel durability.</li>\r\n	<li>Take It Everywhere &ndash; A built-in carry handle makes it easier to take your half gallon water bottle with you to work, the gym, outdoor sports, or hiking.</li>\r\n	<li>Ecofriendly &amp; Health Conscious &ndash; Every gym bottle is crafted with lightweight, BPA-free plastic that won&rsquo;t influence water taste or impact your health.</li>\r\n</ul>', '', NULL, 0, '', NULL, NULL, '', NULL, NULL),
