(422, 167, 1, 'Cellucor C4  Original pre-workout Powder', '<h3>Cellucor C4 &nbsp;Original pre-workout</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>C4 Original is built to take your energy, muscular endurance, and pumps to the next level.&nbsp;Ranging from beginners all the way up to the elite competitors, C4 pre-workout products ignite your fitness journey. *Based on IRI market and Euromonitor International data.</p>\r\n\r\n<ul>\r\n	<li><strong>EXPLOSIVE ENERGY</strong>&nbsp;&mdash; Take your training to the next level with explosive C4 Energy from 150mg of caffeine.</li>\r\n	<li><strong>MUSCULAR ENDURANCE</strong>&nbsp;&mdash; Power tough trainings with CarnoSyn&reg; Beta-Alanine, which helps combat muscular fatigue and support muscular endurance*</li>\r\n	<li><strong>INCREDIBLE FLAVORS</strong>&nbsp;&mdash; With billions of servings of C4 branded products sold, the C4 brand has been setting the standard for great flavor for over a decade.*</li>\r\n	<li><strong>PUMP BOOSTER</strong>&nbsp;&mdash; Enhance your pumps via a unique patented combination of Creatine and Nitrates.</li>\r\n</ul>\r\n\r\n<p><strong>Use</strong></p>\r\n\r\n<p>Take one serving (1 level scoop) of C4&reg; Original, mixed with 6 fl. oz of water 20-30 minutes before training. Some individuals may experience a harmless tingling sensation, which is attributed to beta alanine.&nbsp;<strong>USE ONLY AS DIRECTED.</strong></p>', '', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(423, 167, 2, 'Cellucor C4  Original pre-workout Powder', '<h3>Cellucor C4 &nbsp;Original pre-workout</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>C4 Original is built to take your energy, muscular endurance, and pumps to the next level.&nbsp;Ranging from beginners all the way up to the elite competitors, C4 pre-workout products ignite your fitness journey. *Based on IRI market and Euromonitor International data.</p>\r\n\r\n<ul>\r\n	<li><strong>EXPLOSIVE ENERGY</strong>&nbsp;&mdash; Take your training to the next level with explosive C4 Energy from 150mg of caffeine.</li>\r\n	<li><strong>MUSCULAR ENDURANCE</strong>&nbsp;&mdash; Power tough trainings with CarnoSyn&reg; Beta-Alanine, which helps combat muscular fatigue and support muscular endurance*</li>\r\n	<li><strong>INCREDIBLE FLAVORS</strong>&nbsp;&mdash; With billions of servings of C4 branded products sold, the C4 brand has been setting the standard for great flavor for over a decade.*</li>\r\n	<li><strong>PUMP BOOSTER</strong>&nbsp;&mdash; Enhance your pumps via a unique patented combination of Creatine and Nitrates.</li>\r\n</ul>\r\n\r\n<p><strong>Use</strong></p>\r\n\r\n<p>Take one serving (1 level scoop) of C4&reg; Original, mixed with 6 fl. oz of water 20-30 minutes before training. Some individuals may experience a harmless tingling sensation, which is attributed to beta alanine.&nbsp;<strong>USE ONLY AS DIRECTED.</strong></p>\r\n\r\n<p>&nbsp;</p>', '', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(424, 168, 1, 'Bang Energy Drink , Super Creatine, Co Q 10', '<h3>Bang Energy Drink , Super Creatine, Co Q 10</h3>\r\n\r\n<p>Treat your pallet to the refreshing taste of summertime. Take a ride on the wild side with the juicy sensation of Bang Energy&reg;!</p>\r\n\r\n<p>Bang Energy is not your typical sugar-filled, crash-inducing energy drink. Every 16-ounce can contains 300 milligrams of caffeine which has been shown to increase endurance as well as strength in some cases. Yet every one of our 40+ flavors has ZERO sugars, carbs, or calories with a taste like no other! &nbsp;</p>\r\n\r\n<p>Amazing flavor and a blast of energy are just the beginning though &ndash; Bang Energy drinks also contain other ingredients designed to help you get more out of your workout, your day, and your life! Get a dose of Super Creatine, EAAs, and CoQ10 that not only fuel your body but your mind as well!&nbsp;</p>\r\n\r\n<ul>\r\n	<li>NO sugar&nbsp;</li>\r\n	<li>NO calories&nbsp;</li>\r\n	<li>NO carbs&nbsp;</li>\r\n	<li>300 mg of caffeine&nbsp;</li>\r\n	<li>SUPER CREATINE&nbsp;</li>\r\n	<li>EAAs&nbsp;</li>\r\n	<li>CoQ10&nbsp;</li>\r\n	<li>Vegan-friendly</li>\r\n	<li>Gluten-free*&nbsp;</li>\r\n	<li>Keto-Friendly&nbsp;</li>\r\n</ul>', '<p><strong>RECOMMENDED USE</strong></p>\r\n\r\n<p>Serving Size 1 can</p>\r\n\r\n<p><img alt=\\\"Bang-RTD-Label\\\" src=\\\"https://bangenergy.com/wp-content/uploads/2019/05/Bang-RTD-Label.png\\\" /></p>\r\n\r\n<p><strong>Warning</strong>&nbsp;</p>\r\n\r\n<p>Do not use this product if you are pregnant or nursing. Do not consume this product if you are taking any prescription drug and/or have any medical condition. The user of this product assumes all liability if this product is used in a manner not consistent with label guidelines. This product contains caffeine and should not be used with any other caffeine-containing products. This product is intended for use by healthy individuals only.&nbsp;</p>\r\n\r\n<p>Too much caffeine may cause nervousness, irritability, sleeplessness, and, occasionally, rapid heartbeat. Not recommended for use by children under 18 years of age. One&nbsp;can&nbsp;of Bang&reg; provides 300 mg of caffeine,&nbsp;which is more than two cups of coffee.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(425, 168, 2, 'Bang Energy Drink , Super Creatine, Co Q 10', '<h3>Bang Energy Drink , Super Creatine, Co Q 10</h3>\r\n\r\n<p>Treat your pallet to the refreshing taste of summertime. Take a ride on the wild side with the juicy sensation of Bang Energy&reg;!</p>\r\n\r\n<p>Bang Energy is not your typical sugar-filled, crash-inducing energy drink. Every 16-ounce can contains 300 milligrams of caffeine which has been shown to increase endurance as well as strength in some cases. Yet every one of our 40+ flavors has ZERO sugars, carbs, or calories with a taste like no other! &nbsp;</p>\r\n\r\n<p>Amazing flavor and a blast of energy are just the beginning though &ndash; Bang Energy drinks also contain other ingredients designed to help you get more out of your workout, your day, and your life! Get a dose of Super Creatine, EAAs, and CoQ10 that not only fuel your body but your mind as well!&nbsp;</p>\r\n\r\n<ul>\r\n	<li>NO sugar&nbsp;</li>\r\n	<li>NO calories&nbsp;</li>\r\n	<li>NO carbs&nbsp;</li>\r\n	<li>300 mg of caffeine&nbsp;</li>\r\n	<li>SUPER CREATINE&nbsp;</li>\r\n	<li>EAAs&nbsp;</li>\r\n	<li>CoQ10&nbsp;</li>\r\n	<li>Vegan-friendly</li>\r\n	<li>Gluten-free*&nbsp;</li>\r\n	<li>Keto-Friendly&nbsp;</li>\r\n</ul>', '<p><strong>RECOMMENDED USE</strong></p>\r\n\r\n<p>Serving Size 1 can</p>\r\n\r\n<p><img alt=\\\"Bang-RTD-Label\\\" src=\\\"https://bangenergy.com/wp-content/uploads/2019/05/Bang-RTD-Label.png\\\" /></p>\r\n\r\n<p><strong>Warning</strong>&nbsp;</p>\r\n\r\n<p>Do not use this product if you are pregnant or nursing. Do not consume this product if you are taking any prescription drug and/or have any medical condition. The user of this product assumes all liability if this product is used in a manner not consistent with label guidelines. This product contains caffeine and should not be used with any other caffeine-containing products. This product is intended for use by healthy individuals only.&nbsp;</p>\r\n\r\n<p>Too much caffeine may cause nervousness, irritability, sleeplessness, and, occasionally, rapid heartbeat. Not recommended for use by children under 18 years of age. One&nbsp;can&nbsp;of Bang&reg; provides 300 mg of caffeine,&nbsp;which is more than two cups of coffee.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(426, 169, 1, 'Iwon Organic Protein Puffs', '<h3>High in protein. High in fiber &nbsp;&nbsp;&nbsp;</h3>\r\n\r\n<ul>\r\n	<li><strong>Pure organic ingredients:&nbsp;</strong>our delicious protein puffs are formulated with plant-based proteins, and blend the highest quality Non-GMO, soy-free, gluten-free, vegan and kosher ingredients.</li>\r\n	<li><strong>Optimal nutritional profile:&nbsp;</strong>10g protein. 5g fiber. only 2g sugar. only 180 calories. All without sacrificing the flavor you crave.</li>\r\n	<li><strong>On-the-go snacking:&nbsp;</strong>a convenient and tasty high protein snack for anyone living an active lifestyle. sustain your energy levels all day long as you work and play.</li>\r\n	<li><strong>Something for everyone:&nbsp;</strong>from fitness enthusiasts looking for a muscle-building snack, to kids and families who know that nutritious should also mean delicious. these puffs are for you.</li>\r\n	<li><strong>Newly formulated:&nbsp;</strong>a reinvented snack puff for your healthy lifestyle. we&rsquo;ve infused our wholesome ingredients. It available in different flavour like&nbsp;sweet caramelized onion flavor, red pepper flavor and Cheddar Cheese</li>\r\n</ul>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
