(428, 170, 1, 'Applied Nutrition Cream of Rice', '<h2>Cream of Rice&nbsp;</h2>\r\n\r\n<h3>COMPLEX CARBOHYDRATES</h3>\r\n\r\n<h3>EASY DIGESTING | GREAT TASTING | SOURCE OF ENERGY</h3>\r\n\r\n<h3>2KG | 67 SERVINGS</h3>\r\n\r\n<p>Applied Nutrition&rsquo;s Cream of Rice is a great source of carbohydrates which is easy on the stomach and tasty too. Suitable for vegans, this is an excellent source of energy to keep you feeling full and fuelled ready for the day ahead.<br />\r\n&nbsp;</p>\r\n\r\n<h3>KEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>25g of complex carbohydrates per 30g serving</li>\r\n	<li>Perfect mixing with hot &amp; cold water/milk</li>\r\n	<li>Low sugar &amp; low fat</li>\r\n	<li>Suitable for vegans (Except&nbsp;Toffee Biscuit Flavour)</li>\r\n	<li>Halal Certified Product<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<p><img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/Untitled-1_480x480.jpg?v=1646910340\\\" style=\\\"height:267px; width:425px\\\" /></p>', '<h3>NUTRITIONAL INFORMATION</h3>\r\n\r\n<p><img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/Cream-of-Rice-2kg---Nutritionals---1000x1000_600x600.jpg?v=1646912914\\\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>INGREDIENTS</h3>\r\n\r\n<p><strong>Apple Crumble</strong><br />\r\nWhite Rice Flour, Flavouring, Salt, Sucralose, Ground Cinnamon.<br />\r\n<br />\r\n<strong>Golden Syrup</strong><br />\r\nWhite Rice Flour, Flavouring, Salt, Colour (E150a), Sucralose.<br />\r\n<br />\r\n<strong>Raspberry Ripple</strong><br />\r\nWhite Rice Flour, Flavouring, Salt, Sucralose.<br />\r\n<br />\r\n<strong>Toffee Biscuit</strong><br />\r\nWhite Rice Flour, Flavouring, Skim&nbsp;<strong>Milk</strong>&nbsp;Powder, Salt, Colour (E150a), Sucralose.</p>\r\n\r\n<p><strong>Unflavoured</strong><br />\r\nWhite Rice Flour.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ALLERGENS:</strong>&nbsp;Please see ingredients in&nbsp;<strong>BOLD.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>TESTED FOR ATHLETES</h3>\r\n\r\n<p>Every ingredient within this product is carefully selected and monitored through our quality management system to bring you the highest level of assurance. Final products are produced and packaged in an ISO 22000, BRC, GMP &amp; Halal accredited laboratory.<br />\r\n&nbsp;</p>\r\n\r\n<h3>CAUTION &amp; STORAGE</h3>\r\n\r\n<p>Check with a qualified health professional before using this product if you are under the age of 18, pregnant or nursing a baby or if you have any known or suspected medical condition(s) or are taking any prescription or OTC medication(s). Not to be used as a substitute for a varied diet and healthy lifestyle. Store this product in a cool dry place, away from children. Do not exceed suggested use.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(429, 170, 2, 'Applied Nutrition Cream of Rice', '<h2>Cream of Rice&nbsp;</h2>\r\n\r\n<h3>COMPLEX CARBOHYDRATES</h3>\r\n\r\n<h3>EASY DIGESTING | GREAT TASTING | SOURCE OF ENERGY</h3>\r\n\r\n<h3>2KG | 67 SERVINGS</h3>\r\n\r\n<p>Applied Nutrition&rsquo;s Cream of Rice is a great source of carbohydrates which is easy on the stomach and tasty too. Suitable for vegans, this is an excellent source of energy to keep you feeling full and fuelled ready for the day ahead.<br />\r\n&nbsp;</p>\r\n\r\n<h3>KEY BENEFITS</h3>\r\n\r\n<ul>\r\n	<li>25g of complex carbohydrates per 30g serving</li>\r\n	<li>Perfect mixing with hot &amp; cold water/milk</li>\r\n	<li>Low sugar &amp; low fat</li>\r\n	<li>Suitable for vegans (Except&nbsp;Toffee Biscuit Flavour)</li>\r\n	<li>Halal Certified Product<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<p><img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/Untitled-1_480x480.jpg?v=1646910340\\\" style=\\\"height:267px; width:425px\\\" /></p>', '<h3>NUTRITIONAL INFORMATION</h3>\r\n\r\n<p><img alt=\\\"\\\" src=\\\"https://cdn.shopify.com/s/files/1/0454/0871/4919/files/Cream-of-Rice-2kg---Nutritionals---1000x1000_600x600.jpg?v=1646912914\\\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>INGREDIENTS</h3>\r\n\r\n<p><strong>Apple Crumble</strong><br />\r\nWhite Rice Flour, Flavouring, Salt, Sucralose, Ground Cinnamon.<br />\r\n<br />\r\n<strong>Golden Syrup</strong><br />\r\nWhite Rice Flour, Flavouring, Salt, Colour (E150a), Sucralose.<br />\r\n<br />\r\n<strong>Raspberry Ripple</strong><br />\r\nWhite Rice Flour, Flavouring, Salt, Sucralose.<br />\r\n<br />\r\n<strong>Toffee Biscuit</strong><br />\r\nWhite Rice Flour, Flavouring, Skim&nbsp;<strong>Milk</strong>&nbsp;Powder, Salt, Colour (E150a), Sucralose.</p>\r\n\r\n<p><strong>Unflavoured</strong><br />\r\nWhite Rice Flour.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ALLERGENS:</strong>&nbsp;Please see ingredients in&nbsp;<strong>BOLD.</strong></p>\r\n\r\n<p>&nbsp;</p