(430, 171, 1, 'Manuka Honey New Zealand', '<h2>Manuka Honey New Zealand&nbsp;</h2>\r\n\r\n<h3>Manuka Honey Blend | UMF 10 + |&nbsp; UMF 15+</h3>\r\n\r\n<p>Mānuka honey is nature&#39;s greatest gift to support everyday wellness.All of our raw Mānuka honey products are produced in our HACCP certified production facility in New Zealand. We operate an industry-leading traceability system which allows you to trace your honey jar from hive to hand. This unique identification system provides you the test results and origin of every product and ensures that every honey jar you receive is authentic.</p>\r\n\r\n<p><strong>MULTIPLE USES</strong>:</p>\r\n\r\n<p>&nbsp;Our superfood is used for home remedies, DIY beauty regimes, energy for active lifestyles or drizzled on your food. In addition, world renowned Manuka honey has naturally occurring live enzymes, vitamins and is taken by nutritionists and athletes.</p>\r\n\r\n<p><strong>AUTHENTIC RAW MANUKA HONEY:</strong></p>\r\n\r\n<p>&nbsp; With its medicinal properties and health benefits, 100% Pure NZ Manuka Honey UMF 10+ containing MGO 263+, non-GMO&nbsp; and also&nbsp;Manuka Honey UMF 15+ containing MGO 514+, non-GMO Mānuka honey is nature&#39;s greatest gift to support everyday wellness.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(431, 171, 2, 'Manuka Honey New Zealand', '<h2>Manuka Honey New Zealand&nbsp;</h2>\r\n\r\n<h3>Manuka Honey Blend | UMF 10 + |&nbsp; UMF 15+</h3>\r\n\r\n<p>Mānuka honey is nature&#39;s greatest gift to support everyday wellness.All of our raw Mānuka honey products are produced in our HACCP certified production facility in New Zealand. We operate an industry-leading traceability system which allows you to trace your honey jar from hive to hand. This unique identification system provides you the test results and origin of every product and ensures that every honey jar you receive is authentic.</p>\r\n\r\n<p><strong>MULTIPLE USES</strong>:</p>\r\n\r\n<p>&nbsp;Our superfood is used for home remedies, DIY beauty regimes, energy for active lifestyles or drizzled on your food. In addition, world renowned Manuka honey has naturally occurring live enzymes, vitamins and is taken by nutritionists and athletes.</p>\r\n\r\n<p><strong>AUTHENTIC RAW MANUKA HONEY:</strong></p>\r\n\r\n<p>&nbsp; With its medicinal properties and health benefits, 100% Pure NZ Manuka Honey UMF 10+ containing MGO 263+, non-GMO&nbsp; and also&nbsp;Manuka Honey UMF 15+ containing MGO 514+, non-GMO Mānuka honey is nature&#39;s greatest gift to support everyday wellness.</p>', '', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(432, 172, 1, 'Peanut Butter & Co Peanut butter Spread', '<h3>Peanut Butter &amp; Co Peanut butter Spread</h3>\r\n\r\n<p>Yummy Peanut butter spread with real tast of penaut to make your day Awsome.</p>\r\n\r\n<p>Peanut Butter available is different style like Crunch time, Smooth operator, Dark chocolate dream, White chocolate wonderful, Bee&#39;s Knees, Cinnamon Raisin.</p>', '<p><img src=\\\"https://cdn.accentuate.cloud/images/9232946/NutritionLabel-(9).png?v=1647970947003\\\" style=\\\"height:600px; width:400px\\\" /></p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(433, 172, 2, 'Peanut Butter & Co Peanut butter Spread', '<h3>Peanut Butter &amp; Co Peanut butter Spread</h3>\r\n\r\n<p>Yummy Peanut butter spread with real tast of penaut to make your day Awsome.</p>\r\n\r\n<p>Peanut Butter available is different style like Crunch time, Smooth operator, Dark chocolate dream, White chocolate wonderful, Bee&#39;s Knees, Cinnamon Raisin.</p>', '<p><img src=\\\"https://cdn.accentuate.cloud/images/9232946/NutritionLabel-(9).png?v=1647970947003\\\" /></p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(434, 173, 1, 'EFX Karbolyn Fuel', '<h3>EFX Karbolyn Fuel</h3>\r\n\r\n<p>EFX Karbolin Fuel is the best choice for obtaining complex carbohydrates, which are carbohydrates that help maintain a feeling of fullness and energy levels for a longer period of time, and which must be adopted in the event of adherence to a diet as it is an important auxiliary element due to the fact that EFX does not contain Karbolene Fuel on sugar and gluten.</p>\r\n\r\n<h3>WHAT IS KARBOLYN?</h3>\r\n\r\n<ul>\r\n	<li>Fast-Absorbing Carb With Complex Carb Sustainability</li>\r\n	<li>Glycogen Loading Fuel Source</li>\r\n	<li>Sugar-Free, Gluten-Free, Stimulant-Free, Vegan-Friendly</li>\r\n	<li>Invented By EFX Sports Scientist Dr. Jeff Golini</li>\r\n	<li>Informed Sport Certified, Banned-Substance Free</li>\r\n	<li>Manufactured By Us &ndash; We Control ALL Production</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>WHY USE KARBOLYN?</h3>\r\n\r\n<ul>\r\n	<li>Perfect Fuel Source: Use before, during and after training</li>\r\n	<li>Enhance Athletic Endurance</li>\r\n	<li>Intensify Muscle Pumps For Bodybuilders</li>\r\n	<li>Maintain High-Intensity Training Levels</li>\r\n	<li>Maximize Strength &amp; Power Output</li>\r\n</ul>', '<h3>SUPPLEMENT FACTS</h3>\r\n\r\n<p>Serving Size 53.4g (One Scoop)</p>\r\n\r\n<p>Servings Per Container 36 (4.4lbs), 18 (2.2lbs)</p>\r\n\r\n<hr />\r\n<table border=\\\"0\\\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<th>AMOUNT PER SERVING</th>\r\n			<th>% DAILY VALUE</th>\r\n		</tr>\r\n		<tr>\r\n			<td>Calories</td>\r\n			<td>200</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Total Carbohydrate</td>\r\n			<td>50g</td>\r\n			<td>18%**</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Karbolyn (homopolysaccharide) derived from potato, rice and corn</td>\r\n			<td>50g</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<hr />\r\n<p>**Percent Daily Values are based on 2,000 calorie diet.<br />\r\nDaily Value not established.</p>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2>DIRECTIONS</h2>\r\n\r\n<p><strong>SUGGESTED USE FOR INDIVIDUALS:</strong>&nbsp;As a dietary supplement, mix 1 scoop in a shaker cup with 16 ounces of water and drink 30 minutes before exercise.</p>\r\n\r\n<p><strong>USAGE GUIDELINES FOR INTENSE TRAINING OR ATHLETIC EVENTS:</strong><br />\r\nBEFORE TRAINING &ndash; Drink 1 serving 30 minutes before exercise.<br />\r\nDURING TRAINING &ndash; Sip on 1 serving during exercise.<br />\r\nAFTER TRAINING &ndash; Drink 1 serving after exercise.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(435, 173, 2, 'EFX Karbolyn Fuel', '<p>EFX Karbolin Fuel is the best choice for obtaining complex carbohydrates, which are carbohydrates that help maintain a feeling of fullness and energy levels for a longer period of time, and which must be adopted in the event of adherence to a diet as it is an important auxiliary element due to the fact that EFX does not contain Karbolene Fuel on sugar and gluten.</p>\r\n\r\n<h2>WHAT IS KARBOLYN?</h2>\r\n\r\n<ul>\r\n	<li>Fast-Absorbing Carb With Complex Carb Sustainability</li>\r\n	<li>Glycogen Loading Fuel Source</li>\r\n	<li>Sugar-Free, Gluten-Free, Stimulant-Free, Vegan-Friendly</li>\r\n	<li>Invented By EFX Sports Scientist Dr. Jeff Golini</li>\r\n	<li>Informed Sport Certified, Banned-Substance Free</li>\r\n	<li>Manufactured By Us &ndash; We Control ALL Production</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>WHY USE KARBOLYN?</h2>\r\n\r\n<ul>\r\n	<li>Perfect Fuel Source: Use before, during and after training</li>\r\n	<li>Enhance Athletic Endurance</li>\r\n	<li>Intensify Muscle Pumps For Bodybuilders</li>\r\n	<li>Maintain High-Intensity Training Levels</li>\r\n	<li>Maximize Strength &amp; Power Output</li>\r\n</ul>', '<h3>SUPPLEMENT FACTS</h3>\r\n\r\n<p>Serving Size 53.4g (One Scoop)</p>\r\n\r\n<p>Servings Per Container 36 (4.4lbs), 18 (2.2lbs)</p>\r\n\r\n<hr />\r\n<table border=\\\"0\\\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<th>AMOUNT PER SERVING</th>\r\n			<th>% DAILY VALUE</th>\r\n		</tr>\r\n		<tr>\r\n			<td>Calories</td>\r\n			<td>200</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Total Carbohydrate</td>\r\n			<td>50g</td>\r\n			<td>18%**</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Karbolyn (homopolysaccharide) derived from potato, rice and corn</td>\r\n			<td>50g</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<hr />\r\n<p>**Percent Daily Values are based on 2,000 calorie diet.<br />\r\nDaily Value not established.</p>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2>DIRECTIONS</h2>\r\n\r\n<p><strong>SUGGESTED USE FOR INDIVIDUALS:</strong>&nbsp;As a dietary supplement, mix 1 scoop in a shaker cup with 16 ounces of water and drink 30 minutes before exercise.</p>\r\n\r\n<p><strong>USAGE GUIDELINES FOR INTENSE TRAINING OR ATHLETIC EVENTS:</strong><br />\r\nBEFORE TRAINING &ndash; Drink 1 serving 30 minutes before exercise.<br />\r\nDURING TRAINING &ndash; Sip on 1 serving during exercise.<br />\r\nAFTER TRAINING &ndash; Drink 1 serving after exercise.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0);
